486	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ClaseCalificacionTipo	\N	0	Estructura	\N	f	Estructura	En construcción, es el nombre que recibe el conjunto de elementos, unidos, ensamblados o conectados entre sí, que tienen la función de recibir cargas, soportar esfuerzos y transmitir esas cargas al suelo, garantizando así la función estático - resistente de la construcción. Sus componentes son: armazón, muros y cubierta.
