39	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DestinacionEconomicaTipo	\N	1	Agricola	\N	f	Agrícola	Se califica con destino agrícola, aquellos predios con funcionalidad de laboreo agrícola, terrenos que han sido transformados y ocupados para la producción de cultivos cuyo objetivo es satisfacer las necesidades alimentarias, comerciales y agrícolas.\n\nEn caso de encontrar actividad agrícola y actividad pecuaria en un mismo predio, se califica según la actividad que predomine. Si, ambas actividades tienen el mismo porcentaje de participación en el predio, se debe calificar como agrícola.
