LADM_COL_V3_0.ili	2.3	LADM_COL_V3_0{ ISO19107_PLANAS_V3_0}	INTERLIS 2.3;\n\n/** ISO 19152 LADM country profile COL Core Model.\n * \n * -----------------------------------------------------------\n * \n * LADM es un modelo conceptual de la realidad que concreta una ontología y establece una semántica para la administración del territorio.\n * \n * -----------------------------------------------------------\n *  revision history\n * -----------------------------------------------------------\n * \n *  30.01.2018/fm : Cambio del tipo de dato del atributo Ext_Direccion de la clase Unidad Espacial a ExtDireccion; atributo ext_PID de la calse LA_Interesado cambia de OID a ExtInteresado; Cambio de cardinalidad en relacion miembros entre LA_Interesado y LA_Agrupacion_Interesados de 0..1 a 0..*\n *  07.02.2018/fm-gc: Ajuste al tipo de dato de la unidad Peso, pasa a tener precision 1 para evitar ser tratado cmo atributo entero y aumentar su tamaño\n *  19.02.2018/fm-gc: ampliación del dominio al tipo de dato Peso\n *  26.02.2018/fm-lj: cambio del nombre del dominio ISO19125_Type a ISO19125_Tipo\n *  19.04.2018/vb fm: Ajuste al constraint Fraccion, denominador mayor a 0\n *  19.04.2018/vb fm: Cambio en la cardinalidad del atributo u_Local_Id de la clase LA_BAUnit de 0..1 a 1\n * 17.07.2018/fm : se incluye escritura en dominio COL_FuenteAdministrativaTipo\n * 10.08.2018/fm : Se eliminan los atributos ai_local_id y ai_espacio_de_nombres de la clase LA_Agrupacion_Interesados\n * 27.08.2018/fm : Ajuste a la cardinalidad de asociacion puntoFuente de 1..* a 0..*\n * 25.09.2018/at: Se ajusta la longitud del atributo Codigo_Registral_Transaccion en la clase COL_FuenteAdministrativa a 5 caracteres de acuerdo a la Resolución 3973 de 2018\n * -----------------------------------------------------------\n * \n *  (c) IGAC y SNR con apoyo de la Cooperacion Suiza\n * \n * -----------------------------------------------------------\n */\nMODEL LADM_COL_V3_0 (es)\nAT "http://www.proadmintierra.info/"\nVERSION "V1.2.0"  // 2019-08-13 // =\n  IMPORTS ISO19107_PLANAS_V3_0;\n\n  UNIT\n\n    PesoColombiano [COP] EXTENDS INTERLIS.MONEY;\n\n    Area (ABSTRACT) = (INTERLIS.LENGTH * INTERLIS.LENGTH);\n\n    MetroCuadrado [m2] EXTENDS Area = (INTERLIS.m * INTERLIS.m);\n\n    Centrimetro [cm] = 1 / 100 [INTERLIS.m];\n\n  TOPIC LADM_Nucleo(ABSTRACT) =\n\n    DOMAIN\n\n      CharacterString = TEXT*255;\n\n      /** Traducción del dominio CI_PresentationFormCode de la norma ISO 19115:2003. Indica el modo en el que se representan los datos.\n       */\n      CI_Forma_Presentacion_Codigo = (\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Imagen"\n        Imagen,\n        !!@ ili2db.dispName = "Documento"\n        Documento,\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Mapa"\n        Mapa,\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Video"\n        Video,\n        /** Definición en la ISO 19115:2003.\n         */\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_AreaTipo = (\n        /** Corresponde al área gráfica inscrita en la base de datos catastral sobre un predio antes de efectuar la transformación al nuevo sistema de proyección para catastro.\n         */\n        !!@ ili2db.dispName = "Area catastral gráfica del predio"\n        Area_Catastral_Grafica,\n        /** Corresponde al área alfanumérica inscrita en la base de datos catastral sobre un predio antes de efectuar la transformación al nuevo sistema de proyección para catastro. En la mayoría de los casos el área alfanumérica corresponde al valor de área inscrita en los datos de Registro.\n         */\n        !!@ ili2db.dispName = "Area catastral alfanumérica"\n        Area_Catastral_Alfanumerica\n      );\n\n      COL_ContenidoNivelTipo = (\n        !!@ ili2db.dispName = "Construcción convencional"\n        Construccion_Convencional,\n        !!@ ili2db.dispName = "Construcción no convencional"\n        Construccion_No_Convencional,\n        !!@ ili2db.dispName = "Consuetudinario"\n        Consuetudinario,\n        !!@ ili2db.dispName = "Formal"\n        Formal,\n        !!@ ili2db.dispName = "Informal"\n        Informal,\n        !!@ ili2db.dispName = "Responsabilidad"\n        Responsabilidad,\n        !!@ ili2db.dispName = "Restricción derecho público"\n        Restriccion_Derecho_Publico,\n        !!@ ili2db.dispName = "Restricción derecho privado"\n        Restriccion_Derecho_Privado\n      );\n\n      COL_DimensionTipo = (\n        !!@ ili2db.dispName = "Dimensión 2D"\n        Dim2D,\n        !!@ ili2db.dispName = "Dimensión 3D"\n        Dim3D,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_EstadoRedServiciosTipo = (\n        !!@ ili2db.dispName = "Planeado"\n        Planeado,\n        !!@ ili2db.dispName = "En uso"\n        En_Uso,\n        !!@ ili2db.dispName = "Fuera de servicio"\n        Fuera_De_Servicio,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_EstructuraTipo = (\n        !!@ ili2db.dispName = "Croquis"\n        Croquis,\n        !!@ ili2db.dispName = "Línea no estructurada"\n        Linea_no_Estructurada,\n        !!@ ili2db.dispName = "Texto"\n        Texto,\n        !!@ ili2db.dispName = "Topológico"\n        Topologico\n      );\n\n      COL_FuenteEspacialTipo = (\n        /** Ilustración análoga del levantamiento catastral de un predio.\n         */\n        !!@ ili2db.dispName = "Croquis de campo"\n        Croquis_Campo,\n        /** Datos tomados por un equipo GNSS sin ningún tipo de postprocesamiento.\n         */\n        !!@ ili2db.dispName = "Datos crudos (GPS, Estación total, LiDAR, etc.)"\n        Datos_Crudos,\n        /** Imagen producto de la toma de fotografías aéreas o satélites, en la cual han sido corregidos los desplazamientos causados por la inclinación de la cámara o sensor y la curvatura de la superficie del terreno. Está referida a un sistema de proyección cartográfica, por lo que posee las características geométricas de un mapa con el factor adicional de que los objetos se encuentran representados de forma real en la imagen de la fotográfica.\n         */\n        !!@ ili2db.dispName = "Ortofoto"\n        Ortofoto,\n        /** Informe técnico de levantamiento catastral de un predio.\n         */\n        !!@ ili2db.dispName = "Informe técnico"\n        Informe_Tecnico,\n        /** Registro fotográfico del levantamiento catastral de un predio.\n         */\n        !!@ ili2db.dispName = "Registro fotográfico"\n        Registro_Fotografico\n      );\n\n      COL_GrupoInteresadoTipo = (\n        /** Agrupación de personas naturales.\n         */\n        !!@ ili2db.dispName = "Grupo civil"\n        Grupo_Civil,\n        /** Agrupación de personas jurídicas.\n         */\n        !!@ ili2db.dispName = "Grupo empresarial"\n        Grupo_Empresarial,\n        /** Agrupación de personas pertenecientes a un grupo étnico.\n         */\n        !!@ ili2db.dispName = "Grupo étnico"\n        Grupo_Etnico,\n        /** Agrupación de personas naturales y jurídicas.\n         */\n        !!@ ili2db.dispName = "Grupo mixto"\n        Grupo_Mixto\n      );\n\n      /** Si ha sido situado por interpolación, de qué manera se ha hecho.\n       */\n      COL_InterpolacionTipo = (\n        !!@ ili2db.dispName = "Aislado"\n        Aislado,\n        !!@ ili2db.dispName = "Intermedio arco"\n        Intermedio_Arco,\n        !!@ ili2db.dispName = "Intermedio línea"\n        Intermedio_Linea\n      );\n\n      COL_MetodoProduccionTipo = (\n        /** Aquellos que requieren una visita campo con el fin de\n         * recolectar la realidad de los bienes inmuebles.\n         */\n        !!@ ili2db.dispName = "Método directo"\n        Metodo_Directo,\n        /** aquellos métodos identificación física, jurídica y\n         * económica de los inmuebles a través del uso de de sensores\n         * remotos, integración registros administrativos, modelos ísticos y\n         * econométricos, análisis de Big Data y fuentes secundarias como\n         * observatorios inmobiliarios, su posterior incorporación en la base catastral.\n         */\n        !!@ ili2db.dispName = "Método indirecto"\n        Metodo_Indirecto,\n        /** Son los derivados participación de la comunidad en el suministro de información que sirva como insumo para el desarrollo de los procesos catastrales. Los gestores catastrales propenderán por la adopción nuevas tecnologías y procesos comunitarios que faciliten la participación los ciudadanos.\n         */\n        !!@ ili2db.dispName = "Metodo declarativo y colaborativo"\n        Medoto_Declarativo_y_Colaborativo\n      );\n\n      COL_PuntoTipo = (\n        !!@ ili2db.dispName = "Control"\n        Control,\n        !!@ ili2db.dispName = "Catastro"\n        Catastro,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_RegistroTipo = (\n        !!@ ili2db.dispName = "Rural"\n        Rural,\n        !!@ ili2db.dispName = "Urbano"\n        Urbano,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_UnidadAdministrativaBasicaTipo = (\n        /** Unidad administrativa básica de la temática predial.\n         */\n        !!@ ili2db.dispName = "Predio"\n        Predio,\n        /** Unidad administrativa básica de la temática de ordenamiento territorial.\n         */\n        !!@ ili2db.dispName = "Ordenamiento territorial"\n        Ordenamiento_Territorial,\n        /** Unidad administrativa básica de la temática de servicios públicos.\n         */\n        !!@ ili2db.dispName = "Servicios públicos"\n        Servicios_Publicos,\n        /** Unidad administrativa básica de la temática de reservas naturales.\n         */\n        !!@ ili2db.dispName = "Reservas naturales"\n        Reservas_Naturales,\n        /** Unidad administrativa básica de la temática de parques naturales.\n         */\n        !!@ ili2db.dispName = "Parques naturales"\n        Parques_Naturales,\n        /** Unidad administrativa básica de la temática de amenazas de riesgo.\n         */\n        !!@ ili2db.dispName = "Amenazas de riesgos"\n        Amenazas_Riesgos,\n        /** Unidad administrativa básica de la temática de servidumbres.\n         */\n        !!@ ili2db.dispName = "Servidumbre"\n        Servidumbre,\n        /** Unidad administrativa básica de la temática de superficies de agua.\n         */\n        !!@ ili2db.dispName = "Superficies de agua"\n        Superficies_Agua,\n        /** Unidad administrativa básica de la temática de transporte.\n         */\n        !!@ ili2db.dispName = "Transporte"\n        Transporte\n      );\n\n      COL_VolumenTipo = (\n        !!@ ili2db.dispName = "Oficial"\n        Oficial,\n        !!@ ili2db.dispName = "Calculado"\n        Calculado,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      Integer = 0 .. 999999999;\n\n      COL_EstadoDisponibilidadTipo = (\n        /** La fuente fue convertida o recibió algún tratamiento.\n         */\n        !!@ ili2db.dispName = "Convertido"\n        Convertido,\n        /** Se desconoce la disponibilidad de la fuente.\n         */\n        !!@ ili2db.dispName = "Desconocido"\n        Desconocido,\n        /** La fuente está disponible.\n         */\n        !!@ ili2db.dispName = "Disponible"\n        Disponible\n      );\n\n      COL_ISO19125_Tipo = (\n        !!@ ili2db.dispName = "Disjunto"\n        Disjunto,\n        !!@ ili2db.dispName = "Toca"\n        Toca,\n        !!@ ili2db.dispName = "Superpone"\n        Superpone,\n        !!@ ili2db.dispName = "Desconocido"\n        Desconocido\n      );\n\n      COL_RelacionSuperficieTipo = (\n        !!@ ili2db.dispName = "En rasante"\n        En_Rasante,\n        !!@ ili2db.dispName = "En vuelo"\n        En_Vuelo,\n        !!@ ili2db.dispName = "En subsuelo"\n        En_Subsuelo,\n        !!@ ili2db.dispName = "Otro"\n        Otro\n      );\n\n      COL_UnidadEdificacionTipo = (\n        !!@ ili2db.dispName = "Compartido"\n        Compartido,\n        !!@ ili2db.dispName = "Individual"\n        Individual\n      );\n\n      Currency = -2000000000.00 .. 2000000000.00;\n\n      Real = 0.000 .. 999999999.999;\n\n    /** Estructura que proviene de la traducción de la clase CC_OperationMethod de la ISO 19111. Indica el método utilizado, mediante un algoritmo o un procedimiento, para realizar operaciones con coordenadas.\n     */\n    STRUCTURE CC_MetodoOperacion =\n      /** Fórmulas o procedimientos utilizadoa por este método de operación de coordenadas. Esto puede ser una referencia a una publicación. Tenga en cuenta que el método de operación puede no ser analítico, en cuyo caso este atributo hace referencia o contiene el procedimiento, no una fórmula analítica.\n       */\n      !!@ ili2db.dispName = "Fórmula"\n      Formula : MANDATORY CharacterString;\n      /** Número de dimensiones en la fuente CRS de este método de operación de coordenadas.\n       */\n      !!@ ili2db.dispName = "Dimensiones origen"\n      Dimensiones_Origen : Integer;\n      /** Número de dimensiones en el CRS de destino de este método de operación de coordenadas.\n       */\n      !!@ ili2db.dispName = "Ddimensiones objetivo"\n      Ddimensiones_Objetivo : Integer;\n    END CC_MetodoOperacion;\n\n    !!@ ili2db.dispName = "Valores de área"\n    STRUCTURE COL_AreaValor =\n      /** Indica si el valor a registrar corresponde al área gráfica o alfanumérica de la base de datos catastral.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_AreaTipo;\n      /** Corresponde al valor del área registrada en la base de datos catastral.\n       */\n      !!@ ili2db.dispName = "Área"\n      Area : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\n      /** Parametros de la proyección utilizada para el cálculo del área de la forma proj, ejemplo: 'EPSG:3116', '+proj=tmerc +lat_0=4.59620041666667 +lon_0=-74.0775079166667 +k=1 +x_0=1000000 +y_0=1000000 +ellps=GRS80 +towgs84=0,0,0,0,0,0,0 +units=m +no_defs'\n       */\n      !!@ ili2db.dispName = "Datos de la proyección"\n      Datos_Proyeccion : TEXT;\n    END COL_AreaValor;\n\n    /** Referencia a una clase externa para gestionar direcciones.\n     */\n    !!@ ili2db.dispName = "Dirección"\n    STRUCTURE ExtDireccion =\n      !!@ ili2db.dispName = "Tipo de dirección"\n      Tipo_Direccion : MANDATORY (\n        !!@ ili2db.dispName = "Estructurada"\n        Estructurada,\n        !!@ ili2db.dispName = "No estructurada"\n        No_Estructurada\n      );\n      !!@ ili2db.dispName = "Es dirección principal"\n      Es_Direccion_Principal : BOOLEAN;\n      /** Par de valores georreferenciados (x,y) en la que se encuentra la dirección.\n       */\n      !!@ ili2db.dispName = "Localización"\n      Localizacion : ISO19107_PLANAS_V3_0.GM_Point3D;\n      !!@ ili2db.dispName = "Código postal"\n      Codigo_Postal : CharacterString;\n      !!@ ili2db.dispName = "Clase de vía principal"\n      Clase_Via_Principal : (\n        !!@ ili2db.dispName = "Avenida calle"\n        Avenida_Calle,\n        !!@ ili2db.dispName = "Avenida carrera"\n        Avenida_Carrera,\n        !!@ ili2db.dispName = "Avenida"\n        Avenida,\n        !!@ ili2db.dispName = "Autopista"\n        Autopista,\n        !!@ ili2db.dispName = "Circunvalar"\n        Circunvalar,\n        !!@ ili2db.dispName = "Calle"\n        Calle,\n        !!@ ili2db.dispName = "Carrera"\n        Carrera,\n        !!@ ili2db.dispName = "Diagonal"\n        Diagonal,\n        !!@ ili2db.dispName = "Transversal"\n        Transversal,\n        !!@ ili2db.dispName = "Circular"\n        Circular\n      );\n      !!@ ili2db.dispName = "Valor vía principal"\n      Valor_Via_Principal : TEXT*100;\n      !!@ ili2db.dispName = "Letra vía principal"\n      Letra_Via_Principal : TEXT*20;\n      !!@ ili2db.dispName = "Sector de la ciudad"\n      Sector_Ciudad : (\n        Norte,\n        Sur,\n        Este,\n        Oeste\n      );\n      !!@ ili2db.dispName = "Valor de vía generadora"\n      Valor_Via_Generadora : TEXT*100;\n      !!@ ili2db.dispName = "Letra de vía generadora"\n      Letra_Via_Generadora : TEXT*20;\n      !!@ ili2db.dispName = "Número del predio"\n      Numero_Predio : TEXT*20;\n      !!@ ili2db.dispName = "Sector del predio"\n      Sector_Predio : (\n        Norte,\n        Sur,\n        Este,\n        Oeste\n      );\n      !!@ ili2db.dispName = "Complemento"\n      Complemento : TEXT*255;\n      !!@ ili2db.dispName = "Nombre del predio"\n      Nombre_Predio : TEXT*255;\n    END ExtDireccion;\n\n    /** Estructura para la definición de un tipo de dato personalizado que permite indicar una fracción o quebrado cona serie específica de condiciones.\n     */\n    STRUCTURE Fraccion =\n      /** Parte inferior de la fracción. Debe ser mayor que 0. Debe ser mayor que el numerador.\n       */\n      !!@ ili2db.dispName = "Denominador"\n      Denominador : MANDATORY Integer;\n      /** Parte superior de la fracción. Debe ser mayor que 0. Debe sder menor que el denominador.\n       */\n      !!@ ili2db.dispName = "Numerador"\n      Numerador : MANDATORY Integer;\n      MANDATORY CONSTRAINT\n        Denominador > 0;\n      MANDATORY CONSTRAINT\n        Numerador > 0;\n      MANDATORY CONSTRAINT\n        Denominador >= Numerador;\n    END Fraccion;\n\n    CLASS Oid (ABSTRACT) =\n      /** Identificador único global. Corresponde al atributo de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Espacio de nombres"\n      Espacio_De_Nombres : MANDATORY CharacterString;\n      /** Identificador único local.\n       */\n      !!@ ili2db.dispName = "Local ID"\n      Local_Id : MANDATORY CharacterString;\n    END Oid;\n\n    DOMAIN\n\n      COL_FuenteAdministrativaTipo = (\n        /** Documento público es el otorgado por el funcionario público en ejercicio de sus funciones o con su intervención. Así mismo, es público el documento otorgado por un particular en ejercicio de funciones públicas o con su intervención. Cuando consiste en un escrito autorizado o suscrito por el respectivo funcionario, es instrumento público; cuando es autorizado por un notario o quien haga sus veces y ha sido incorporado en el respectivo protocolo, se denomina escritura pública.\n         */\n        !!@ ili2db.dispName = "Documento público"\n        Documento_Publico,\n        /** El documento privado es aquel documento que no cumple los requisitos del documento público, es decir, es un documento que no ha sido elaborado por un funcionario público, ni ha habido intervención de éste para su elaboración.\n         */\n        !!@ ili2db.dispName = "Documento privado"\n        Documento_Privado\n      );\n\n      COL_RedServiciosTipo = (\n        !!@ ili2db.dispName = "Petróleo"\n        Petroleo,\n        !!@ ili2db.dispName = "Químicos"\n        Quimicos,\n        !!@ ili2db.dispName = "Red térmica"\n        Red_Termica,\n        !!@ ili2db.dispName = "Telecomunicación"\n        Telecomunicacion\n      );\n\n      Peso = 0.0 .. 999999999999999.0 [LADM_COL_V3_0.COP];\n\n    /** Registro de la fórmula o procedimiento utilizado en la transformación y de su resultado.\n     */\n    STRUCTURE COL_Transformacion =\n      /** Fórmula o procedimiento utilizado en la transformación.\n       */\n      !!@ ili2db.dispName = "Transformación"\n      Transformacion : MANDATORY LADM_COL_V3_0.LADM_Nucleo.CC_MetodoOperacion;\n      /** Geometría una vez realizado el proceso de transformación.\n       */\n      !!@ ili2db.dispName = "Localización transformada"\n      Localizacion_Transformada : MANDATORY ISO19107_PLANAS_V3_0.GM_Point3D;\n    END COL_Transformacion;\n\n    /** Control externo de la unidad de edificación física.\n     */\n    STRUCTURE ExtUnidadEdificacionFisica =\n      !!@ ili2db.dispName = "Ext dirección id"\n      Ext_Direccion_ID : LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\n    END ExtUnidadEdificacionFisica;\n\n    /** Referencia a una imagen mediante su url.\n     */\n    STRUCTURE Imagen =\n      /** url de la imagen.\n       */\n      !!@ ili2db.dispName = "uri"\n      uri : CharacterString;\n    END Imagen;\n\n    /** Clase abstracta que permite gestionar el histórico del conjunto de clases, las cuales heredan de esta, excepto las fuentes.\n     */\n    CLASS ObjetoVersionado (ABSTRACT)\n    EXTENDS Oid =\n      /** Comienzo de la validez actual de la instancia de un objeto.\n       */\n      !!@ ili2db.dispName = "Versión de comienzo de vida útil"\n      Comienzo_Vida_Util_Version : MANDATORY INTERLIS.XMLDateTime;\n      /** Finnzo de la validez actual de la instancia de un objeto.\n       */\n      !!@ ili2db.dispName = "Versión de fin de vida útil"\n      Fin_Vida_Util_Version : INTERLIS.XMLDateTime;\n      MANDATORY CONSTRAINT\n        Fin_Vida_Util_Version >= Comienzo_Vida_Util_Version;\n    END ObjetoVersionado;\n\n    /** Referencia a una clase externa para gestionar direcciones.\n     */\n    STRUCTURE ExtInteresado =\n      /** Identificador externo del interesado.\n       */\n      !!@ ili2db.dispName = "Ext dirección id"\n      Ext_Direccion_ID : LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\n      /** Imagen de la huella dactilar del interesado.\n       */\n      !!@ ili2db.dispName = "Huella dactilar"\n      Huella_Dactilar : LADM_COL_V3_0.LADM_Nucleo.Imagen;\n      /** Campo de nombre del interesado.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      /** Fotografía del interesado.\n       */\n      !!@ ili2db.dispName = "Fotografía"\n      Fotografia : LADM_COL_V3_0.LADM_Nucleo.Imagen;\n      /** Firma del interesado.\n       */\n      !!@ ili2db.dispName = "Firma"\n      Firma : LADM_COL_V3_0.LADM_Nucleo.Imagen;\n      /** Ruta de almacenamiento del documento escaneado del interesado.\n       */\n      !!@ ili2db.dispName = "Documento escaneado"\n      Documento_Escaneado : CharacterString;\n    END ExtInteresado;\n\n    /** Referencia a una clase externa para gestionar las redes físicas de servicios.\n     */\n    STRUCTURE ExtRedServiciosFisica =\n      /** Indica si la red de servicios tiene un gradiente o no.\n       */\n      !!@ ili2db.dispName = "Orientada"\n      Orientada : BOOLEAN;\n      /** Identificador de referencia a un interesado externo que es el administrador.\n       */\n      !!@ ili2db.dispName = "Ext interesado administrador id"\n      Ext_Interesado_Administrador_ID : LADM_COL_V3_0.LADM_Nucleo.ExtInteresado;\n    END ExtRedServiciosFisica;\n\n    /** Referencia a clase externa desde donde se gestiona el repositorio de archivos.\n     */\n    !!@ ili2db.dispName = "Archivo fuente"\n    STRUCTURE ExtArchivo =\n      /** Fecha en la que ha sido aceptado el documento.\n       */\n      !!@ ili2db.dispName = "Fecha de aceptación"\n      Fecha_Aceptacion : INTERLIS.XMLDate;\n      /** Datos que contiene el documento.\n       */\n      !!@ ili2db.dispName = "Datos"\n      Datos : CharacterString;\n      /** Última fecha de extracción del documento.\n       */\n      !!@ ili2db.dispName = "Extracción"\n      Extraccion : INTERLIS.XMLDate;\n      /** Fecha en la que el documento es aceptado en el sistema.\n       */\n      !!@ ili2db.dispName = "Fecha de grabación"\n      Fecha_Grabacion : INTERLIS.XMLDate;\n      /** Fecha en la que fue entregado el documento.\n       */\n      !!@ ili2db.dispName = "Fecha de entrega"\n      Fecha_Entrega : INTERLIS.XMLDate;\n      !!@ ili2db.dispName = "Espacio de nombres"\n      Espacio_De_Nombres : MANDATORY CharacterString;\n      !!@ ili2db.dispName = "Local ID"\n      Local_Id : MANDATORY CharacterString;\n    END ExtArchivo;\n\n    /** Clase abstracta. Esta clase es la personalización en el modelo del perfil colombiano de la clase de LADM LA_Source.\n     */\n    CLASS COL_Fuente (ABSTRACT)\n    EXTENDS Oid =\n      /** Indica si la fuente está o no disponible y en qué condiciones. También puede indicar porqué ha dejado de estar disponible, si ha ocurrido.\n       */\n      !!@ ili2db.dispName = "Estado de disponibilidad"\n      Estado_Disponibilidad : MANDATORY COL_EstadoDisponibilidadTipo;\n      /** Identificador del archivo fuente controlado por una clase externa.\n       */\n      !!@ ili2db.dispName = "Ext archivo id"\n      Ext_Archivo_ID : LADM_COL_V3_0.LADM_Nucleo.ExtArchivo;\n      /** Tipo de formato en el que es presentada la fuente, de acuerdo con el registro de metadatos.\n       */\n      !!@ ili2db.dispName = "Tipo principal"\n      Tipo_Principal : CI_Forma_Presentacion_Codigo;\n      /** Fecha de expedición del documento de la fuente.\n       */\n      !!@ ili2db.dispName = "Fecha de documento fuente"\n      Fecha_Documento_Fuente : INTERLIS.XMLDate;\n    END COL_Fuente;\n\n    /** Estructura para la definición de un tipo de dato personalizado que permite indicar la medición de un volumen y la naturaleza de este.\n     */\n    STRUCTURE COL_VolumenValor =\n      /** Medición del volumen en m3.\n       */\n      !!@ ili2db.dispName = "Volumen medición"\n      Volumen_Medicion : MANDATORY 0.0 .. 99999999999999.9 [INTERLIS.m];\n      /** Indicación de si el volumen es calculado, si figura como oficial o si se da otra circunstancia.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_VolumenTipo;\n    END COL_VolumenValor;\n\n    /** Especialización de la clase COL_Fuente para almacenar aquellas fuentes constituidas por documentos (documento hipotecario, documentos notariales, documentos históricos, etc.) que documentan la relación entre instancias de interesados y de predios.\n     */\n    CLASS COL_FuenteAdministrativa (ABSTRACT)\n    EXTENDS COL_Fuente =\n      /** Observaciones o descripción del documento de la fuente administrativa.\n       */\n      !!@ ili2db.dispName = "Observación"\n      Observacion : CharacterString;\n      /** Tipo de documento de fuente administrativa.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_FuenteAdministrativaTipo;\n      /** Identificador del documento, ejemplo: número de la resolución, número de la escritura pública o número de radicado de una sentencia.\n       */\n      !!@ ili2db.dispName = "Número de fuente"\n      Numero_Fuente : TEXT*150;\n    END COL_FuenteAdministrativa;\n\n    /** Representación gráfica del terreno, construcción, unidad de construcción y/o servidumbre de paso.\n     */\n    CLASS COL_UnidadEspacial (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Registros del área en diferentes sistemas.\n       */\n      !!@ ili2db.dispName = "Área"\n      Area : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.COL_AreaValor;\n      /** Dimensión del objeto.\n       */\n      !!@ ili2db.dispName = "Dimensión"\n      Dimension : COL_DimensionTipo;\n      /** Corresponde al atributo extAddressID de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Ext dirección id"\n      Ext_Direccion_ID : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\n      /** Corresponde al atributo label de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Etiqueta"\n      Etiqueta : CharacterString;\n      /** Corresponde al atributo surfaceRelation de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Relación superficie"\n      Relacion_Superficie : COL_RelacionSuperficieTipo;\n      /** Corresponde al atributo volume de la clase en LADM.\n       */\n      !!@ ili2db.dispName = "Volumen"\n      Volumen : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.COL_VolumenValor;\n      /** Materializacion del metodo createArea(). Almacena de forma permanente la geometría de tipo poligonal.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n    END COL_UnidadEspacial;\n\n    /** Agrupa unidades espaciales, es decir, representaciones geográficas de las unidades administrativas básicas (clase LA_BAUnit) para representar otras unidades espaciales que se forman en base a estas, como puede ser el caso de los polígonos catastrales.\n     */\n    CLASS COL_AgrupacionUnidadesEspaciales (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Nivel jerárquico de la agrupación, dentro del anidamiento de diferentes agrupaciones.\n       */\n      !!@ ili2db.dispName = "Nivel jerárquico"\n      Nivel_Jerarquico : MANDATORY Integer;\n      /** Definición de la agrupación.\n       */\n      !!@ ili2db.dispName = "Etiqueta"\n      Etiqueta : CharacterString;\n      /** Nombre que recibe la agrupación.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      /** Punto de referencia de toda la agrupación, a modo de centro de masas.\n       */\n      !!@ ili2db.dispName = "Punto de referencia"\n      Punto_Referencia : ISO19107_PLANAS_V3_0.GM_Point3D;\n    END COL_AgrupacionUnidadesEspaciales;\n\n    /** Traducción al español de la clase LA_LegalSpaceBuildingUnit. Sus intancias son las unidades de edificación\n     */\n    CLASS COL_EspacioJuridicoUnidadEdificacion (ABSTRACT)\n    EXTENDS COL_UnidadEspacial =\n      /** Identificador de la unidad de edificación.\n       */\n      !!@ ili2db.dispName = "Ext unidad edificación física id"\n      Ext_Unidad_Edificacion_Fisica_ID : LADM_COL_V3_0.LADM_Nucleo.ExtUnidadEdificacionFisica;\n      /** Tipo de unidad de edificación de la que se trata.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : COL_UnidadEdificacionTipo;\n    END COL_EspacioJuridicoUnidadEdificacion;\n\n    ASSOCIATION col_ueJerarquiaGrupo =\n      agrupacion -<> {0..1} COL_AgrupacionUnidadesEspaciales;\n      elemento -- {0..*} COL_AgrupacionUnidadesEspaciales;\n    END col_ueJerarquiaGrupo;\n\n    /** Traducción al español de la clase LA_LegalSpaceUtilityNetwork. Representa un tipo de unidad espacial (LA_UNidadEspacial) cuyas instancias son las redes de servicios.\n     */\n    CLASS COL_EspacioJuridicoRedServicios (ABSTRACT)\n    EXTENDS COL_UnidadEspacial =\n      /** Identificador de la red física hacia una referencia externa.\n       */\n      !!@ ili2db.dispName = "Ext id red física"\n      ext_ID_Red_Fisica : LADM_COL_V3_0.LADM_Nucleo.ExtRedServiciosFisica;\n      /** Estado de operatividad de la red.\n       */\n      !!@ ili2db.dispName = "Estado"\n      Estado : COL_EstadoRedServiciosTipo;\n      /** Tipo de servicio que presta.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : COL_RedServiciosTipo;\n    END COL_EspacioJuridicoRedServicios;\n\n    ASSOCIATION col_ueUeGrupo =\n      parte -- {0..*} COL_UnidadEspacial;\n      todo -- {0..*} COL_AgrupacionUnidadesEspaciales;\n    END col_ueUeGrupo;\n\n    /** Traducción de la clase LA_Level de LADM.\n     */\n    CLASS COL_Nivel (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      !!@ ili2db.dispName = "Tipo de registro"\n      Registro_Tipo : COL_RegistroTipo;\n      !!@ ili2db.dispName = "Estructura"\n      Estructura : COL_EstructuraTipo;\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : COL_ContenidoNivelTipo;\n    END COL_Nivel;\n\n    /** Traducción al español de la clase LA_RequiredRelationshipSpatialUnit de LADM.\n     */\n    CLASS COL_RelacionNecesariaUnidadesEspaciales (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      !!@ ili2db.dispName = "Relación"\n      Relacion : MANDATORY COL_ISO19125_Tipo;\n    END COL_RelacionNecesariaUnidadesEspaciales;\n\n    ASSOCIATION col_ueNivel =\n      ue -- {0..*} COL_UnidadEspacial;\n      nivel -- {0..1} COL_Nivel;\n    END col_ueNivel;\n\n    /** Clase abstracta que agrupa los atributos comunes de las clases para los derechos (rights), las responsabilidades (responsabilities) y las restricciones (restrictions).\n     */\n    CLASS COL_DRR (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Descripción relatical al derecho, la responsabilidad o la restricción.\n       */\n      !!@ ili2db.dispName = "Descripción"\n      Descripcion : CharacterString;\n    END COL_DRR;\n\n    /** De forma genérica, representa el objeto territorial legal (Catastro 2014) que se gestiona en el modelo, en este caso, la parcela catastral o predio. Es independiente del conocimiento de su realidad espacial y se centra en su existencia conocida y reconocida.\n     */\n    CLASS COL_UnidadAdministrativaBasica (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Nombre que recibe la unidad administrativa básica, en muchos casos toponímico, especialmente en terrenos rústicos.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n      /** Tipo de derecho que la reconoce.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_UnidadAdministrativaBasicaTipo;\n    END COL_UnidadAdministrativaBasica;\n\n    ASSOCIATION col_rrrFuente =\n      fuente_administrativa -- {1..*} COL_FuenteAdministrativa;\n      rrr -- {0..*} COL_DRR;\n    END col_rrrFuente;\n\n    /** Traducción de la clase LA_RequiredRelationshipBAUnit de LADM.\n     */\n    CLASS COL_RelacionNecesariaBAUnits (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      !!@ ili2db.dispName = "Relación"\n      Relacion : MANDATORY CharacterString;\n    END COL_RelacionNecesariaBAUnits;\n\n    ASSOCIATION col_baunitRrr =\n      unidad -- {1} COL_UnidadAdministrativaBasica;\n      rrr -- {1..*} COL_DRR;\n    END col_baunitRrr;\n\n    ASSOCIATION col_ueBaunit =\n      ue (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n      baunit -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_ueBaunit;\n\n    ASSOCIATION col_relacionFuente =\n      fuente_administrativa -- {0..*} COL_FuenteAdministrativa;\n      relacionrequeridaBaunit -- {0..*} COL_RelacionNecesariaBAUnits;\n    END col_relacionFuente;\n\n    ASSOCIATION col_unidadFuente =\n      fuente_administrativa -- {0..*} COL_FuenteAdministrativa;\n      unidad -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_unidadFuente;\n\n    /** Clase especializada para la administración de los tipos de puntos.\n     */\n    CLASS COL_Punto (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Posición de interpolación.\n       */\n      !!@ ili2db.dispName = "Posición interpolación"\n      Posicion_Interpolacion : COL_InterpolacionTipo;\n      /** Clasificación del tipo de punto identificado en el levantamiento catastral.\n       */\n      !!@ ili2db.dispName = "Tipo de punto"\n      PuntoTipo : MANDATORY COL_PuntoTipo;\n      /** Indica si el método de levantamiento catastral: método directo o indirecto.\n       */\n      !!@ ili2db.dispName = "Método de producción"\n      MetodoProduccion : MANDATORY COL_MetodoProduccionTipo;\n      /** Transformación y Resultado.\n       */\n      !!@ ili2db.dispName = "Transformación y resultado"\n      Transformacion_Y_Resultado : LIST {0..*} OF LADM_COL_V3_0.LADM_Nucleo.COL_Transformacion;\n      /** Geometria punto para administración de los objetos: punto de lindero, punto levantamiento y punto de control.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : MANDATORY ISO19107_PLANAS_V3_0.GM_Point3D;\n    END COL_Punto;\n\n    /** Especialización de la clase COL_Fuente para almacenar las fuentes constituidas por datos espaciales (entidades geográficas, imágenes de satélite, vuelos fotogramétricos, listados de coordenadas, mapas, planos antiguos o modernos, descripción de localizaciones, etc.) que documentan técnicamente la relación entre instancias de interesados y de predios\n     */\n    CLASS COL_FuenteEspacial (ABSTRACT)\n    EXTENDS COL_Fuente =\n      /** Nombre de la fuente espacial del levantamiento catastral de un predio.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : MANDATORY TEXT*255;\n      /** Tipo de fuente espacial.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_FuenteEspacialTipo;\n      /** Descripción de la fuente espacial.\n       */\n      !!@ ili2db.dispName = "Descripción"\n      Descripcion : MANDATORY MTEXT;\n      /** Metadato de la fuente espacial.\n       */\n      !!@ ili2db.dispName = "Metadato"\n      Metadato : MTEXT;\n    END COL_FuenteEspacial;\n\n    /** Traducción al español de la clase LA_BoundaryFaceString de LADM. Define los linderos y a su vez puede estar definida por una descrición textual o por dos o más puntos. Puede estar asociada a una fuente espacial o más.\n     */\n    CLASS COL_CadenaCarasLimite (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Geometría lineal que define el lindero. Puede estar asociada a geometrías de tipo punto que definen sus vértices o ser una entidad lineal independiente.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : ISO19107_PLANAS_V3_0.GM_Curve3D;\n      /** Descripción de la localización, cuando esta se basa en texto.\n       */\n      !!@ ili2db.dispName = "Localización textual"\n      Localizacion_Textual : CharacterString;\n    END COL_CadenaCarasLimite;\n\n    /** Traducción de la clase LA_BoundaryFace de LADM. De forma similar a LA_CadenaCarasLindero, representa los límites, pero en este caso permite representación 3D.\n     */\n    CLASS COL_CarasLindero (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Geometría en 3D del límite o lindero, asociada a putos o a descripciones textuales.\n       */\n      !!@ ili2db.dispName = "Geometría"\n      Geometria : ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\n      /** Cuando la localización del límte está dada por una descripción textual, aquí se recoge esta.\n       */\n      !!@ ili2db.dispName = "Localización textual"\n      Localizacion_Textual : CharacterString;\n    END COL_CarasLindero;\n\n    ASSOCIATION col_puntoReferencia =\n      ue (EXTERNAL) -- {0..1} COL_UnidadEspacial;\n      punto -- {0..1} COL_Punto;\n    END col_puntoReferencia;\n\n    ASSOCIATION col_puntoFuente =\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n      punto -- {0..*} COL_Punto;\n    END col_puntoFuente;\n\n    ASSOCIATION col_ueFuente =\n      ue (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n    END col_ueFuente;\n\n    ASSOCIATION col_baunitFuente =\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n      unidad (EXTERNAL) -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_baunitFuente;\n\n    ASSOCIATION col_relacionFuenteUespacial =\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n      relacionrequeridaUe (EXTERNAL) -- {0..*} COL_RelacionNecesariaUnidadesEspaciales;\n    END col_relacionFuenteUespacial;\n\n    ASSOCIATION col_cclFuente =\n      ccl -- {0..*} COL_CadenaCarasLimite;\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n    END col_cclFuente;\n\n    ASSOCIATION col_menosCcl =\n      ccl_menos -- {0..*} COL_CadenaCarasLimite;\n      ue_menos (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_menosCcl;\n\n    ASSOCIATION col_masCcl =\n      ccl_mas -- {0..*} COL_CadenaCarasLimite;\n      ue_mas (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_masCcl;\n\n    ASSOCIATION col_puntoCcl =\n      punto -- {2..*} COL_Punto;\n      ccl -- {0..*} COL_CadenaCarasLimite;\n    END col_puntoCcl;\n\n    ASSOCIATION col_clFuente =\n      cl -- {0..*} COL_CarasLindero;\n      fuente_espacial -- {0..*} COL_FuenteEspacial;\n    END col_clFuente;\n\n    ASSOCIATION col_menosCl =\n      cl_menos -- {0..*} COL_CarasLindero;\n      ue_menos (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_menosCl;\n\n    ASSOCIATION col_masCl =\n      cl_mas -- {0..*} COL_CarasLindero;\n      ue_mas (EXTERNAL) -- {0..*} COL_UnidadEspacial;\n    END col_masCl;\n\n    ASSOCIATION col_puntoCl =\n      punto -- {3..*} COL_Punto;\n      cl -- {0..*} COL_CarasLindero;\n    END col_puntoCl;\n\n    /** Traducción de la clase LA_Party de LADM. Representa a las personas que ejercen derechos y responsabilidades  o sufren restricciones respecto a una BAUnit.\n     */\n    CLASS COL_Interesado (ABSTRACT)\n    EXTENDS ObjetoVersionado =\n      /** Identificador del interesado.\n       */\n      !!@ ili2db.dispName = "Ext PID"\n      ext_PID : LADM_COL_V3_0.LADM_Nucleo.ExtInteresado;\n      /** Nombre del interesado.\n       */\n      !!@ ili2db.dispName = "Nombre"\n      Nombre : CharacterString;\n    END COL_Interesado;\n\n    /** Relaciona los interesados que ostentan la propiedad, posesión u ocupación de un predio. Se registra el grupo en si e independientemete las personas por separado.\n     */\n    CLASS COL_AgrupacionInteresados (ABSTRACT)\n    EXTENDS COL_Interesado =\n      /** Indica el tipo de agrupación del que se trata.\n       */\n      !!@ ili2db.dispName = "Tipo"\n      Tipo : MANDATORY COL_GrupoInteresadoTipo;\n    END COL_AgrupacionInteresados;\n\n    ASSOCIATION col_baunitComoInteresado =\n      interesado -- {0..*} COL_Interesado;\n      unidad (EXTERNAL) -- {0..*} COL_UnidadAdministrativaBasica;\n    END col_baunitComoInteresado;\n\n    ASSOCIATION col_responsableFuente =\n      fuente_administrativa (EXTERNAL) -- {0..*} COL_FuenteAdministrativa;\n      interesado -- {0..*} COL_Interesado;\n    END col_responsableFuente;\n\n    ASSOCIATION col_rrrInteresado =\n      rrr (EXTERNAL) -- {0..*} COL_DRR;\n      interesado -- {0..1} COL_Interesado;\n    END col_rrrInteresado;\n\n    ASSOCIATION col_topografoFuente =\n      fuente_espacial (EXTERNAL) -- {0..*} COL_FuenteEspacial;\n      topografo -- {0..*} COL_Interesado;\n    END col_topografoFuente;\n\n    ASSOCIATION col_miembros =\n      interesado -- {2..*} COL_Interesado;\n      agrupacion -<> {0..*} COL_AgrupacionInteresados;\n      participacion : LADM_COL_V3_0.LADM_Nucleo.Fraccion;\n    END col_miembros;\n\n  END LADM_Nucleo;\n\nEND LADM_COL_V3_0.\n	2020-06-24 11:50:42.406
Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.ili	2.3	Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0{ LADM_COL_V3_0 Submodelo_Integracion_Insumos_V1_0 ISO19107_PLANAS_V3_0}	INTERLIS 2.3;\r\n\r\n/** ISO 19152 LADM country profile COL modeled with INTERLIS 2.\r\n * \r\n * -----------------------------------------------------------\r\n * revision history\r\n * -----------------------------------------------------------\r\n * \r\n * 10.05.2016/mg: EJEMPLO INTERLIS POR OFERTAS\r\n * 16.06.2016/mg: Taller IGAC/SNR\r\n * 23.08.2016/mg: Relaciones\r\n * 15.09.2016/mg: Comentarios Modelo\r\n * 20.11.2016/aa: Topic Ficha\r\n * 25.11.2016/aa: Ajustes FichaPredio\r\n * 02.12.2016/ss: Nuevas clases, atributos y tipos\r\n * 15.12.2016/lj: Ajuste tipos (IGAC/SNR), BAUnit GM_surface\r\n * 31.03.2017/fm: Simplificación de herencia\r\n * 25.05.2017/fm: Se elimina la relacion HipotecaDerecho, se elimina la clase InteresadoBAUnit, se elimina marca abstract en las clases derivadas de RRR\r\n * 26.05.2017/fm: Se cambian las clases terreno servidumbre de paso y construccion al paquete de unidades espaciales. Se acorta el nombre del Modelo. ajuste al diseño del diagrama de clases. Se elimina InteresadoNacion\r\n * 09.06.2017/vm: Referido al modelo LADM traducido al español\r\n * 09.06.2017/vm: cambio de version a 2.1.1, incluye cambios por LADM en español y de  nombres de atributo por no seguir las convenciones adoptadas.\r\n * 15.06.2017/fm: cambio de version a 2.1.2, se quita el atributo geometría de la clase predio. se reemplaza el atributo OID por los atributos atributos namespace y localId. Se añaden atributos folio matriz y segregados al predio. se elimina el dominio transaccion_registral_tipo\r\n * 20.06.2017/fm: Ajuste a nombres de las clases y atributos LA_\r\n * 04.07.2017/sr: Ajuste de nombres de clases y atributos, creacion de relaciones, ajuste subdominios\r\n * 04.07.2017/fm: Se unifican los modelos LADM_ES y Catastro_COL, se eliminan las clases que extienden de responsabilidad, restriccion, derecho, hipoteca, fuente_administrativa y fuente espacial. eliminan atributos opcionales no usados de la clase hipoteca\r\n * 11.07.2017/fm: se adiciona el atributo poligono_creado\r\n * 12.07.2017/fm: se adiciona el atributo Estado_Nupre en la clase predio\r\n * 17.07.2017/fm: poligono creado debe ser obligatorio para la clase terreno.\r\n * 28.09.2017/fm : Cambio del nombre en la clase alerta por publicidad, Publicidad Extiende de objeto versionado, se elimita atributo fecha de vigencia. Ajuste al atributo plantacion comercial de la clase terreno. Se extraen los atributos de la clase predio e interesados a los modelos extendidos de ficha y registro. version 2.2.0\r\n * 20.10.2017/ag : Ajustes a atributos de la clase terreno, cambio a dominio multivalorado, se crean dominios, col_servidumbre, col_afectacion, col_explotacion, col_territorioAgricula, col_cuerpoAgua, se elimina la obligatoriedad del rol responsable en las relaciones responsableFuente y topografoFuente\r\n * 28.10.2017/gc : Soporte de geometrías multi-parte para LA_UnidadEspacial (y las clases que la extienden) y Terreno.\r\n * 02.11.2017/ : Cambio del nombre del modelo de Catastro_COL_ES a Catastro_Registro_Nucleo\r\n * 07.11.2017/fm: Cambio de nombre a la clase CadenaCarasLindero a CadenaCarasLimite \r\n * 14.11.2017/fm : taducción del dominio COL_BuildingUnitTipo\r\n * 14.12.2017/fm : definicion de extends entre topics catastro registro nucleo y Ladm_nucleo\r\n * 30.01.2018/fm : Cambio del tipo de dato del atributo Ext_Direccion de la clase Unidad Espacial a ExtDireccion; atributo ext_PID de la calse LA_Interesado cambia de OID a ExtInteresado; Cambio de cardinalidad en relacion miembros entre LA_Interesado y LA_Agrupacion_Interesados de 0..1 a 0..*\r\n * 19.02.2018/fm : Cambio en longitud de atributo DocumentoIdentidad de 10 a 12 posiciones\r\n * 17.07.2018/fm : cambio en cardinalidad asociación ConstruccionUnidadConstruccion de 1..* a 0..*; ampliación del tamaño para campo de nombre en Interesado Natural; se incluyen los valores nuip, cedula militar, registro civil, cedula militar, secuencial SRN y secuencial IGAC al dominio COL_InteresadoDocumentoTipo\r\n * 30.07.2018/fm : Cambio obligatoriedad atributo area_registral de clase terreno de 1 a 0..1\r\n * 31.07.2018/fm: Creación de la clase COL_Interesado integrando los atributos de interesado natural e interesado jurídico; se agrega area en la clase construcción; se adiciona valor Carta_Venta al dominio COL_FuenteAdministrativaTipo; inclusion de atributo nombre en la clase COL_FuenteAdministrativa\r\n * 10.08.2018/fm: Eliminado clase Interesado Natural e Interesado Juridico\r\n * 28.08.2018/fm: Ajuste a cardinalidad en la composición predio_copropiedad, se elimina el requerido.\r\n * 28.08.2018/fm-at: Se incluye el tipo de predio conforme a la resolucion 070 de 2011; Se elimina el atributo tipo_construccion de la clase Unidad_Construcción ya que el dominio hace referencia a tipos de predios y no a tipos de construcciones\r\n * 10.09.2018/fm-at: Ajuste a los tipos de Predio conforme a la resolucion 070\r\n * 21.09.2018/at: Se agrega el valor "Hipoteca" al dominio COL_RestriccionTipo, se ajusta la longitud del atributo Codigo_Registral en las clases especializadas de LA_RRR de 3 a 4 caracteres\r\n * 25.09.2018/at: Se ajusta la longitud del atributo Codigo_Registral en las clases especializadas de LA_RRR a 5 caracteres de acuerdo a la Resolución 3973 de 2018\r\n * 18.10.2018/at: Se agregan los atributos p_Espacio_De_Nombres y p_Local_Id a la clase Publicidad\r\n * 29.10.2018/fm: se amplia el tamaño de campo FMI en la clase predio para almacenar cadenas como 'LIBRO 2 TOMO 1/961 FOLIO 37/46 PARTIDA N 58'\r\n * -----------------------------------------------------------\r\n * \r\n * (c) IGAC y SNR con apoyo de la Cooperacion Suiza\r\n * \r\n * -----------------------------------------------------------\r\n */\r\nCONTRACTED MODEL Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0 (es)\r\nAT "http://www.proadmintierra.info/"\r\nVERSION "V2.2.1"  // 2018-02-19 // =\r\n  IMPORTS ISO19107_PLANAS_V3_0,LADM_COL_V3_0,Submodelo_Integracion_Insumos_V1_0;\r\n\r\n  DOMAIN\r\n\r\n    /** Valores para indicar el nivel de acuerdo\r\n     */\r\n    LC_AcuerdoTipo = (\r\n      /** Existe un acuerdo sobre la posición del punto\r\n       */\r\n      !!@ ili2db.dispName = "Acuerdo"\r\n      Acuerdo,\r\n      /** Existe un desacuerdo sobre la posición del punto\r\n       */\r\n      !!@ ili2db.dispName = "Desacuerdo"\r\n      Desacuerdo\r\n    );\r\n\r\n    LC_AnexoTipo = (\r\n      !!@ ili2db.dispName = "Enramadas o cobertizos o caneyes"\r\n      Enramadas_Cobertizos_Caneyes(\r\n        /** Locales de venta de vehículos: Estructura concreto, cubierta cercha metálica y teja canaleta; fachada vidrio y polarizado, piso baldosín conservación general buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 90"\r\n        Tipo_90,\r\n        /** Estructura metálica; cubierta de zinc, eternit o teja de barro, pisos de cemento, conservación general buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en madera fina; cubierta de zinc, eternit o teja de barro pisos de cemento; conservación general buena a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en madera común; cubierta de zinc, eternit o teja de barro; pisos en tierra; conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Enramadas o cobertizos o caneyes) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Galpones o gallineros"\r\n      Galpones_Gallineros(\r\n        /** Estructura metálica o madera fina, cubierta de zinc, eternit o teja de barro; muros a mediana altura en bloque o ladrillo; pisos de cemento; conservación general buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura ladrillo o bloque; cubierta de zinc, eternit o teja de barro semi muros en bloque o ladrillo; pisos de cemento; conservación general buena a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en ladrillo, bloque o madera sencilla; cubierta de zinc, eternit o teja de barro; con o sin muros; pisos en tierra; conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 40"\r\n        Tipo_40,\r\n        /** Estructura en madera; cubierta de zinc, eternit, teja de barro, paja o material de desecho; con o sin muros; pisos en tierra; conservación regular o mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Galpones o gallineros) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Establos o pesebreras"\r\n      Establos_Pesebreras(\r\n        /** Estructura metálica o de concreto; cubierta de zinc, eternit a teja de barro muros en bloque o ladrillo, pisos de cemento, conservación en general buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en bloque, ladrillo o madera fina; cubierta de zinc, eternit o teja de barro muros en bloque o ladrillo, pisos de cemento, conservación en general buena o regular\r\n         */\r\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en ladrillo cubierta  de  zinc,  eternit  o  teja  de  barro  muros de ladrillo, pisos en tierra, conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 40"\r\n        Tipo_40,\r\n        /** Estructura en madera cubierta de  zinc,  eternit  o  teja  de  barro  muros en madera, pisos en tierra, conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Establos o pesebreras) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Cocheras o marraneras o porquerizas"\r\n      Cocheras_Marraneras_Porquerizas(\r\n        /** Estructura concreto; cubierta de zinc, eternit o teja de barro, muros en bloque o ladrillo, pisos en cemento o baldosa, conservación general buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en ladrillo o bloque, cubierta de zinc, eternit o teja de barro, semi muros en bloque o ladrillo, pisos en cemento o baldosa conservación general buena a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en ladrillo; cubierta de zinc, eternit o teja de barro; con muros o sin muros; pisos en tierra; conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 40"\r\n        Tipo_40,\r\n        /** Estructura en madera; cubierta de zinc, eternit o teja de barro con o sin muros, pisos en tierra, conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Cocheras o marraneras o porquerizas) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Silos"\r\n      Silos(\r\n        /** Estructura en ferroconcreto metálica\r\n         */\r\n        !!@ ili2db.dispName = "(Silos) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en concreto\r\n         */\r\n        !!@ ili2db.dispName = "(Silos) Tipo 60"\r\n        Tipo_60\r\n      ),\r\n      !!@ ili2db.dispName = "Piscina"\r\n      Piscinas(\r\n        /** Piscinas olímpicas, con sistemas de purificación e iluminación; enchape en azulejo fino, trampolín a diferentes alturas. Se encuentra comúnmente en clubes y coliseos.\r\n         */\r\n        !!@ ili2db.dispName = "(Piscina) Tipo 80"\r\n        Tipo_80,\r\n        /** Piscinas semi olímpicas, con sistemas de purificación; enchape en azulejo fino, comunes en clubes y centros de recreación.\r\n         */\r\n        !!@ ili2db.dispName = "(Piscina) Tipo 60"\r\n        Tipo_60,\r\n        /** Piscinas de tamaño mediano, enchape en azulejo, sistemas de purificación rudimentaria, comunes en fincas de recreo o centros de recreación.\r\n         */\r\n        !!@ ili2db.dispName = "(Piscina) Tipo 50"\r\n        Tipo_50,\r\n        /** Piscinas pequeña, cubierta en baldosín o cemento. Comunes en fincas o casas de campo\r\n         */\r\n        !!@ ili2db.dispName = "(Piscina) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Tanques"\r\n      Tanques(\r\n        /** Tanques que por su capacidad y/b altura requieren estructura en ferroconcreto con revestimiento, encontrándose en buen estado de conservación.\r\n         */\r\n        !!@ ili2db.dispName = "(Tanques) Tipo 80"\r\n        Tipo_80,\r\n        /** Tanques de mediana capacidad con estructura metálica con altura o profundidad no superior a 10 metros; en buen estado de conservación.\r\n         */\r\n        !!@ ili2db.dispName = "(Tanques) Tipo 60"\r\n        Tipo_60,\r\n        /** Tanques pequeños con estructura en ladrillo o bloque revestido en cemento con altura no mayor a 3 metros o poca profundidad; conservación buena a regular\r\n         */\r\n        !!@ ili2db.dispName = "(Tanques) Tipo 40"\r\n        Tipo_40,\r\n        /** Tanques con altura menor a 3 metros o poca profundidad; estructura en ladrillo conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Tanques) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Beneficiaderos"\r\n      Beneficiaderos(\r\n        /** Estructura en ladrillo o bloque; cubierta en zinc, teja de barro o eternit rustico; pisos en cemento, con tanques lavadores y serpentina o canal de carreteo y silo o patio quindiano incorporado estado de conservación bueno a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Beneficiaderos) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en madera; muros en ladrillos o bloque; cubierta en zinc, teja de barro o eternit; existencia de tanques y/o silos; pisos en cemento estado de conservación bueno a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Beneficiaderos) Tipo 60"\r\n        Tipo_60,\r\n        /** Beneficiaderos construidos en materiales económicos (bareque, tapia) pisos en tierra conservación regular a mala; se encuentran en este tipo los elementos apenas necesarios: tanques, despulpaderos, canales, etc. en condiciones rudimentarias, comunes en fincas minifundistas.\r\n         */\r\n        !!@ ili2db.dispName = "(Beneficiaderos) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Secaderos"\r\n      Secaderos(\r\n        /** Estructura metálica y cercha de madera o metálica muros medianos o totales en ladrillo marquesina de vidrio; pisos en cemento; estado de conservación buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Secaderos) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en ladrillo; pisos en cemento; oreador en madera con sistema de rodamiento; buen estado de conservación.\r\n         */\r\n        !!@ ili2db.dispName = "(Secaderos) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en madera pisos en tierra oreador con especificaciones mínimas; estado de conservación regular a mala. Dentro de este tipo se consideran as condiciones de los tipos anteriores, que se encuentran en regular a mal estado de conservación\r\n         */\r\n        !!@ ili2db.dispName = "(Secaderos) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Kioskos"\r\n      Kioscos(\r\n        /** Estructura en bloque o ladrillo cubierta en zinc, teja de barro o paja; estado de conservación general bueno.\r\n         */\r\n        !!@ ili2db.dispName = "(Kioskos) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura metálica; todo tipo de cubiertas; piso en cemento; estado de conservación bueno a regular\r\n         */\r\n        !!@ ili2db.dispName = "(Kioskos) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en madera fina; todo tipo de cubiertas; piso en cemento; estado de conservación bueno a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Kioskos) Tipo 40"\r\n        Tipo_40,\r\n        /** Estructura en madera común; cubierta en zinc, paja o teja de barro piso en tierra estado de conservación regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Kioskos) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Albercas o bañaderas"\r\n      Albercas_Baniaderas(\r\n        /** Estructura en concreto; cubierta en zinc, eternit o teja de barro; piso en cemento; conservación buena a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Albercas o bañaderas) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en ladrillo; cubierta en zinc, eternit o teja de barro; piso  en cemento; conservación buena a regular.\r\n         */\r\n        !!@ ili2db.dispName = "(Albercas o bañaderas) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en madera; cubierta en zinc, eternit o teja de barro; piso en cemento; conservación regular a mala. Se incluyen en este tipo las condiciones dadas en los anteriores en mal estado de conservación.\r\n         */\r\n        !!@ ili2db.dispName = "(Albercas o bañaderas) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Corrales"\r\n      Corrales(\r\n        /** Estructura metálica o de madera aserrada, formado por cuatro varales, pisos en cemento y conservación buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Corrales) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura en madera aserrada, formado por tres varales, pisos en cemento y conservación general buena.\r\n         */\r\n        !!@ ili2db.dispName = "(Corrales) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura en madera aserrada, formado por tres varales, pisos en tierra y conservación general regular a mala.\r\n         */\r\n        !!@ ili2db.dispName = "(Corrales) Tipo 40"\r\n        Tipo_40,\r\n        /** Estructura en madera burda, pisos en tierra y conservación general regular a mala\r\n         */\r\n        !!@ ili2db.dispName = "(Corrales) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Pozos"\r\n      Pozos(\r\n        /** Pozo de profundidad aproximada a 40 m, revestido en concreto, con tubería, anillado 100% , diámetro pozo de 2m\r\n         */\r\n        !!@ ili2db.dispName = "(Pozos) Tipo 80"\r\n        Tipo_80,\r\n        /** Pozo de profundidad aproximada 20 m, revestido en concreto, con tubería, anillado 100 % , diámetro pozo < 2m\r\n         */\r\n        !!@ ili2db.dispName = "(Pozos) Tipo 60"\r\n        Tipo_60,\r\n        /** Pozo profundidad < a 10m, sin revestimiento ni anillar, diámetro pozo de 2m\r\n         */\r\n        !!@ ili2db.dispName = "(Pozos) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      /** Estructura en concreto y tanque en concreto, fibrocemento o metálico con recubrimiento interior en resinas de poliéster reforzadas con fibra de vidrio, partes metálicas en acero inoxidable o galvanizadas buen estado de conservación\r\n       */\r\n      !!@ ili2db.dispName = "(Torres de enfriamiento)"\r\n      TorresEnfriamiento,\r\n      !!@ ili2db.dispName = "Muelles"\r\n      Muelles(\r\n        /** Muelle, estructura en concreto, piso en madera deck para exteriores\r\n         */\r\n        !!@ ili2db.dispName = "(Muelles) Tipo 80"\r\n        Tipo_80,\r\n        /** Muelle, estructura y piso en concreto\r\n         */\r\n        !!@ ili2db.dispName = "(Muelles) Tipo 60"\r\n        Tipo_60,\r\n        /** Muelle, estructura y, piso en madera.\r\n         */\r\n        !!@ ili2db.dispName = "(Muelles) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Canchas de tenis"\r\n      CanchasTenis(\r\n        /** En polvo de ladrillo\r\n         */\r\n        !!@ ili2db.dispName = "(Canchas de tenis) Tipo 20"\r\n        Tipo_20,\r\n        /** Cemento y/o asfalto.\r\n         */\r\n        !!@ ili2db.dispName = "(Canchas de tenis) Tipo 10"\r\n        Tipo_10\r\n      ),\r\n      !!@ ili2db.dispName = "Toboganes"\r\n      Toboganes(\r\n        /** Altura entre 9 y 15 Mts., longitud de canal entre 75 y 120 Mts. Fibra de vidrio. Estructura de concreto o metálica. Incluye piscina de Llegada. Sistema de bombeo, purificación.\r\n         */\r\n        !!@ ili2db.dispName = "(Toboganes) Tipo 80"\r\n        Tipo_80,\r\n        /** Altura entre 3 y 9 Mts., longitud 25 a 75 Mts. Estructura y soportes en concreto o metálica. Incluye piscina de acceso y sistema de bombeo y purificación.\r\n         */\r\n        !!@ ili2db.dispName = "(Toboganes) Tipo 60"\r\n        Tipo_60,\r\n        /** Altura de 6 a 9 Mts. Únicamente deslizadero de velocidad de longitud de 20 a 40 Mts. Equipo de bombeo y purificación. Estructura metálica o concreto; piscina de acceso.\r\n         */\r\n        !!@ ili2db.dispName = "(Toboganes) Tipo 50"\r\n        Tipo_50,\r\n        /** Altura de 3 a 5 Mts. Únicamente deslizadero; longitud de 10 a 20 Mts. No tienen planta de tratamiento ni de bombeo.\r\n         */\r\n        !!@ ili2db.dispName = "(Toboganes) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Marquesinas"\r\n      Marquesinas(\r\n        /** Estructura metálica; cubierta cristalita o vidrio; piso en baldosa fina.\r\n         */\r\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 80"\r\n        Tipo_80,\r\n        /** Estructura metálica; cubierta en cristalita o vidrio; piso en baldosa común.\r\n         */\r\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 60"\r\n        Tipo_60,\r\n        /** Estructura metálica; cubierta de eternit y piso en cemento.\r\n         */\r\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 40"\r\n        Tipo_40,\r\n        /** Estructura en madera; cubierta de zinc o eternit; Piso en baldosín o cemento.\r\n         */\r\n        !!@ ili2db.dispName = "(Marquesinas) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Estadios o coliseos"\r\n      Estadios_Coliseos(\r\n        /** Estadio, estructura en concreto reforzado, graderías, con o sin cubierta parcial, capacidad mayor a 8.000 personas\r\n         */\r\n        !!@ ili2db.dispName = "(Estadios o coliseos) Tipo 80"\r\n        Tipo_80,\r\n        /** Estadio, estructura en concreto reforzado, graderías, con o sin cubierta parcial, capacidad mayor a 8.000 personas\r\n         */\r\n        !!@ ili2db.dispName = "(Estadios o coliseos) Tipo 60"\r\n        Tipo_60,\r\n        /** Coliseo, incluye cerramiento en malla, o en bloque pañetado cancha multifuncional, cubierta en teja termo acústica\r\n         */\r\n        !!@ ili2db.dispName = "(Estadios o coliseos) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Plaza de toros"\r\n      Plazas_de_Toros(\r\n        /** Plaza de toros con estructura en concreto y madera capacidad de más de 10000 espectadores\r\n         */\r\n        !!@ ili2db.dispName = "(Plaza de toros) Tipo 80"\r\n        Tipo_80,\r\n        /** Plaza de toros para corralejas, estructura en madera capacidad menor a 4000 estructura en concreto y madera capacidad\r\n         */\r\n        !!@ ili2db.dispName = "(Plaza de toros) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Vía férrea"\r\n      Via_Ferrea(\r\n        /** Via férrea de trocha  normal o estándar (4 pies, 8 1/2 pulgadas o 1435 metros) con capacidad de transporte mayor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Vía férrea) Tipo 80"\r\n        Tipo_80,\r\n        /** Via férrea de trocha angosta o yardica de 0.915 metros con capacidad menor a 50 toneladas, conformada por una capa de balasto, sobre la cual se disponen traviesas de madera que soportan los rieles, entiéndase como trocha a la distancia mínima entre los dos rieles.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Vía férrea) Tipo 60"\r\n        Tipo_60\r\n      ),\r\n      !!@ ili2db.dispName = "Carreteras"\r\n      Carreteras(\r\n        /** Carretera pavimentada. Compuesta de una subbase granular, base en suelo cemento y carpeta asfáltica, entiéndase por sub-base granular como la capa de material granular situada entre la base del firme y la explanada.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Carreteras) Tipo 60"\r\n        Tipo_60,\r\n        /** Carretera sin pavimento. Compuesta de una sub-base granular, entiéndase por su-base granular como la capa de material granular situada entre la base del firme y la explanada.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Carreteras) Tipo 40"\r\n        Tipo_40\r\n      ),\r\n      !!@ ili2db.dispName = "Cimientos estructura muros placabase"\r\n      Cimientos_Estructura_Muros_Placabase(\r\n        /** Cimientos y estructura soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros y placas base. Esta tipología se caracteriza por presentar de manera simultánea los 4 elementos (Cimientos, Estructura, Muro o Pared y Losa de Contra piso)\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 80"\r\n        Tipo_80,\r\n        /** Cimentación y estructura con soportes verticales (columnas) y horizontales (vigas) destinados a sostener la totalidad o parte de la futura construcción o edificación, acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 3 elementos (Cimientos, Estructura, y alguno de estos dos elementos Muro Pared o Losa en Contra piso)\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 60"\r\n        Tipo_60,\r\n        /** Cimentación sin estructura destinada a sostener la totalidad o parte de una futura construcción o edificación, pueden estar acompañados de muros o placas base. Esta tipología se caracteriza por presentar de manera simultánea 2 elementos (Cimientos y alguno de estos dos elemetnos Muro - Pared o Losa de Contra piso)\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 40"\r\n        Tipo_40,\r\n        /** Cimentación sin estructura, destinada a sostener la totalidad o parte de una futura construcción o edificación. Esta tipología se caracteriza por presentar un solo elemento, la cimentación.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Cimientos estructura muros placabase) Tipo 20"\r\n        Tipo_20\r\n      ),\r\n      !!@ ili2db.dispName = "Lagunas de oxidación"\r\n      Lagunas_de_Oxidacion(\r\n        /** Lagunas de oxidación que en su construcción requieren excavaciones en la estructura de la laguna, con o sin protección del área de la laguna con geotextil o geomembrana, construcción de diques, protección de los taludes con geotextil o geomembrana y enrocado de taludes.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) (Lagunas de oxidación) Tipo 20"\r\n        Tipo_20\r\n      )\r\n    );\r\n\r\n    /** Calificación del suelo.\r\n     */\r\n    LC_CalificarTipo = (\r\n      /** Calificación para predios de uso residencial.\r\n       */\r\n      !!@ ili2db.dispName = "Residencial"\r\n      Residencial,\r\n      /** Calificación para predios de uso industrial.\r\n       */\r\n      !!@ ili2db.dispName = "Industrial"\r\n      Industrial,\r\n      /** Calificación para predios de uso Institucional.\r\n       */\r\n      !!@ ili2db.dispName = "Institucional"\r\n      Institucional,\r\n      /** Calificación para predios de uso comercial.\r\n       */\r\n      !!@ ili2db.dispName = "Comercial"\r\n      Comercial\r\n    );\r\n\r\n    /** Categoría de suelo de la clasificación del Plan de Ordenamiento Territorial.\r\n     */\r\n    LC_CategoriaSueloTipo = (\r\n      /** Constituyen esta categoría las áreas ubicadas dentro del suelo rural, en las que se mezclan los usos del suelo y las formas de vida del campo y la ciudad, diferentes a las clasificadas como áreas de expansión urbana, que pueden ser objeto de desarrollo con restricciones de uso, de intensidad y de densidad, garantizando el autoabastecimiento en servicios públicos domiciliarios, de conformidad con lo establecido en la Ley 99 de 1993 y en la Ley 142 de 1994. Podrán formar parte de esta categoría los suelos correspondientes a los corredores urbanos interregionales.\r\n       * \r\n       * Los municipios y distritos deberán establecer las regulaciones complementarias tendientes a impedir el desarrollo de actividades y usos urbanos en estas áreas, sin que previamente se surta el proceso de incorporación al suelo urbano, para lo cual deberán contar con la infraestructura de espacio público, de infraestructura vial y redes de energía, acueducto y alcantarillado requerida para este tipo de suelo. (Artículo 34, Ley 388 de 1997)\r\n       */\r\n      !!@ ili2db.dispName = "Suburbano"\r\n      Suburbano,\r\n      /** Constituido por las zonas y áreas de terrenos localizados dentro de cualquiera de las anteriores clases, que por sus características geográficas, paisajísticas o ambientales, o por formar parte de las zonas de utilidad pública para la ubicación de infraestructuras para la provisión de servicios públicos domiciliarios o de las áreas de amenazas y riesgo no mitigable para la localización de asentamientos humanos, tiene restringida la posibilidad de urbanizarse. (Articulo 35, Ley 388 de 1997)\r\n       */\r\n      !!@ ili2db.dispName = "Protección"\r\n      Proteccion\r\n    );\r\n\r\n    LC_ClaseCalificacionTipo = (\r\n      /** En construcción, es el nombre que recibe el conjunto de elementos, unidos, ensamblados o conectados entre sí, que tienen la función de recibir cargas, soportar esfuerzos y transmitir esas cargas al suelo, garantizando así la función estático - resistente de la construcción. Sus componentes son: armazón, muros y cubierta.\r\n       */\r\n      !!@ ili2db.dispName = "Estructura"\r\n      Estructura,\r\n      /** Son los revestimientos o recubrimientos a todos aquellos materiales que se colocan sobre una superficie de obra negra, para darle terminación a las obras, quedando ésta con un aspecto habitable. Sus componentes son: fachada, cubrimiento de muros y pisos.\r\n       */\r\n      !!@ ili2db.dispName = "Acabados principales"\r\n      Acabados_Principales,\r\n      /** Espacio o lugar especialmente equipado para el aseo personal. Sus componentes son: tamaño, enchapes y mobiliario.\r\n       */\r\n      !!@ ili2db.dispName = "Baño"\r\n      Banio,\r\n      /** Espacio o lugar especialmente equipado para la preparación de alimentos. Sus componentes son: tamaño, enchapes y mobiliario.\r\n       */\r\n      !!@ ili2db.dispName = "Cocina"\r\n      Cocina,\r\n      /** Elemento adicional para la calificación de las Cerchas para las construcciones industriales.\r\n       */\r\n      !!@ ili2db.dispName = "Complemento industria"\r\n      Complemento_Industria\r\n    );\r\n\r\n    /** Clase de suelo de la clasificación del Plan de Ordenamiento Territorial.\r\n     */\r\n    LC_ClaseSueloTipo = (\r\n      /** Constituyen el suelo urbano, las áreas del territorio distrital o municipal destinadas a usos urbanos por el plan de ordenamiento, que cuenten con infraestructura vial y redes primarias de energía, acueducto y alcantarillado, posibilitándose su urbanización y edificación, según sea el caso. Podrán pertenecer a esta categoría aquellas zonas con procesos de urbanización incompletos, comprendidos en áreas consolidadas con edificación, que se definan como áreas de mejoramiento integral en los planes de ordenamiento territorial.\r\n       * \r\n       * Las áreas que conforman el suelo urbano serán delimitadas por perímetros y podrán incluir los centros poblados de los corregimientos. En ningún caso el perímetro urbano podrá ser mayor que el denominado perímetro de servicios públicos o sanitario. (Artículo 31, Ley 388 de 1997)\r\n       */\r\n      !!@ ili2db.dispName = "Urbano"\r\n      Urbano,\r\n      /** Constituyen esta categoría los terrenos no aptos para el uso urbano, por razones de oportunidad, o por su destinación a usos agrícolas, ganaderos, forestales, de explotación de recursos naturales y actividades análogas. (Artículo 33, Ley 388 de 1997)\r\n       */\r\n      !!@ ili2db.dispName = "Rural"\r\n      Rural,\r\n      /** Constituido por la porción del territorio municipal destinada a la expansión urbana, que se habilitará para el uso urbano durante la vigencia del plan de ordenamiento, según lo determinen los Programas de Ejecución.\r\n       * \r\n       * La determinación de este suelo se ajustará a las previsiones de crecimiento de la ciudad y a la posibilidad de dotación con infraestructura para el sistema vial, de transporte, de servicios públicos domiciliarios, áreas libres, y parques y equipamiento colectivo de interés público o social.\r\n       * \r\n       * Dentro de la categoría de suelo de expansión podrán incluirse áreas de desarrollo concertado, a través de procesos que definan la conveniencia y las condiciones para su desarrollo mediante su adecuación y habilitación urbanística a cargo de sus propietarios, pero cuyo desarrollo estará condicionado a la adecuación previa de las áreas programadas. (Artículo 32, Ley 388 de 1997)\r\n       */\r\n      !!@ ili2db.dispName = "Expansión urbana"\r\n      Expansion_Urbana\r\n    );\r\n\r\n    /** Valores para indicar el tipo de condición de predio\r\n     */\r\n    LC_CondicionPredioTipo = (\r\n      /** Predio no sometido al régimen de propiedad horizontal.\r\n       */\r\n      !!@ ili2db.dispName = "No propiedad horizontal"\r\n      NPH,\r\n      /** Predio sometido al régimen de propiedad horizontal mediante escritura pública registrada\r\n       */\r\n      !!@ ili2db.dispName = "Propiedad horizontal"\r\n      PH(\r\n        /** Predio matriz del régimen de propiedad horizontal sobre el cual se segregan todas las unidades prediales.\r\n         */\r\n        !!@ ili2db.dispName = "(Propiedad horizontal) Matriz"\r\n        Matriz,\r\n        /** Apartamento, garaje, depósito o cualquier otro tipo de unidad predial dentro del PH que se encuentra debidamente inscrito en el registro de instrumentos públicos\r\n         */\r\n        !!@ ili2db.dispName = "(Propiedad horizontal) Unidad Predial"\r\n        Unidad_Predial\r\n      ),\r\n      /** Predio sometido al régimen de propiedad horizontal mediante escritura pública registrada en cuyo reglamento define para cada unidad predial un área privada de terreno.\r\n       */\r\n      !!@ ili2db.dispName = "Condominio"\r\n      Condominio(\r\n        /** Predio matriz del condominio sobre el cual se segregan todas las unidades prediales.\r\n         */\r\n        !!@ ili2db.dispName = "(Condominio) Matriz"\r\n        Matriz,\r\n        /** Unidad predial dentro del condominio matriz.\r\n         */\r\n        !!@ ili2db.dispName = "(Condominio) Unidad predial"\r\n        Unidad_Predial\r\n      ),\r\n      /** Es la construcción o edificación instalada por una persona natural o jurídica sobre un predio que no le pertenece.\r\n       */\r\n      !!@ ili2db.dispName = "Mejora"\r\n      Mejora(\r\n        /** Mejora sobre un predio sometido a régimen de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Mejora) Propiedad horizontal"\r\n        PH,\r\n        /** Mejora sobre un predio no sometido a régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Mejora) No propiedad horizontal"\r\n        NPH\r\n      ),\r\n      /** Predios sobre los cuales las áreas de terreno y construcciones son dedicadas a la cremación, inhumación o enterramiento de personas fallecidas.\r\n       */\r\n      !!@ ili2db.dispName = "Parque cementerio"\r\n      Parque_Cementerio(\r\n        /** Predios sobre los cuales las áreas de terreno y construcciones son dedicadas a la cremación, inhumación o enterramiento de personas fallecidas.\r\n         */\r\n        !!@ ili2db.dispName = "(Parque cementerio) Matriz"\r\n        Matriz,\r\n        /** Área o sección de terreno con función de tumba, esta debe encontrarse inscrita en el registro de instrumentos públicos.\r\n         */\r\n        !!@ ili2db.dispName = "(Parque Cementerio) Unidad predial"\r\n        Unidad_Predial\r\n      ),\r\n      /** Espacio (terreno y construcción) diseñado y destinado para el tránsito de vehículos, personas, entre otros\r\n       */\r\n      !!@ ili2db.dispName = "Vía"\r\n      Via,\r\n      /** Inmuebles que siendo de dominio de la Nación, o una entidad territorial o de particulares, están destinados al uso de los habitantes.\r\n       */\r\n      !!@ ili2db.dispName = "Bien de uso público"\r\n      Bien_Uso_Publico\r\n    );\r\n\r\n    LC_ConstruccionPlantaTipo = (\r\n      /** Superficie horizontal de un espacio arquitectónico que divide los espacios en altura.\r\n       */\r\n      !!@ ili2db.dispName = "Piso"\r\n      Piso,\r\n      /** Piso intermedio entre los pisos principales de una casa o edificio.\r\n       */\r\n      !!@ ili2db.dispName = "Mezanine"\r\n      Mezanine,\r\n      /** Piso de un edificio situado por debajo del nivel de la calle.\r\n       */\r\n      !!@ ili2db.dispName = "Sótano"\r\n      Sotano,\r\n      /** Piso que sobresale por lo menos la mitad de su altura, del nivel de un patio de la calle.\r\n       */\r\n      !!@ ili2db.dispName = "Semisótano"\r\n      Semisotano,\r\n      /** Construcción que se encuentra por debajo del nivel de la calle y que comprende grandes espacios.\r\n       */\r\n      !!@ ili2db.dispName = "Subterráneo"\r\n      Subterraneo\r\n    );\r\n\r\n    LC_ConstruccionTipo = (\r\n      /** Se refiere aquellas construcciones de uso residencial, comercial e industrial.\r\n       */\r\n      !!@ ili2db.dispName = "Convencional"\r\n      Convencional,\r\n      /** Se refiere aquellas construcciones consideradas anexos de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "No convencional"\r\n      No_Convencional\r\n    );\r\n\r\n    LC_DerechoTipo = (\r\n      /** El dominio que se llama también propiedad es el derecho real en una cosa corporal, para gozar y disponer de ella arbitrariamente, no siendo contra ley o contra derecho ajeno. (Art. 669 CC): 0100 0101 0102 0103 0106 0107 0108 0109 0110 0111 0112 0113 0114 0115 0116 0117 0118 0119 0120 0121 0122 0124 0125 0126 0127 0128 0129 0130 0131 0132 0133 0135 0137 0138 0139 0140 0141 0142 0143 0144 0145 0146 0147 0148 0150 0151 0152 0153 0154 0155 0156 0157 0158 0159 0160 0161 0163 0164 0165 0166 0167 0168 0169 0171 0172 0173 0175 0177 0178 0179 0180 0181 0182 0183 0184 0185 0186 0187 0188 0189 0190 0191 0192 0193 0194 0195 0196 0197 0198 0199 01003 01004 01005 01006 01007 01008 01009 01010 01012 01013 01014 0301 0307 0321 0332 0348 0356 0374 0375 0376 0377 0906 0907 0910 0911 0912 0913 0915 0917 0918 0919 0920 0924 0935 0959 0962 0963\r\n       */\r\n      !!@ ili2db.dispName = "Dominio"\r\n      Dominio,\r\n      /** En el ámbito de la gestión catastral, es el polígono que representa el asentamiento de personas naturales o jurídicas dentro de un terreno baldío, el cual puede contar o no con construcciones y/o edificaciones.\r\n       */\r\n      !!@ ili2db.dispName = "Ocupación"\r\n      Ocupacion,\r\n      /** En el ámbito de la gestión catastral, es el polígono que representa el asentamiento de personas naturales o jurídicas, con ánimo de señor y dueño sobre un predio privado, el cual puede contar o no con construcciones y/o edificaciones.\r\n       */\r\n      !!@ ili2db.dispName = "Posesión"\r\n      Posesion\r\n    );\r\n\r\n    /** Uso económico de la propiedad inmobiliaria.\r\n     */\r\n    LC_DestinacionEconomicaTipo = (\r\n      /** Se califica con destino acuícola, aquellos predios donde se realizan cultivos de organismos acuáticos, en ambientes naturales o artificiales.\r\n       */\r\n      !!@ ili2db.dispName = "Acuicola"\r\n      Acuicola,\r\n      /** Se califica con destino agrícola, aquellos predios con funcionalidad de laboreo agrícola, terrenos que han sido transformados y ocupados para la producción de cultivos cuyo objetivo es satisfacer las necesidades alimentarias, comerciales y agrícolas.\r\n       * \r\n       * En caso de encontrar actividad agrícola y actividad pecuaria en un mismo predio, se califica según la actividad que predomine. Si, ambas actividades tienen el mismo porcentaje de participación en el predio, se debe calificar como agrícola.\r\n       */\r\n      !!@ ili2db.dispName = "Agrícola"\r\n      Agricola,\r\n      /** Se califica con destino agroindustrial, aquellos predios destinados a la actividad que implica cultivo (producción) y transformación (industrialización y comercialización) de productos agrícola, pecuario y forestal.\r\n       */\r\n      !!@ ili2db.dispName = "Agroindustrial"\r\n      Agroindustrial,\r\n      /** Se califica con destino agroforestal, aquellos predios destinados al establecimiento y aprovechamiento combinado de especies forestales con actividades agrícolas o pecuarias con arreglos diferenciados. Incluye la actividad agrosilvícola, silvopastoril y agrosilvopastoril.\r\n       */\r\n      !!@ ili2db.dispName = "Agroforestal"\r\n      Agroforestal,\r\n      /** Se califica con destino comercial, aquellos predios cuya finalidad es la de realizar la actividad económica de ofrecer, transar o almacenar bienes y/o servicios a través de un mercader o comerciante.\r\n       */\r\n      !!@ ili2db.dispName = "Comercial"\r\n      Comercial,\r\n      /** Se califica con destino cultural, aquellos predios considerados como bienes culturales de la nación, además los espacios destinados al desarrollo de actividades artísticas.\r\n       */\r\n      !!@ ili2db.dispName = "Cultural"\r\n      Cultural,\r\n      /** Se califica con destino educativo, aquellos predios donde se desarrollan actividades académicas, tanto de la educación inicial, preescolar, básica, media y superior. Incluye los jardines, escuelas, colegios, institutos técnicos, fundaciones educativas, centros de investigación y universidades.\r\n       */\r\n      !!@ ili2db.dispName = "Educativo"\r\n      Educativo,\r\n      /** Se califica con destino forestal, aquellos predios con áreas naturales o seminaturales, constituidas principalmente por elementos arbóreos de especies nativas, exóticas e introducidas.  Incluye las plantaciones forestales comerciales y los bosques naturales y seminaturales.\r\n       */\r\n      !!@ ili2db.dispName = "Forestal"\r\n      Forestal,\r\n      /** Se califica con destino habitacional, aquellos predios de uso residencial cuya finalidad es la vivienda habitual de las personas. Incluye los parqueaderos, garajes y depósitos dentro de propiedad horizontal como también los predios rurales de vivienda campestre.\r\n       */\r\n      !!@ ili2db.dispName = "Habitacional"\r\n      Habitacional,\r\n      /** Se califica con destino industrial, aquellos predios donde se desarrollan actividades de producción, fabricación, preparación, recuperación, reproducción, ensamblaje, construcción, transformación, tratamiento y manipulación de materias primas para producir bienes o productos materiales y que no estén clasificados dentro de los predios mineros.\r\n       */\r\n      !!@ ili2db.dispName = "Institucional"\r\n      Industrial,\r\n      /** Se califica con destino infraestructura asociada a la producción agropecuaria, aquellos predios sobre los cuales se encuentra la infraestructura requerida dentro de la actividad agropecuaria y que son de interés para el sector agropecuario, como: bancos de maquinaria, plantas de almacenamiento, centros de acopio, centros de transformación agrícola, mataderos, etc.\r\n       */\r\n      !!@ ili2db.dispName = "Infraestructura asociada a producción agropecuaria"\r\n      Infraestructura_Asociada_Produccion_Agropecuaria,\r\n      /** Se califica con destino infraestructura hidráulica, aquellos predios sobre los cuales se encuentra establecida infraestructura para controlar, almacenar y conducir un flujo continuo de agua. Incluye los embalses, represas, acueductos, centrales de tratamiento y distribución, alcantarillados, estaciones depuradoras de aguas residenciales y distrito de adecuación de tierras.\r\n       */\r\n      !!@ ili2db.dispName = "Infraestructura hidráulica"\r\n      Infraestructura_Hidraulica,\r\n      /** Se califica con destino infraestructura de saneamiento básico, aquellos predios sobre los cuales se encuentra establecida la infraestructura para el saneamiento básico, con excepción del alcantarillado. Incluye los centros de acopio de basura y material reciclable, rellenos sanitarios e incineradoras.\r\n       */\r\n      !!@ ili2db.dispName = "Infraestructura saneamiento"\r\n      Infraestructura_Saneamiento_Basico,\r\n      /** Se califica con destino infraestructura de seguridad, aquellos predios sobre los cuales se encuentra establecida infraestructura destina a salvaguardar el orden público. Incluye las estaciones de policía, batallones, cárceles, etc.\r\n       */\r\n      !!@ ili2db.dispName = "Infraestructura seguridad"\r\n      Infraestructura_Seguridad,\r\n      /** Se califica con destino infraestructura de transporte, aquellos predios en los cuales se encuentra establecida infraestructura para el desarrollo de actividad de transporte, muelles para embarque, desembarque de carga y/o pasajeros, pistas de aterrizaje, torres de control, centros de almacenamiento y venta de combustible, etc. Se exceptúan de estas, aquellas plataformas flotantes y aquellas que se encuentren fuera de la plataforma continental.\r\n       */\r\n      !!@ ili2db.dispName = "Infraestructura transporte"\r\n      Infraestructura_Transporte,\r\n      /** Se califica con destino institucional, aquellos predios destinados a la administración y prestación de servicios del Estado tanto de orden nacional como territorial.\r\n       */\r\n      !!@ ili2db.dispName = "Institucional"\r\n      Institucional,\r\n      /** Se califica con destino minería e hidrocarburos, aquellos predios donde se hace aprovechamiento directo de los recursos minerales o transformación primaria de los mismos.\r\n       */\r\n      !!@ ili2db.dispName = "Minería hidrocarburos"\r\n      Mineria_Hidrocarburos,\r\n      /** Se califica con este destino, aquellos predios urbanos no construidos, ubicados en terrenos de grandes áreas que no han sido desarrollados y sin restricción legal para adelantar algún tipo de desarrollo urbanístico.\r\n       */\r\n      !!@ ili2db.dispName = "Lote urbanizable no urbanizado"\r\n      Lote_Urbanizable_No_Urbanizado,\r\n      /** Se califica con este destino, aquellos predios urbanos no construidos, ubicados en zonas urbanizadas, es decir, con infraestructura de servicios públicos e infraestructura vial.\r\n       */\r\n      !!@ ili2db.dispName = "Lote urbanizado no construido"\r\n      Lote_Urbanizado_No_Construido,\r\n      /** Se califica con este destino, aquellos predios urbanos o rurales clasificados por el instrumento de planeación como suelo de protección, también se incluyen los predios con afectación, por ejemplo los utilizados como servidumbres para los servicios públicos.\r\n       */\r\n      !!@ ili2db.dispName = "Lote no urbanizable"\r\n      Lote_No_Urbanizable,\r\n      /** Se califica con destino pecuario, aquellos predios destinados a la cría, beneficio y aprovechamiento de especies de animales no domésticos, para el consumo humano (productos cárnicos y lácteos), uso artesanal (lana, cuero, plumas, etc.) y conservación de fauna (zoocría).\r\n       */\r\n      !!@ ili2db.dispName = "Pecuario"\r\n      Pecuario,\r\n      /** Se califica con destino recreacional, aquellos predios que corresponden a equipamientos deportivos y recreativos, parques de propiedad privada o pública, clubes, generando bienestar físico y social.\r\n       */\r\n      !!@ ili2db.dispName = "Recreacional"\r\n      Recreacional,\r\n      /** Se califica con destino religioso, aquellos predios cuya finalidad es el culto religioso público, incluye las parroquias, basílicas, catedrales, santuarios, capillas, colegiatas, monasterios, conventos y seminarios.\r\n       */\r\n      !!@ ili2db.dispName = "Religioso"\r\n      Religioso,\r\n      /** Se califica con destino salubridad, aquellos predios destinados al cuidado de la salud de los ciudadanos, incluye los hospitales, centros de salud, clínicas, laboratorios y consultorios que prestan el servicio de salud tanto carácter público o privado\r\n       */\r\n      !!@ ili2db.dispName = "Salubridad"\r\n      Salubridad,\r\n      /** Se califica con destino infraestructura de servicios funerarios, aquellos predios que prestan servicios de velatorio, cremación y entierro de personas fallecidas, incluye los cementerios, funerarias, morgue, anfiteatros, crematorios y demás relacionados.\r\n       */\r\n      !!@ ili2db.dispName = "Servicios funerarios"\r\n      Servicios_Funerarios,\r\n      /** Se califica con destino uso público, aquellos predios urbanos o rurales, que conforman el espacio público, como las zonas verdes, alamedas, plazas (no se incluyen las plazas de mercado), plazoletas parques, cuerpos de agua, áreas de control y protección ambiental, túneles, vías, ciclorutas, glorietas, etc.\r\n       */\r\n      !!@ ili2db.dispName = "Uso público"\r\n      Uso_Publico\r\n    );\r\n\r\n    LC_DominioConstruccionTipo = (\r\n      /** Tipo de dominio común.\r\n       */\r\n      !!@ ili2db.dispName = "Común"\r\n      Comun,\r\n      /** Tipo de dominio privado.\r\n       */\r\n      !!@ ili2db.dispName = "Privado"\r\n      Privado\r\n    );\r\n\r\n    LC_EstadoConservacionTipo = (\r\n      /** Se agrupan en este concepto, aquellas estructuras con el mayor grado de deterioro que se puedan encontrar, en condiciones precarias lo cual las hace prácticamente inhabitables.  Generalmente se presenta en construcciones antiguas o con material de muy mala calidad.\r\n       */\r\n      !!@ ili2db.dispName = "Malo"\r\n      Malo,\r\n      /** En esta categoría, se clasifican aquellas estructuras que tienen algunos daños menores, (agrietamiento de paredes, hundimiento de pisos, etc.) pero que todavía se encuentran en condiciones aceptables, sin peligros eminentes o exigencias imperativa de reparaciones inmediatas.  Se presenta con frecuencia en construcciones más o menos antiguas o materiales de regular calidad.\r\n       */\r\n      !!@ ili2db.dispName = "Regular"\r\n      Regular,\r\n      /** Se calificarán como tales, aquellas estructuras, no necesariamente nuevas, que se hallan cumpliendo a cabalidad con la función para las que fueron construidas, no demuestran deterioro, al menos visibles, y por efectos de uso se encuentran solamente un tanto deslucidas y sus materiales son de buena calidad.\r\n       */\r\n      !!@ ili2db.dispName = "Bueno"\r\n      Bueno,\r\n      /** Se define en este grado, el estado de conservación de una estructura nueva en la que no se vislumbra deterioro, no se observa daño y en la cual los materiales y los acabados son de óptima calidad.\r\n       */\r\n      !!@ ili2db.dispName = "Excelente"\r\n      Excelente\r\n    );\r\n\r\n    LC_FotoidentificacionTipo = (\r\n      /** Demarcación de un área con un punto que se encuentra visible en un proceso de fotoidentificación.\r\n       */\r\n      !!@ ili2db.dispName = "Visible"\r\n      Visible,\r\n      /** Demarcación estimada mediante la interpretación de coberturas  de un área con un punto en un proceso de fotoidentificación.\r\n       */\r\n      !!@ ili2db.dispName = "Estimado"\r\n      Estimado\r\n    );\r\n\r\n    LC_FuenteAdministrativaTipo = (\r\n      /** Una escritura pública es un documento público en el que se realiza ante un notario público un determinado hecho o un derecho autorizado por dicho fedatario público, que firma con el otorgante u otorgantes,mostrando sobre la capacidad jurídica del contenido y de la fecha en que se realizó\r\n       */\r\n      !!@ ili2db.dispName = "Escritura pública"\r\n      Escritura_Publica,\r\n      /** La sentencia es la resolución judicial definitiva dictada por un juez o tribunal que pone fin a la litis o caso sometido a su conocimiento y cierra definitivamente su actuación en el mismo\r\n       */\r\n      !!@ ili2db.dispName = "Sentencia judicial"\r\n      Sentencia_Judicial,\r\n      /** Un acto administrativo es toda manifestación o declaración emanada de la administración pública en el ejercicio de potestades administrativas, mediante el que impone su voluntad sobre los derechos, libertades o intereses de otros sujetos públicos o privados y que queda bajo el del comienzo.\r\n       */\r\n      !!@ ili2db.dispName = "Acto administrativo"\r\n      Acto_Administrativo,\r\n      /** Documento que contiene un compromiso entre dos o más personas que lo firman.\r\n       */\r\n      !!@ ili2db.dispName = "Documento privado"\r\n      Documento_Privado,\r\n      /** Cuando no se haya documento soporte pero puede ser una declaración verbal.\r\n       */\r\n      !!@ ili2db.dispName = "Sin documento"\r\n      Sin_Documento\r\n    );\r\n\r\n    LC_GrupoEtnicoTipo = (\r\n      /** Son el grupo humano que vive de acuerdo con las formas de relación con el medio natural en el que se asentaron los diferentes grupos aborígenes desde antes de la conquista y la han conservado y dinamizado a lo largo de la historia.\r\n       */\r\n      !!@ ili2db.dispName = "Indígena"\r\n      Indigena,\r\n      /** El pueblo Rrom o gitano se consolida y fortalece como grupo étnico que hacer parte de la diversidad étnica y cultural de la nación colombiana. Su origen se remonta a más de 1000 años, proviene del norte de la India y conserva un alto bagaje cultural que lo diferencia de otros pueblos y de la sociedad mayoritaria. En este sentido, cuenta con unos elementos identitarios que los diferencian notablemente de los demás grupos étnicos de la sociedad. Sé es Rrom o gitano por derecho de nacimiento y se lleva la sangre gitana.\r\n       */\r\n      !!@ ili2db.dispName = "Rrom"\r\n      Rrom,\r\n      /** Es la población nativa de las Islas de San Andrés, Providencia Y Santa Catalina descendientes de la unión entre europeos (principalmente ingleses, españoles y holandeses) y esclavos africanos. Se distinguen por su cultura, lengua (creole), creencias religiosas (iglesia bautista) y pasado histórico similar a los pueblos antillanos como Jamaica y Haití.\r\n       */\r\n      !!@ ili2db.dispName = "Raizal"\r\n      Raizal,\r\n      /** La comunidad palenquera está conformada por los descendientes de los esclavizados que mediante actos de resistencia y de libertad, se refugiaron en los territorios de la Costa Norte de Colombia desde el Siglo XV denominados palenques. Existen 4 Palenques reconocidos: San Basilio de Palenque (Mahates – Bolívar), San José de Uré (Córdoba), Jacobo Pérez escobar (Magdalena) y La Libertad (Sucre).\r\n       */\r\n      !!@ ili2db.dispName = "Palenquero"\r\n      Palenquero,\r\n      /** Es el conjunto de familias de ascendencia afrocolombiana que poseen una cultura propia, comparten una historia y tienen sus propias tradiciones y costumbres dentro de la relación campo-poblado, además revelan y conservan conciencia de identidad que las distinguen de otros grupos étnicos. Se suele denominar a este grupo humano como negros, morenos, mulatos y afrodescendientes.\r\n       */\r\n      !!@ ili2db.dispName = "Negro o afrocolombiano"\r\n      Negro_Afrocolombiano,\r\n      /** No pertenece a ningún grupo étnico.\r\n       */\r\n      !!@ ili2db.dispName = "Ninguno"\r\n      Ninguno\r\n    );\r\n\r\n    LC_InteresadoDocumentoTipo = (\r\n      /** Es un documento emitido por la Registraduría Nacional del Estado Civil para permitir la identificación personal de los ciudadanos.\r\n       */\r\n      !!@ ili2db.dispName = "Cédula de ciudadanía"\r\n      Cedula_Ciudadania,\r\n      /** Es el documento que cumple los fines de identificación de los extranjeros en el territorio nacional y su utilización deberá estar acorde con la visa otorgada al extranjero.\r\n       */\r\n      !!@ ili2db.dispName = "Cédula de estranjería"\r\n      Cedula_Extranjeria,\r\n      /** El Número de Identificación Tributaria (NIT) es un código privado, secreto e intransferible que solamente debe conocer el contribuyente.\r\n       */\r\n      !!@ ili2db.dispName = "NIT"\r\n      NIT,\r\n      /** Es el documento oficial que hace las veces de identificación para los menores de edad entre los 7 y los 18 años.\r\n       */\r\n      !!@ ili2db.dispName = "Tarjeta de identidad"\r\n      Tarjeta_Identidad,\r\n      /** Registro donde se hacen constar por autoridades competentes los nacimientos, matrimonios, defunciones y demás hechos relativos al estado civil de las personas. En el modelo se tendrá en cuenta el número de registro como identificación personal de las personas de 0 a 7 años.\r\n       */\r\n      !!@ ili2db.dispName = "Registro civil"\r\n      Registro_Civil,\r\n      /** Es un consecutivo asignado automáticamente en registro en lugar del número de la identificación de la persona que hace el trámite, se usa especialmente en trámites de construcción cuando el proyecto está a nombre de una Fiducia el cual tiene el mismo número del banco.\r\n       */\r\n      !!@ ili2db.dispName = "Secuencial"\r\n      Secuencial\r\n    );\r\n\r\n    LC_InteresadoTipo = (\r\n      /** Se refiere a la persona humana.\r\n       */\r\n      !!@ ili2db.dispName = "Persona natural"\r\n      Persona_Natural,\r\n      /** Se llama persona jurídica, una persona ficticia, capaz de ejercer derechos y contraer obligaciones civiles, y de ser representada judicial y extrajudicialmente. Las personas jurídicas son de dos especies: corporaciones y fundaciones de beneficencia pública.\r\n       */\r\n      !!@ ili2db.dispName = "Persona jurídica"\r\n      Persona_Juridica\r\n    );\r\n\r\n    LC_ObjetoConstruccionTipo = (\r\n      /** Se refiere al conjunto compuesto por los cimientos, columnas, vigas, entrepisos y demás componentes del esqueleto o armadura que soportan las cargas y sostienen la edificación.  El adobe, bahareque, tapia, califíquelos con el puntaje correspondiente a madera.  En el caso de tener muros de carga en ladrillo, califíquelos como armazón de ladrillo.  En aquellas viviendas de hasta tres pisos y en donde se observe, vigas, columnas y planchas se colocan en la opción “concreto hasta tres pisos”.  La máxima calificación será para edificaciones de concreto de 4 o más pisos.\r\n       */\r\n      !!@ ili2db.dispName = "Armazón"\r\n      Armazon(\r\n        !!@ ili2db.dispName = "(Armazón) Madera"\r\n        Madera,\r\n        !!@ ili2db.dispName = "(Armazón) Prefabricado"\r\n        Prefabricado,\r\n        !!@ ili2db.dispName = "(Armazón) Ladrillo, bloque"\r\n        Ladrillo_Bloque,\r\n        !!@ ili2db.dispName = "(Armazón) Concreto hasta tres pisos"\r\n        Concreto_Hasta_Tres_Pisos,\r\n        !!@ ili2db.dispName = "(Armazón) Concreto cuatro o más pisos"\r\n        Concreto_Cuatro_O_Mas_Pisos\r\n      ),\r\n      /** Se refiere a los muros divisorios no considerados como parte del armazón.\r\n       */\r\n      !!@ ili2db.dispName = "Muros"\r\n      Muros(\r\n        !!@ ili2db.dispName = "(Muros) Materiales de desecho, esterilla"\r\n        Materiales_Desecho_Esterilla,\r\n        !!@ ili2db.dispName = "(Muros) Bahareque, adobe, tapia"\r\n        Bahareque_Adobe_Tapia,\r\n        !!@ ili2db.dispName = "(Muros) Madera"\r\n        Madera,\r\n        !!@ ili2db.dispName = "(Muros) Concreto prefabricado"\r\n        Concreto_Prefabricado,\r\n        !!@ ili2db.dispName = "(Muros) Bloque, ladrillo"\r\n        Bloque_Ladrillo\r\n      ),\r\n      /** Techo exterior o tejado de la edificación\r\n       */\r\n      !!@ ili2db.dispName = "Cubierta"\r\n      Cubierta(\r\n        !!@ ili2db.dispName = "(Cubierta) Materiales de desecho, telas asfalticas"\r\n        Materiales_Desecho_Telas_Asfalticas,\r\n        !!@ ili2db.dispName = "(Cubierta) Zinc, teja de barro, eternit rústico"\r\n        Zinc_Teja_De_Barro_Eternit_Rustico,\r\n        !!@ ili2db.dispName = "(Cubierta) Entrepiso (cubierta provisional) prefabricado"\r\n        Entrepiso_Cubierta_Provisional_Prefabricado,\r\n        !!@ ili2db.dispName = "(Cubierta) Eternit o teja de barro (cubierta sencilla)"\r\n        Eternit_O_Teja_De_Barro_Cubierta_Sencilla,\r\n        !!@ ili2db.dispName = "(Cubierta) Azotea, aluminio, placa sencilla con eternit o teja de barro"\r\n        Azotea_Aluminio_Placa_Sencilla_Con_Eternit,\r\n        !!@ ili2db.dispName = "(Cubierta) Placa imperbeabilizada cubierta lujosa u ornamental"\r\n        Placa_Impermeabilizada_Cubierta_Lujosa_U_Ornamental\r\n      ),\r\n      /** Nombrase como tal al conjunto de elementos que constituyen el frente o parte exterior de una construcción, que da cara a la vía o camino, que incluye la puerta de acceso.  Tomada dentro de la variable, acabados principales constituyen un concepto bastante representativo de la calidad de la vivienda.\r\n       */\r\n      !!@ ili2db.dispName = "Fachada"\r\n      Fachada(\r\n        /** -Puerta:  Fabricada con materiales como: Maderas burdas, lámina de zinc, lata o latones carecen por completo de lujos.\r\n         * \r\n         * -Ventanas:  En la gran mayoría de casos son pequeñas, en madera burda o ángulo de hierro sencillo.\r\n         * \r\n         * -Cubrimiento del muro:  Generalmente los muros no tienen cubrimiento, se presentan con ladrillo corrientes o bloque a la vista y en algunos casos pintura de cal o carburo directamente sobre el ladrillo, y en ocasiones pañete sin pintar o con pinturas muy económicas.\r\n         */\r\n        !!@ ili2db.dispName = "(Fachada) Pobre"\r\n        Pobre,\r\n        /** -Puerta:  En maderas sin trabajar o láminas metálicas sin ornamentación\r\n         * \r\n         * -Ventanas:  Pequeñas o de regular tamaño, en madera sin trabajo ornamental o metal con pintura de aceite.\r\n         * \r\n         * -Cubrimiento de muros:  En la mayoría de los casos se encuentran pañetes con pinturas económicas, o ladrillo prensado a la vista, generalmente un solo plano en el frente.\r\n         */\r\n        !!@ ili2db.dispName = "(Fachada) Sencilla"\r\n        Sencilla,\r\n        /** -Puerta de distintos tamaños, construidas en madera elaborada, o metal en lámina doblada, con rejas en ornamentación metálica en la mayoría de los casos.\r\n         * \r\n         * -Cubrimiento:  Se encuentran frecuentemente pañetados y enlucidos con pintura de regular calidad; en urbanizaciones se utiliza bastante el pañete rústico pintado con cal o carburo.  Otras opciones son: En ladrillo prensado a la vista, el granito y la chapa de piedra de presentación sencilla.  Hasta dos planos enfrente y con una longitud entre 7 y 8 mts, con antejardín, donde la puerta de garaje forma parte integral de esta fachada.\r\n         */\r\n        !!@ ili2db.dispName = "(Fachada) Regular"\r\n        Regular,\r\n        /** -Puertas en maderas con cierto trabajo manual; en algunos casos en lámina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.\r\n         * \r\n         * -Ventanas:  Amplias, en lámina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.\r\n         * \r\n         * -Cubrimiento:  Pañete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rústico fino pintado en vinilo, piedra pulida.\r\n         * \r\n         * -La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.\r\n         */\r\n        !!@ ili2db.dispName = "(Fachada) Buena"\r\n        Buena,\r\n        /** -Puertas en maderas con cierto trabajo manual; en algunos casos en lámina prensada (pintada en aceite o en muy pocos casos al duco) con metal ornamentado y vidrio martillado.\r\n         * \r\n         * -Ventanas:  Amplias, en lámina prensada o madera trabajada, pintura de aceite.  Las ventanas ocupan buena parte del frente y la fachada.\r\n         * \r\n         * -Cubrimiento:  Pañete en cemento, pintura en vinilo, ladrillo prensado a la vista pintado en aceite, granito rústico fino pintado en vinilo, piedra pulida.\r\n         * \r\n         * -La fachada presenta varios planos y tiene una longitud entre 10 y 14 mts, en el cual la puerta del garaje, en ocasiones doble, participa en forma importante.\r\n         */\r\n        !!@ ili2db.dispName = "(Fachada) Lujosa"\r\n        Lujosa\r\n      ),\r\n      /** Se califica de acuerdo al material y según las opciones que se presentan en el formulario, se tendrá en cuenta que si aparece por lo menos el 80% en pañete, se marcará este material y si aparece por lo menos un 20% de otro material de los más costosos (granito, madera, mármol), se marcará este en el formulario.  Si se encuentra por lo menos el 50% sin cubrimiento, se calificará como tal.  En caso de encontrarse un cubrimiento no completado en el formulario se asimilará, según el factor, más cercano de los referidos.  El pañete se refiere al cubrimiento en el cual se emplea solamente arena y cemento; el estuco es el cubrimiento fino sobre pañete.\r\n       * \r\n       * Es necesario aclarar que en el caso del papel de colgadura, se debe tener en cuenta que éste se encuentra en dos categorías:\r\n       * \r\n       * Papel común:  Características de las construcciones de estratos medio bajo y medio medio, se presenta en la mayoría de los casos textura gruesa y superficie corrugada.\r\n       * \r\n       * Papel fino: Contrario al anterior, se encuentra normalmente en construcciones lujosas y se caracteriza por su textura fina, visible en los orillos y superficie lisa.  Sus acabados siempre son finos.\r\n       * \r\n       * Además de los muros, el papel se encuentra en enchapes de baños y cocinas.\r\n       */\r\n      !!@ ili2db.dispName = "Cubrimiento de muros"\r\n      Cubrimiento_Muros(\r\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Sin cubrimiento"\r\n        Sin_Cubrimiento,\r\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Pañete, papel común, ladrillo prensado"\r\n        Paniete_Papel_Comun_Ladrillo_Prensado,\r\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Estuco, cerámica, papel fino"\r\n        Estuco_Ceramica_Papel_Fino,\r\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Madera, piedra ornamental"\r\n        Madera_Piedra_Ornamental,\r\n        !!@ ili2db.dispName = "(Cubrimiento de muros) Mármol, lujosos otros"\r\n        Marmol_Lujosos_Otros\r\n      ),\r\n      /** En esta componente, se inscribirá lo referente al material predominante en el piso de la construcción según las opciones indicadas en el formulario y el más costoso si se encuentra en partes iguales.  Se marcará también con una X según la unidad de avalúo reconocida.\r\n       */\r\n      !!@ ili2db.dispName = "Piso"\r\n      Piso(\r\n        !!@ ili2db.dispName = "(Piso) Tierra pisada"\r\n        Tierra_Pisada,\r\n        !!@ ili2db.dispName = "(Piso) Cemento, madera burda"\r\n        Cemento_Madera_Burda,\r\n        !!@ ili2db.dispName = "(Piso) Baldosa común de cemento, tablón de ladrillo"\r\n        Baldosa_Comun_De_Cemento_Tablon_Ladrillo,\r\n        !!@ ili2db.dispName = "(Piso) Listón machihembrado"\r\n        Liston_Machihembrado,\r\n        !!@ ili2db.dispName = "(Piso) Tableta, caucho, acrílico, granito, baldosa fina"\r\n        Tableta_Caucho_Acrilico_Granito_Baldosa_Fina,\r\n        !!@ ili2db.dispName = "(Piso) Parquet, alfombra, retal de marmol (grano pequeño)"\r\n        Parquet_Alfombra_Retal_De_Marmol,\r\n        !!@ ili2db.dispName = "(Piso) Retal de mármol, mármol, otros lujosos"\r\n        Retal_De_Marmol_Marmol_Otros_Lujosos\r\n      ),\r\n      !!@ ili2db.dispName = "Tamaño de baño"\r\n      Tamanio_Banio(\r\n        /** Sin baño\r\n         */\r\n        !!@ ili2db.dispName = "(Tamaño de baño) Sin baño"\r\n        Sin_Banio,\r\n        /** Si mide menos de 4 mts cuadrados.\r\n         */\r\n        !!@ ili2db.dispName = "(Tamaño de baño) Pequeño"\r\n        Pequenio,\r\n        /** Si su área aproximada se encuentra entre 4 y 6 mts.\r\n         */\r\n        !!@ ili2db.dispName = "(Tamaño de baño) Mediano"\r\n        Mediano,\r\n        /** Si su área es mayor a 6 mts cuadrados.\r\n         */\r\n        !!@ ili2db.dispName = "(Tamaño de baño) Grande"\r\n        Grande\r\n      ),\r\n      /** Se refiere al cubrimiento de los muros del baño principal, se calificará según las opciones establecidas en el formulario de reconocimiento, teniendo en cuenta que los materiales y condiciones no contemplados se deben asimilar al más parecido de ellos de acuerdo con el costo.  Marque el material que corresponda al mayor porcentaje o al más costoso si se encuentran por partes iguales.\r\n       */\r\n      !!@ ili2db.dispName = "Enchape de baño"\r\n      Enchape_Banio(\r\n        !!@ ili2db.dispName = "(Enchape de baño) Sin cubrimiento"\r\n        Sin_Cubrimiento,\r\n        !!@ ili2db.dispName = "(Enchape de baño) Pañete, baldosa común de cemento"\r\n        Paniete_Baldosa_Comun_De_Cemento,\r\n        !!@ ili2db.dispName = "(Enchape de baño) Baldosín unicolor, papel común"\r\n        Baldosin_Unicolor_Papel_Comun,\r\n        !!@ ili2db.dispName = "(Enchape de baño) Baldosín decorado, papel fino"\r\n        Baldosin_Decorado_Papel_Fino,\r\n        !!@ ili2db.dispName = "(Enchape de baño) Cerámica cristanac, granito"\r\n        Ceramica_Cristanac_Granito,\r\n        !!@ ili2db.dispName = "(Enchape de baño) Mármol, enchape lujoso"\r\n        Marmol_Enchape_Lujoso\r\n      ),\r\n      !!@ ili2db.dispName = "Mobiliario de baño"\r\n      Mobiliario_Banio(\r\n        /** Cuenta con uno o máximo dos servicios entre lavamanos retrete y ducha; los porcelanizados, en caso de tenerlos, son muy económicos; exceptuando los gabinetes pequeños de latón, no tiene ningún otro mobiliario ni divisiones.\r\n         */\r\n        !!@ ili2db.dispName = "(Mobiliario de baño) Pobre"\r\n        Pobre,\r\n        /** Esta categoría de baños cuenta con tres servicios.  Los porcenalizados de esta categoría son del tipo standard, se encuentran gabinetes muy sencillos y en latón y ocasionalmente pequeños armarios en madera burda o metal.\r\n         */\r\n        !!@ ili2db.dispName = "(Mobiliario de baño) Sencillo"\r\n        Sencillo,\r\n        /** Tiene mínimo tres servicios pero de tipo económico.  Tienen gabinetes de regular tamaño, algunas veces empotrados, lavamanos con mueble o pedestal y división de la ducha.\r\n         */\r\n        !!@ ili2db.dispName = "(Mobiliario de baño) Regular"\r\n        Regular,\r\n        /** Cuenta como mínimo con cuatro servicios, los porcenalizados son finos, en colores, con pedestales, adornos y grifería fina, tina, planchas de lavamanos generalmente en mármol con muebles en madera trabajada de tamaños regulares a grandes, con espejos más o menos grandes con luz integrada, la tina forma parte de la ducha, en el mismo espacio.\r\n         * \r\n         * También se encuentran pequeños armarios y gabinetes auxiliares en madera o acrílico, empotrados o sobrepuestos.  Normalmente presentan división de la ducha, construida en aluminio y cristalita.\r\n         */\r\n        !!@ ili2db.dispName = "(Mobiliario de baño) Bueno"\r\n        Bueno,\r\n        !!@ ili2db.dispName = "(Mobiliario de baño) Lujoso"\r\n        Lujoso\r\n      ),\r\n      !!@ ili2db.dispName = "Tamaño de cocina"\r\n      Tamanio_Cocina(\r\n        !!@ ili2db.dispName = "(Tamaño de cocina) Sin cocina"\r\n        Sin_Cocina,\r\n        !!@ ili2db.dispName = "(Tamaño de cocina) Pequeña"\r\n        Pequenia,\r\n        !!@ ili2db.dispName = "(Tamaño de cocina) Mediana"\r\n        Mediana,\r\n        !!@ ili2db.dispName = "(Tamaño de cocina) Grande"\r\n        Grande\r\n      ),\r\n      !!@ ili2db.dispName = "Enchape de cocina"\r\n      Enchape_Cocina(\r\n        !!@ ili2db.dispName = "(Enchape de cocina) Sin cubrimiento"\r\n        Sin_Cubrimiento,\r\n        !!@ ili2db.dispName = "(Enchape de cocina) Pañete, baldosa de cemento"\r\n        Paniete_Baldosa_De_Cemento,\r\n        !!@ ili2db.dispName = "(Enchape de cocina) Baldosín unicolor, papel común"\r\n        Baldosin_Unicolor_Papel_Comun,\r\n        !!@ ili2db.dispName = "(Enchape de cocina) Baldosín decorado, papel fino"\r\n        Baldosin_Decorado_Papel_Fino,\r\n        !!@ ili2db.dispName = "(Enchape de cocina) Cerámica cristanac, granito"\r\n        Ceramica_Cristanac_Granito,\r\n        !!@ ili2db.dispName = "(Enchape de cocina) Mármol, enchape lujoso"\r\n        Marmol_Enchape_Lujoso\r\n      ),\r\n      !!@ ili2db.dispName = "Mobiliario de cocina"\r\n      Mobiliario_Cocina(\r\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Pobre"\r\n        Pobre,\r\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Sencillo"\r\n        Sencillo,\r\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Regular"\r\n        Regular,\r\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Bueno"\r\n        Bueno,\r\n        !!@ ili2db.dispName = "(Mobiliario de cocina) Lujoso"\r\n        Lujoso\r\n      ),\r\n      !!@ ili2db.dispName = "Cerchas complemento industria"\r\n      Cerchas_Complemento_Industria(\r\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Madera"\r\n        Madera,\r\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Metálica liviana"\r\n        Metalica_Liviana,\r\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Metálica mediana"\r\n        Metalica_Mediana,\r\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Metálica pesada"\r\n        Metalica_Pesada,\r\n        !!@ ili2db.dispName = "(Cerchas complemento industria) Altura"\r\n        Altura\r\n      )\r\n    );\r\n\r\n    LC_OfertaTipo = (\r\n      /** Es una operación que se realiza a través del mercado inmobiliario, mediante la cual un ofertante pone a la venta algún un inmueble.\r\n       */\r\n      !!@ ili2db.dispName = "Venta"\r\n      Venta,\r\n      /** Es una operación que se realiza a través del mercado inmobiliario, mediante la cual un ofertante pone en alquiler o arriendo un bien inmueble.\r\n       */\r\n      !!@ ili2db.dispName = "Arriendo"\r\n      Arriendo\r\n    );\r\n\r\n    LC_PredioTipo = (\r\n      /** Es el predio que pertenece al estado y/o cuyo propietario es una entidad de derecho público\r\n       */\r\n      !!@ ili2db.dispName = "Público"\r\n      Publico(\r\n        /** Es un bien inmueble de propiedad de la Nación y ubicado en zonas rurales\r\n         */\r\n        !!@ ili2db.dispName = "(Público) Baldío"\r\n        Baldio,\r\n        /** Los bienes de la Unión cuyo uso no pertenece generalmente a los habitantes, se llaman bienes de la Unión o bienes fiscales\r\n         */\r\n        !!@ ili2db.dispName = "(Público) Fiscal"\r\n        Fiscal,\r\n        /** Son bienes patrimoniales los de titularidad de las administraciones públicas que no tengan el carácter de bienes de dominio público, es decir, que no estén destinados directamente al uso público o afectados a un servicio público. Si no consta la afectación de un bien se presume su carácter patrimonial.\r\n         */\r\n        !!@ ili2db.dispName = "(Público) Patrimonial"\r\n        Patrimonial,\r\n        /** Son aquellos inmuebles de dominio público cuyo uso pertenece a todos los habitantes del territorio nacional, destinados al uso o disfrute colectivo.\r\n         */\r\n        !!@ ili2db.dispName = "(Público) Uso público"\r\n        Uso_Publico\r\n      ),\r\n      /** Es aquel que ha salido del patrimonio del estado, cuenta con un propietario inscrito en el folio de matrícula y se considera propiedad privada en los términos del artículo 48 de la Ley 160 de 1993.\r\n       */\r\n      !!@ ili2db.dispName = "(Privado)"\r\n      Privado,\r\n      /** Son los predios adjudicados a comunidades pertenecientes a grupos étnicos en el marco del reconocimiento de los resguardos legalmente constituidos según el Decreto 2164 de 1995 o de las propiedades colectivas de comunidades negras conforme Ley 70 de 1993.\r\n       */\r\n      !!@ ili2db.dispName = "(Territorio colectivo)"\r\n      Territorio_Colectivo,\r\n      /** Son bienes inmuebles que se encuentran dentro de territorio respectivo a cargo de la Nación, sin dueño aparente o conocido\r\n       */\r\n      !!@ ili2db.dispName = "Vacante"\r\n      Vacante\r\n    );\r\n\r\n    LC_ProcedimientoCatastralRegistralTipo = (\r\n      /** El gestor catastral competente, de oficio o a solicitud de parte del titular del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, podrán efectuar la actualización mediante la descripción técnica de linderos de bienes inmuebles, cuando sean verificables mediante métodos directos y/o indirectos sin variación, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. La descripción de los linderos llevará a la certeza del área. Articulo 2.2.2.2.17. Decreto 148 de 2020.\r\n       */\r\n      !!@ ili2db.dispName = "Actualización linderos con efectos registrales"\r\n      Actualizacion_Linderos,\r\n      /** La rectificación de área en el sistema catastral y/o registral procederá ante el gestor catastral, de oficio o a solicitud de parte del titular  del derecho de dominio, o de las entidades públicas que con ocasión de sus funciones legales administran inmuebles propios o ajenos, cuando los linderos estén debida y técnicamente descritos, sean verificables mediante métodos directos y/o indirectos sin variación, pero que a lo largo de la tradición del bien inmueble el área de éste no haya sido determinada adecuadamente, o cuando la variación o diferencia se encuentre dentro de los márgenes de tolerancia establecidos por la máxima autoridad catastral. Artículo 2.2.2.2.17. Decreto 148 de 2020.\r\n       */\r\n      !!@ ili2db.dispName = "Rectificación de área por imprecisa determinación con efectos registrales"\r\n      Rectificacion_Area,\r\n      /** La rectificación de linderos en el sistema catastral y registral procederá de oficio o a solicitud de parte, ante el gestor catastral, siempre y cuando se haya suscrito acta de colindancia con pleno acuerdo entre los propietarios que compartan uno o varios linderos, pero se adviertan diferencias de linderos y áreas, entre la verificación mediante métodos directos y/o indirectos y la información del folio de matricula inmobiliaria. La rectificación de todos los linderos puede llevar a la certeza del área del inmueble. Artículo 2.2.2.2.17. Decreto 148 de 2020.\r\n       */\r\n      !!@ ili2db.dispName = "Rectificación de linderos por acuerdo entre las partes con efectos registrales"\r\n      Rectificacion_Linderos,\r\n      /** n los casos donde los folios de matrícula inmobiliaria no hayan contado con información de área y/o linderos, desde el inicio del ciclo traslaticio del bien\r\n       * inmueble que identifican; la Oficina de Registro de Instrumentos Públicos procederá la inclusión del dato de área y/o linderos en las respectivas matrículas inmobiliarias, que se tomará de la base catastral administrada por el gestor catastral competente.\r\n       */\r\n      !!@ ili2db.dispName = "Inclusión en el campo de cabida y linderos del dato del área y/o linderos en los folios de matrícula inmobiliaria"\r\n      Inclusion_Cabida_Linderos,\r\n      /** No requiere procedimiento catastral con efecto registral.\r\n       */\r\n      !!@ ili2db.dispName = "No requiere procedimiento"\r\n      No_Requiere\r\n    );\r\n\r\n    /** Conjunto de valores para indicar si se trata de un punto de control de referencia (un punto principal) o de apoyo (uso para levantamientos locales con estación total)\r\n     */\r\n    LC_PuntoControlTipo = (\r\n      /** Puntos en el terreno levantados por topografía o geodesia que sirven de base para la orientación absoluta en la restitución fotogramétrica, y para efectuar un tratamiento geométrico o geo-referenciación de los datos en teledetección.\r\n       */\r\n      !!@ ili2db.dispName = "Control"\r\n      Control,\r\n      /** Puntos en el terreno levantados por topografía o geodesia que sirven de base para la orientación absoluta en la restitución fotogramétrica, y para efectuar un tratamiento geométrico o geo-referenciación de los datos en teledetección.\r\n       */\r\n      !!@ ili2db.dispName = "Apoyo"\r\n      Apoyo\r\n    );\r\n\r\n    /** Punto de leventamiento planimetrico que se identifican en el marco de la identificación de las construcciones, los linderos o puntos auxiliares levantado para el apoyo en la mediciión\r\n     */\r\n    LC_PuntoLevTipo = (\r\n      /** Puntos de levantamiento para delimitar las construcción y unidades de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Construcción"\r\n      Construccion,\r\n      /** Puntos de levantamiento para las servidumbres de tránsito.\r\n       */\r\n      !!@ ili2db.dispName = "Servidumbre"\r\n      Servidumbre\r\n    );\r\n\r\n    LC_PuntoTipo = (\r\n      /** Punto referido a los soportes verticales que sirven de apoyo,utilizados en la construcción de alambradas, tendidos eléctricos y telefónicos, televisión por cable, para iluminar calles, plazas o estadios y en las actividades agrícolas.\r\n       */\r\n      !!@ ili2db.dispName = "Poste"\r\n      Poste,\r\n      /** Punto referido a las esquina o sección de los paramentos de las construcción y unidades de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Construcción"\r\n      Construccion,\r\n      /** Punto referido a los puntos limitantes con elementos hidrográficos que por su condición pueden variar su límite con el tiempo.\r\n       */\r\n      !!@ ili2db.dispName = "Punto dinámico"\r\n      Punto_Dinamico,\r\n      /** Punto referido a los elementos naturales de la vegetación  como los árboles, arbustos o cualquier otra especie de la fauna.\r\n       */\r\n      !!@ ili2db.dispName = "elemento natural"\r\n      Elemento_Natural,\r\n      /** Punto referido a los elementos piedra o rocas.\r\n       */\r\n      !!@ ili2db.dispName = "Piedra"\r\n      Piedra,\r\n      /** Puntos referido a las áreas de campos abiertos, zonas boscosas, desérticas o cualquier otro tipo de espacio donde no se aprecia una clara delimitación.\r\n       */\r\n      !!@ ili2db.dispName = "Sin materialización"\r\n      Sin_Materializacion,\r\n      /** Puntos referidos a los mojones utilizados en topografía que tienen datos de coordenadas espaciales.\r\n       */\r\n      !!@ ili2db.dispName = "Mojón"\r\n      Mojon,\r\n      /** Puntos referidos a las incrustaciones realizadas en el suelo.\r\n       */\r\n      !!@ ili2db.dispName = "Incrustación"\r\n      Incrustacion,\r\n      /** Puntos referidos a las columnas verticales donde se encuentra materializado un punto con coordenadas espaciales.\r\n       */\r\n      !!@ ili2db.dispName = "Pilastra"\r\n      Pilastra\r\n    );\r\n\r\n    LC_RelacionPredioTipo = (\r\n      /** Parte interesada (Propietario, Poseedor, Ocupante)\r\n       */\r\n      !!@ ili2db.dispName = "Parte interesada (Propietario, Poseedor, Ocupante)"\r\n      Parte_Interesada,\r\n      /** Indica si un vecino de la parte interesada (propietario, poseedor u ocupante) fue el encargado de atender la visita predial.\r\n       */\r\n      !!@ ili2db.dispName = "Vecino"\r\n      Vecino,\r\n      /** Indica si un familiar de la parte interesada (propietario, poseedor u ocupante) fue el encargado de atender la visita predial.\r\n       */\r\n      !!@ ili2db.dispName = "Familiar"\r\n      Familiar,\r\n      /** Indica si el arrendatario o alguna persona de su núcleo familiar fue el encargado de atender la visita predial.\r\n       */\r\n      !!@ ili2db.dispName = "Arrendatario"\r\n      Arrendatario,\r\n      /** Indica si el administrador o alguna persona de su núcleo familiar fue el encargado de atender la visita predial.\r\n       */\r\n      !!@ ili2db.dispName = "Administrador"\r\n      Administrador\r\n    );\r\n\r\n    LC_RestriccionTipo = (\r\n      /** Es la agrupación de códigos registrales que hacen referencia a servidumbres:\r\n       * \r\n       * 0325\r\n       * 0334\r\n       * 0335\r\n       * 0336\r\n       * 0337\r\n       * 0338\r\n       * 0339\r\n       * 0340\r\n       * 0341\r\n       * 0342\r\n       * 0343\r\n       * 0344\r\n       * 0350\r\n       * 0351\r\n       * 0354\r\n       * 0358\r\n       * 0373\r\n       * 0381\r\n       */\r\n      !!@ ili2db.dispName = "Servidumbre de paso"\r\n      Servidumbre(\r\n        /** Se trata de predio sirviente que sufre el gravamen para permitir la comunicación uso y bienestar de otro predio. (Artículo 905 del C.C.)\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Tránsito"\r\n        Transito,\r\n        /** Es el gravamen impuesto sobre un predio para permitir la salida de las aguas sobrantes de otro predio. (Art. 928 del C.C.).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Aguas negras"\r\n        Aguas_Negras,\r\n        /** Permite realizar y mantener las obras necesarias para la eficiencia y segura ventilación. Las empresas de servicios públicos podrán pasar por predios ajenos por vía aérea y realizar en ellos las actividades necesarias para prestar el servicio. (Artículo 215 del Decreto 1275 de 1970, artículo 57 de la Ley 142 de 1994).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Aire"\r\n        Aire,\r\n        /** Supone para las entidades públicas que tienen a su cargo la construcción de centrales generadoras, líneas de interconexión, transmisión y prestación del servicio público de distribución de energía eléctrica, la facultad de pasar por los predios afectados, por vía aérea, subterránea o superficial, las líneas de transmisión y distribución del fluido eléctrico, ocupar las zonas objeto de servidumbre, transitar por los mismos, adelantar las obras, ejercer la vigilancia, conservación y mantenimiento y emplear los demás medios necesarios para su ejercicio. (Artículo 18 de la Ley 126 de 1938 y Artículo 25 de la Ley 56 de 1981). (Artículo 57 de la Ley 142 de 1994).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Energía eléctrica"\r\n        Energia_Electrica,\r\n        /** Es el conjunto de actividades ordenadas a la distribución de gas combustible, por tubería u otro medio, desde un sitio de acopio de grandes volúmenes o desde un gasoducto central hasta la instalación de un consumidor final, incluyendo su conexión y medición. \r\n         *  Se constituye la servidumbre a favor de la explotación de los gases derivados del petróleo.\r\n         *  Cuando sea necesario las empresas que prestan el servicio podrán pasar por predios ajenos por vía subterránea o superficial los cables o tuberías, ocupar temporalmente las zonas que requieren esos predios, remover los cultivos y obstáculos de toda clase que se encuentren en ellos, transitar, adelantar las obras y ejercer vigilancia en ellos y en general realizar todas las actividades necesarias para prestar el servicio.\r\n         *  Las líneas de distribución de gas combustible, podrán atravesar los ríos, caudales, líneas férreas, puentes, calles, caminos, y cruzar acueductos, oleoductos, y otras líneas o conducciones. (Art. 14 númeral 28, y artículo 57 de la Ley 142 de 1994).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Gasoducto"\r\n        Gasoducto,\r\n        /** Tiene por objeto dar luz a un espacio cualquiera, cerrado y techado. \r\n         * Se llama predio sirviente el que debe permitir el paso de la luz y predio dominante el que tiene derecho a ella. (Artículos 931 al 935 del Código Civil).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Luz"\r\n        Luz,\r\n        /** Se constituye a favor de la explotación de petróleo, comprendiendo el terreno suficiente para las estaciones de bombeo y demás dependencias necesarias para el funcionamiento de los oleoductos y el de establecer muelles, cargaderos y tuberías submarinas y fluviales. (Artículo 9 Decreto 1056 de 1954).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Oleoducto"\r\n        Oleoducto,\r\n        /** El predio inferior está sujeto a recibir las aguas que descienden del predio superior naturalmente, es decir, sin que la mano del hombre contribuya a ello. No se puede, por consiguiente, dirigir un albañal o acequia sobre el predio vecino, si no se ha constituido esta servidumbre especial. En el predio servil no se puede hacer cosa alguna que estorbe la servidumbre natural, ni el predio dominante, que la grave.\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Agua"\r\n        Agua,\r\n        /** Para el ejercicio eficiente de la industria minera en todas sus fases y etapas, podrán establecerse las servidumbres que sean necesarias sobre los predios ubicados dentro o fuera del área objeto del título minero. Cuando, para la construcción, el montaje, la explotación, el acopio y el beneficio, en ejercicio de las servidumbres se requiera usar recursos naturales renovables, será indispensable que dicho uso esté autorizado por la autoridad ambiental, cuando la ley así lo exija. También procede el establecimiento de servidumbre sobre zonas, objeto de otros títulos mineros. Tales gravámenes no podrán impedir o dificultar la exploración o la explotación de la concesión que los soporte. (Art 166 Ley 685 de 2001)\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Minera"\r\n        Minera,\r\n        /** La industria de los hidrocarburos está declarada de utilidad pública en sus ramos de exploración, producción, transporte, refinación y distribución. Los predios deberán soportar todas las servidumbres legales que sean necesarias para realizar las actividades de exploración, producción y transporte de los hidrocarburos, salvo las excepciones establecidas por la ley. Se entenderá que la servidumbre de ocupación de terrenos comprenderá el derecho a construir la infraestructura necesaria en campo e instalar todas las obras y servicios propios para beneficio del recurso de los hidrocarburos y del ejercicio de las demás servidumbres que se requieran. (Art. 1 Ley 1274 de 2009)\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Legal de hidrocarburos"\r\n        Legal_Hidrocarburos,\r\n        /** Es el conjunto de derechos y obligaciones que dimanan de la existencia y disfrute en común de una pared, cerca, vallado, etc. \r\n         * En todos los casos, y aun cuando conste que una cerca o pared divisoria pertenece exclusivamente a uno de los predios contiguos, el dueño del otro predio tendrá el derecho de hacer la medianería en todo o en parte, aun sin el consentimiento de su vecino, pagándole la mitad del valor del terreno en que está hecho el cerramiento, y la mitad del valor actual de la porción del cerramiento cuya medianería pretende. (Artículo 912 del C.C.).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Medianeria"\r\n        Medianeria,\r\n        /** Gravamen que afecta un predio, permitiendo que sobre el se conduzcan el alcantarillado que benefician a otro predio de diferente propietario.\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Alcantarillado"\r\n        Alcantarillado,\r\n        /** Gravamen que afecta un predio, permitiendo que sobre el se conduzcan las aguas que benefician a otro predio de diferente propietario. (Artículos 919 a 930 del Código Civil; Artículo 214 del Decreto 1275 de 1970. Artículo 57 de la Ley 142 de 1998).\r\n         */\r\n        !!@ ili2db.dispName = "(Servidumbre) Acueducto"\r\n        Acueducto\r\n      )\r\n    );\r\n\r\n    LC_ResultadoVisitaTipo = (\r\n      /** Tuvo acceso total al predio\r\n       */\r\n      !!@ ili2db.dispName = "Exitoso"\r\n      Exitoso,\r\n      /** Tuvo acceso parcial al predio.\r\n       */\r\n      !!@ ili2db.dispName = "Incompleto"\r\n      Incompleto,\r\n      /** Sin atención por parte de personas. Predio Desocupado.\r\n       */\r\n      !!@ ili2db.dispName = "No hay nadie"\r\n      No_hay_nadie,\r\n      /** No permitieron acceso al predio.\r\n       */\r\n      !!@ ili2db.dispName = "No permitieron acceso"\r\n      No_permitieron_acceso,\r\n      /** No hay adulto en el momento de la visita.\r\n       */\r\n      !!@ ili2db.dispName = "Menor de Edad"\r\n      Menor_de_Edad,\r\n      /** Por temas de seguridad asociados a orden público no es posible el acceso.\r\n       */\r\n      !!@ ili2db.dispName = "Situación de Orden Público"\r\n      Situacion_de_Orden_Publico,\r\n      /** Por limitaciones relacionadas con la topografía o accidentes geográficos no hubo acceso al predio.\r\n       */\r\n      !!@ ili2db.dispName = "Zona de difícil acceso"\r\n      Zona_de_dificil_acceso,\r\n      /** Otros casos no relacionados anteriormente.\r\n       */\r\n      !!@ ili2db.dispName = "Otro"\r\n      Otro\r\n    );\r\n\r\n    LC_SexoTipo = (\r\n      /** Que tiene órganos para fecundar\r\n       */\r\n      !!@ ili2db.dispName = "Masculino"\r\n      Masculino,\r\n      /** Que tiene órganos para ser fecundado.\r\n       */\r\n      !!@ ili2db.dispName = "Femenino"\r\n      Femenino\r\n    );\r\n\r\n    LC_TipologiaTipo = (\r\n      Residencial(\r\n        /** Armazón: Madera; Muro: Material de desecho, esterilla; Cubierta material desecho, telas asfálticas; Pisos tierra pisada.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 1A"\r\n        Tipo_1A,\r\n        /** Armazón: Madera; Muro: Material de bahareque, adobe, tapia; Cubierta: Zinc, teja de barro, Eternit rustico; Pisos: Cemento, madera burda\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 1B"\r\n        Tipo_1B,\r\n        /** Armazón: Madera; Muros en madera; Cubierta: Zinc, teja de barro, Eternit rustico; Cubrimiento de Muros: Pañete, papel común, ladrillo presado; Pisos: Cemento, madera burda.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 2A"\r\n        Tipo_2A,\r\n        /** Armazón: Prefabricado; Muros: Concreto prefabricado; Cubierta: Zinc, teja de barro, Eternit rustico; cubrimiento de Muros: Pañete, papel común,  ladrillo  presado;  Pisos:  Baldosa común de cemento, Tablón ladrillo.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 2B"\r\n        Tipo_2B,\r\n        /** Armazón: Ladrillo, bloque; Muro: ladrillo, Bloque; Cubierta: Eternit o teja de barro; Cubrimiento de muros: Pañete, papel común, ladrillo prensado; Piso: Baldosa común de cemento, tablón ladrillo.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 3A"\r\n        Tipo_3A,\r\n        /** Armazón: Ladrillo, bloque; Muro: ladrillo, Bloque; Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro; Cubrimiento muros: Estuco, cerámica, papel fino; Piso: Baldosa común de cemento, tablón ladrillo.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 3B"\r\n        Tipo_3B,\r\n        /** Armazón: Concreto hasta tres pisos, Muro: Bloque, ladrillo; Cubierta: Azotea, aluminio,\r\n         * placa sencilla con etnernit o teja de barro; Cubrimiento muro: estuco, cerámica, papel fino; Piso: Listón machi-embredo.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 4A"\r\n        Tipo_4A,\r\n        /** Armazón: Concreto hasta tres pisos, Muro: Bloque, Ladrillo; Cubierta: Azotea, aluminio,\r\n         * placa sencilla con etnernit o teja de barro; Cubrimiento muro: estuco, cerámica, papel fino; Piso: Tableta, caucho, acrilico, granito, baldosa fina.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 4B"\r\n        Tipo_4B,\r\n        /** Armazón: Concreto hasta tres pisos; Muro: Bloque, Ladrillo; Cubierta: Azote, Aluminio, placa sencilla con eternit o teja de barro; Cubrimiento muro: Medra, Piedra ornamental; Piso: Tableta, caucho, acrilico, granito, baldosa fina\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 5A"\r\n        Tipo_5A,\r\n        /** Armazón: Concreto cuadro y más pisos; Muro: Bloque, Ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimiento muro: Mármol, lujoso, otros; Piso: Parquet, alfombra, retal de mármol ( grano pequeño).\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 5B"\r\n        Tipo_5B,\r\n        /** Armazón: Concreto hasta tres pisos; Muro: Bloque, ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimientos muros: Mármol, lujosos otros; Piso: Parquet, alfombra, Retal de mármol ( grano pequeño).\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 6A"\r\n        Tipo_6A,\r\n        /** Armazón: Concreto cuatro o más pisos; Muro: Bloque, ladrillo; Cubierta: Placa impermeabilizada cubierta lujosa u ornamental; Cubrimientos muros: Mármol, lujosos otros; Piso: Retal de mármol, mármol, otros.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Tipo 6B"\r\n        Tipo_6B\r\n      ),\r\n      Comercial(\r\n        /** Armazón: Madera, prefabricado\r\n         * Muros: adobe, bahareque, tapia\r\n         * Cubierta: Zinc, material de desecho, telas asfálticas\r\n         * Fachada: Pobre\r\n         * Cubrimiento de Muros: Sin cubrimiento\r\n         * Pisos: tierra, cemento o madera burda.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Barrial 1"\r\n        Barrial_1,\r\n        /** Armazón: Ladrillo, bloque.\r\n         * Muros: Ladrillo y Bloque\r\n         * Cubierta: Zinc, Eternit o teja de barro\r\n         * Fachada: pobre o sencilla.\r\n         * Cubrimiento de Muros: Pañete, papel común, ladrillo prensado, estuco, cerámica\r\n         * Pisos: cemento Baldosa común de cemento, Tablón Ladrillo\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Barrial 2"\r\n        Barrial_2,\r\n        /** Armazón: Madera, Ladrilló, Bloque\r\n         * Muros: Madera, Bloque, concreto prefabricado\r\n         * Cubierta: Eternit o teja de barro, Entrepiso, (cubierta provisional) Prefabricado\r\n         * \r\n         * Fachada: Regular.\r\n         * Cubrimiento de Muros: Pañete, papel común, pañete, ladrillo prensado\r\n         * Pisos: Concreto, Listón machi-ambrado, baldosa común.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Sectorial 1"\r\n        Sectorial_1,\r\n        /** Armazón: Concreto hasta 3 pisos.\r\n         * Muros: Bloque, ladrillo\r\n         * Cubierta: Eternit, teja de barro placa concreto\r\n         * Fachada: Buena.\r\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, cerámica, papel fino\r\n         * \r\n         * Pisos: Tableta, caucho, acrílico, granito, baldosa fina\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Sectorial 2"\r\n        Sectorial_2,\r\n        /** Armazón: Concreto hasta 3 pisos\r\n         * Muros: Concreto prefabricado, bloque o ladrillo\r\n         * Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro\r\n         * Fachada: Buena.\r\n         * \r\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, Madera, piedra ornamental\r\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Especializado 1"\r\n        Especializado_1,\r\n        /** Armazón: Concreto 4 o más pisos\r\n         * Muros: Bloque ladrillo\r\n         * Cubierta: Placa Impermeabilizada cubierta lujosa u ornamental\r\n         * Fachada: Lujosa.\r\n         * Cubrimiento de Muros: Mármol, piedra ornamental Estucos especiales, otros lujosos\r\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Especializado 2"\r\n        Especializado_2\r\n      ),\r\n      Industrial(\r\n        /** Armazón: Madera, prefabricado\r\n         * Muros: adobe, bahareque, tapia\r\n         * Cerchas: Madera\r\n         * Cubierta: Material de desecho, telas asfálticas\r\n         * \r\n         * Fachada: Pobre\r\n         * Cubrimiento de Muros:\r\n         * Sin cubrimiento\r\n         * Pisos: tierra, cemento o madera burda.\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Liviana 1"\r\n        Liviana_1,\r\n        /** Armazón: Prefabricado, Ladrillo, bloque.\r\n         * Muros: Prefabricado, Ladrillo, bloque\r\n         * Cubierta: Zinc, Eternit o teja de barro\r\n         * Fachada: pobre o sencilla.\r\n         * \r\n         * Cubrimiento de Muros: Sin, Pañete, papel común, ladrillo prensado, estuco, cerámica\r\n         * Pisos: Cemento Baldosa común de cemento, Tablón Ladrillo.\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Liviana 2"\r\n        Liviana_2,\r\n        /** Armazón: Muros confinados Ladrillo o bloque\r\n         * Muros: Ladrillo, bloque o concreto prefabricado\r\n         * Cubierta: Entrepiso\r\n         * (cubierta provisional ) Prefabricado, teja eternit\r\n         * Fachada: Regular.\r\n         * \r\n         * Cubrimiento de Muros: Pañete, papel común, pañete, ladrillo prensado\r\n         * Pisos: Concreto, Listón machi-ambrado, baldosa común.\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Mediana 1"\r\n        Mediana_1,\r\n        /** Armazón: Concreto hasta 3 pisos.\r\n         * Muros: Bloque, ladrillo\r\n         * Cubierta: teja eternit, termo acústica o teja de barro\r\n         * Fachada: Buena.\r\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, cerámica, papel fino\r\n         * Pisos: Tableta, caucho, acrílico, granito, baldosa fina\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Mediana 2"\r\n        Mediana_2,\r\n        /** Armazón: Concreto hasta 3 pisos\r\n         * Muros: Concreto prefabricado, bloque o ladrillo\r\n         * Cubierta: Azotea, aluminio, placa sencilla con eternit o teja de barro\r\n         * Fachada: Buena.\r\n         * Cubrimiento de Muros: Ladrillo a la vista, Estuco, Madera, piedra ornamental\r\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Pesada 1"\r\n        Pesada_1,\r\n        /** Armazón: Concreto 4 o más pisos\r\n         * Muros: Bloque ladrillo\r\n         * Cubierta: Placa Impermeabilizada cubierta lujosa u ornamental\r\n         * Fachada: Lujosa.\r\n         * Cubrimiento de Muros: Mármol, piedra ornamental Estucos especiales, otros lujosos\r\n         * Pisos: Parquet, alfombra, retal de mármol ( grano pequeño); Cerámica fina\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Pesada 2"\r\n        Pesada_2\r\n      ),\r\n      !!@ ili2db.dispName = "Otro"\r\n      Otro\r\n    );\r\n\r\n    /** Valores válidos para indicar el tipo de construcción empleada para levantar una unidad de construcción, con incidencia en su avalúo. REVISAR DOCUMENTACIÓN\r\n     */\r\n    LC_UnidadConstruccionTipo = (\r\n      /** Tipo de unidad de construcción en uso para vivienda.\r\n       */\r\n      !!@ ili2db.dispName = "Residencial"\r\n      Residencial,\r\n      /** Tipo de unidad de construcción en uso de actividades comerciales.\r\n       */\r\n      !!@ ili2db.dispName = "Comercial"\r\n      Comercial,\r\n      /** Tipo de unidad de construcción en uso de actividades industriales.\r\n       */\r\n      !!@ ili2db.dispName = "Industrial"\r\n      Industrial,\r\n      /** Tipo de unidad de construcción en uso de actividades institucionales.\r\n       */\r\n      !!@ ili2db.dispName = "Institucional"\r\n      Institucional,\r\n      /** Tipo de unidad de construcción anexa, por ejemplo, piscinas, cobertizos, canchas de tenis, toboganes.\r\n       */\r\n      !!@ ili2db.dispName = "Anexo"\r\n      Anexo\r\n    );\r\n\r\n    LC_UsoUConsTipo = (\r\n      !!@ ili2db.dispName = "Residencial"\r\n      Residencial(\r\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos sometido en régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Apartamentos 4 y más pisos en PH"\r\n        Apartamentos_4_y_mas_pisos_en_PH,\r\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de 4 o 5 pisos.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Apartamentos en Edificio de 4 y 5 Pisos (Cartagena)"\r\n        Apartamentos_En_Edificio_4_y_5_Pisos_Cartagena,\r\n        /** Es una vivienda que comprende una o más habitaciones, en un edificio de varios pisos 4 o más pisos\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Apartamentos mas de 4 Pisos"\r\n        Apartamentos_Mas_De_4_Pisos,\r\n        /** Dormitorios de las fuerzas armadas y militares\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Barracas"\r\n        Barracas,\r\n        /** Típica casa con mampostería de piedra, pizarra y madera. Ha sido rehabilitada respetando escrupulosamente sus características exteriores y decorada con un interior tradicional\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Casa Elbas"\r\n        Casa_Elbas,\r\n        /** Edificación destinada al almacenamiento o resguardo de enceres, generalmente ubicados en los sótanos y semisótanos de los edificios, junto a los parqueaderos. Las áreas de estos depósitos generalmente no supera los 25 metros cuadrados.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Depósitos o lockers"\r\n        Depositos_Lockers,\r\n        /** Es el lugar cubierto, destinado al estacionamiento privado de vehículos.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Garajes Cubiertos"\r\n        Garajes_Cubiertos,\r\n        /** Es el lugar cubierto, destinado al estacionamiento privado o comunal en viviendas sometidas a régimen de propiedad  horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Garajes en PH"\r\n        Garajes_En_PH,\r\n        /** Los salones comunales son dependencias que se construyen dentro de los edificios y conjuntos que sobrepasan un área determinada de construcción, y se clasifican de acuerdo a las normas urbanísticas como equipamiento comunal privado.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Salón comunal"\r\n        Salon_Comunal,\r\n        /** Bien inmueble cubierto o descubierto ubicado en el último piso de algunos edificios utilizado para extender y secar la ropa y que está sometido a régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Secadero de ropa"\r\n        Secadero_Ropa,\r\n        /** Son las viviendas construidas durante el tiempo de la colonia española, se caracterizan por tener varias habitaciones, con ventanales que dan a uno o dos patios generalmente ubicados en el centro de la vivienda. Los principales materiales de la época era la tapia, bahareque, ladrillo, paja y teja.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Vivienda Colonial"\r\n        Vivienda_Colonial,\r\n        /** Es una casa de tres niveles cuya función arquitectónica y ambiental principal, es dar albergue en forma adecuada a una familia.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Vivienda hasta 3 pisos"\r\n        Vivienda_Hasta_3_Pisos,\r\n        /** Corresponde a edificaciones residenciales desarrolladas sobre un lote de terreno que comprende más de tres unidades prediales independientes, generalmente en edificios de varios pisos. Este tipo de vivienda prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Vivienda hasta 3 pisos en PH"\r\n        Vivienda_Hasta_3_Pisos_En_PH,\r\n        /** Es una vivienda acondicionada para la realización de actividades recreativas libres y el descanso.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Vivienda Recreacional"\r\n        Vivienda_Recreacional,\r\n        /** Es una casa cuya función arquitectónica y ambiental principal, es brindar descanso y recreación. Este tipo de vivienda  prevé? áreas de servicios comunales cuya propiedad y utilización privada se definen en reglamentos de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Residencial) Vivienda Recreacional en PH"\r\n        Vivienda_Recreacional_En_PH\r\n      ),\r\n      !!@ ili2db.dispName = "Comercial"\r\n      Comercial(\r\n        /** Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Bodegas Comerciales - Grandes Almacenes"\r\n        Bodegas_Comerciales_Grandes_Almacenes,\r\n        /** Es el espacio construido para la ejecución la recepción, almacenamiento y movimientos de materiales, materias primas y productos semielaborados, hasta el punto de consumo por un cliente externo o interno sometido a régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Bodegas Comerciales en PH"\r\n        Bodegas_Comerciales_en_PH,\r\n        /** es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Centros Comerciales"\r\n        Centros_Comerciales,\r\n        /** Es una construcción que consta de uno o varios edificios, por lo general de gran tamaño, que albergan servicios, locales y oficinas comerciales aglutinados en un espacio determinado concentrando mayor cantidad de clientes potenciales dentro del recinto, sometido a régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Centros Comerciales en PH"\r\n        Centros_Comerciales_en_PH,\r\n        /** Es la edificación o  Establecimiento que brinda servicios recreativos y tiene capacidad para ciertos juegos de azar\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Clubes - Casinos"\r\n        Clubes_Casinos,\r\n        /** Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Comercio"\r\n        Comercio,\r\n        /** Se denomina a la construcción con características arquitectónicas coloniales,  en el cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Comercio Colonial"\r\n        Comercio_Colonial,\r\n        /** Se denomina a la construcción en la cual se lleva a acabo una actividad socioeconómica que consiste en el intercambio de algunos materiales en el mercado de compra y venta de bienes sometida a régimen de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Comercio en PH"\r\n        Comercio_en_PH,\r\n        /** Establecimiento que ocupa un edificio total o parcialmente con uso exclusivo de sus servicios (entradas, ascensores, escaleras, etc.) y que ofrece alojamiento y posee características arquitectónicas coloniales.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Hotel Colonial"\r\n        Hotel_Colonial,\r\n        /** Establecimiento que ocupa un edificio total o parcialmente con uso exclusivo de sus servicios (entradas, ascensores, escaleras, etc.) y que ofrece alojamiento\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Hoteles"\r\n        Hoteles,\r\n        /** Establecimiento que ocupa un edificio total o parcialmente que ofrece alojamiento\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Hoteles en PH"\r\n        Hoteles_en_PH,\r\n        /** Espacio construido en el que se  realiza un trabajo profesional de gestión, administración o atención médica\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Oficinas - Consultorios"\r\n        Oficinas_Consultorios,\r\n        /** Espacio construido con características arquitectónicas coloniales en el que se  realiza un trabajo profesional de gestión, administración o atención médica\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Oficinas - Consultorios Coloniales"\r\n        Oficinas_Consultorios_Coloniales,\r\n        /** espacio construido en el que se  realiza un trabajo profesional de gestión, administración o atención médica, sometida a régimen de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Oficinas Consultorios en PH"\r\n        Oficinas_Consultorios_en_PH,\r\n        /** Construcciones dedicadas al esparcimiento y a la diversión, generalmente son predios con grandes espacios, ejemplo parque el salitre.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Parque de diversiones"\r\n        Parque_Diversiones,\r\n        /** Es el espacio que con ánimo de lucro se destina a guardar o arrendar espacios para depositar vehículos dentro de una edificación construida para tal fin, o dentro de un predio habilitado con el mismo objeto.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Parqueaderos"\r\n        Parqueaderos,\r\n        /** Es el espacio o se destina a guardar o arrendar espacios para depositar vehículos dentro de una edificación construida privado o comunal bajo régimen de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Parqueaderos en PH"\r\n        Parqueaderos_en_PH,\r\n        /** Vivienda que proporciona alojamiento y hospedaje temporal\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Pensiones y Residencias"\r\n        Pensiones_y_Residencias,\r\n        /** Edificaciones tipo bodega destinadas a la prestacion de un servicio público, como es la oferta de productos básicos, principalmente de origen agropecuario y consumo doméstico\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Plaza de mercado"\r\n        Plaza_Mercado,\r\n        /** Establecimiento con características arquitectónicas coloniales en el que se preparan y sirven comidas.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Restaurante Colonial"\r\n        Restaurante_Colonial,\r\n        /** Establecimiento en el que se preparan y sirven comidas.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Restaurantes"\r\n        Restaurantes,\r\n        /** Establecimiento en el que se preparan y sirven comidas sometido a régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Restaurantes en PH"\r\n        Restaurantes_en_PH,\r\n        /** Edificación destinada a la proyección de películas cinematográfica o la presentación de obras artísticas actorales o musicales.\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Teatro - Cinemas"\r\n        Teatro_Cinemas,\r\n        /** Establecimiento destinado a la proyección de películas cinematográficas sometida o la presentación de obras artísticas actores o musicales en un predio sometido en régimen de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Comercial) Teatro - Cinemas en PH"\r\n        Teatro_Cinemas_en_PH\r\n      ),\r\n      !!@ ili2db.dispName = "Industrial"\r\n      Industrial(\r\n        /** Infraestructura de bombeo.\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Bodega Casa Bomba"\r\n        Bodega_Casa_Bomba,\r\n        /** Infraestructura de bombeo de bodegas sometidas a régimen de propiedad horizontal.\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Bodegas Casa Bomba en PH"\r\n        Bodegas_Casa_Bomba_en_PH,\r\n        /** Conjunto de instalaciones dedicadas a esta actividad de transformar las materias primas en productos elaborados\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Industrias"\r\n        Industrias,\r\n        /** Conjunto de instalaciones sometidas a régimen de propiedad horizontal dedicadas a la actividad de transformar las materias primas en productos elaborados\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Industrias en PH"\r\n        Industrias_en_PH,\r\n        /** Es el espacio construido en el que se realiza un trabajo, manual en su origen, bien de tipo artesanal o fabril.\r\n         */\r\n        !!@ ili2db.dispName = "(Industrial) Talleres"\r\n        Talleres\r\n      ),\r\n      !!@ ili2db.dispName = "Institucional"\r\n      Institucional(\r\n        /** Es un salón de un edificio que se destina a actividades de enseñanza, y es la unidad básica de todo recinto destinado a la educación.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Aula de clases"\r\n        Aulas_de_Clases,\r\n        /** Edificación donde podemos encontrar libros o cualquier otro soporte de un texto, como publicaciones, revistas, documentos, catálogo entre otros.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Biblioteca"\r\n        Biblioteca,\r\n        /** Son instalaciones en las que se encarcela a los prisioneros, se encuentran bajo la autoridad del estado.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Cárceles"\r\n        Carceles,\r\n        /** Lugar sin altar (diferente a iglesias y capillas) que congrega a un determinado número de personas para actividades de culto asociadas con manifestaciones religiosas.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Casas de culto"\r\n        Casas_de_Culto,\r\n        /** Establecimiento construido y destinado a proporcionar todo tipo de asistencia médica, incluidas operaciones quirúrgicas y estancia durante la recuperación o tratamiento, y en el que también se practican la investigación y la enseñanza médica\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Clinicas, hospitales, centros médicos"\r\n        Clinicas_Hospitales_Centros_Medicos,\r\n        /** Institución edificada destinada a la enseñanza primaria, secundaria y universitaria\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Colegios y universidades"\r\n        Colegio_y_Universidades,\r\n        /** Teatro o edificio destinado a espectáculos con capacidad para un gran número de personas.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Coliseos"\r\n        Coliseos,\r\n        /** Institución edificada construcción con características arquitectónicas coloniales destinada a la enseñanza primaria\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Entidad educativa colonial colegio colonial"\r\n        Entidad_Educativa_Colonial_Colegio_Colonial,\r\n        /** Un estadio es una construcción cerrada con graderías para los espectadores, destinado a competiciones deportivas. Puede ser al aire libre o cubierto.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Estadios"\r\n        Estadios,\r\n        /** Lugar construido  fuerte, cercado de murallas, baluartes, fosos y otras fortificaciones.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Fuertes y Castillos"\r\n        Fuertes_y_Castillos,\r\n        /** Edificación en la que se reúnen y consagran a los fieles que le rinden culto a un ser superior\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Iglesia"\r\n        Iglesia,\r\n        /** Edificación en la que se reúnen y consagran a los fieles que le rinden culto a un ser superior sometido a régimen de propiedad horizontal\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Iglesia en PH"\r\n        Iglesia_en_PH,\r\n        /** Construcciones adaptadas o utilizadas por los organismos de seguridad de una nación para acuartelar a las tropas y sus equipos. Estas son organizadas de una forma tal que les facilite cumplir con la rutina diaria de los cuerpos militares, desde dormitorios, patios de ejercicios, estacionamientos para los vehículos, parques, comedores, oficinas y son fortificadas a fin de presentar resistencia al momento de un posible ataque externo.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Instalaciones militares"\r\n        Instalaciones_Militares,\r\n        /** Construcción con características de una vivienda que se encarga de brindar educación y asistencia integral a los niños\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Jardín infantil en casa"\r\n        Jardin_Infantil_en_Casa,\r\n        /** Es un terreno que está destinado a árboles, jardines y prados donde se depositan los restos mortales o cadáveres.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Parque Cementerio"\r\n        Parque_Cementerio,\r\n        /** Centro cultural donde se realizan presentaciones astronómicas al público en general.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Planetario"\r\n        Planetario,\r\n        /** Son recintos cerrados, generalmente circulares y descubiertos, donde se celebran las corridas de toros.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Plaza de toros"\r\n        Plaza_de_Toros,\r\n        /** Edificio donde se atiende a la población en un primer nivel asistencial sanitario.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Puestos de salud"\r\n        Puestos_de_Salud,\r\n        /** Construcciones, oficiales o privadas, destinadas a salvaguardar obras de arte, reliquias o antigüedades de carácter histórico, religioso o científico, que representan un periodo, una época de la humanidad o del país.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Museos"\r\n        Museos,\r\n        /** Edificación donde habitan congregaciones religiosas de distintas órdenes menticantes en el itinerario de formación o consagración religiosa.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Seminarios, conventos"\r\n        Seminarios_Conventos,\r\n        /** Edificio o sala destinados a la representación de obras de teatro o de otro tipo de espectáculos, que dispone de un escenario y gradas o asientos para el público, se caracterizan por sus condiciones arquitectónicas\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Teatro"\r\n        Teatro,\r\n        /** Escenario deportivo destinado a la práctica de distintas disciplinas deportivas.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Unidad deportiva"\r\n        Unidad_Deportiva,\r\n        /** Instalación deportiva donde se desarrollan carreras ciclistas o de patinaje.\r\n         */\r\n        !!@ ili2db.dispName = "(Institucional) Velódromo, patinódromo"\r\n        Velodromo_Patinodromo\r\n      ),\r\n      !!@ ili2db.dispName = "Anexo"\r\n      Anexo(\r\n        /** Depósito de agua construido a nivel del terreno con el propósito de almacenar agua, o en el caso de las bañadera con el fin de hacer limpieza al ganado, estas construcciones son cubiertas para guardar de la intemperie.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Albercas - Banaderas"\r\n        Albercas_Banaderas,\r\n        /** Nombre dado en zonas cafeteras a aquellas construcciones donde realizan el beneficio del café. Consiste en áreas cubiertas dentro de las cuales se encuentran los elementos destinados a la labor de seleccionar, lavar y despulpar el grano y su posterior empaque\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Beneficiaderos"\r\n        Beneficiaderos,\r\n        /** Construcción para el desarrollo de proyectos acuícolas del cultivo de camarones.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Camaroneras"\r\n        Camaroneras,\r\n        /** Superficie de terreno adecuada sobre un placa para la practica de deportes como fútbol de salón, voleibol, balocento u alguna otra disciplina que haga uso de la cancha, todo ello a pequeña escala. Se excluyen las canchas de tenis, los estadios, coliseo u otras edificaciones de gran tamaño.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Canchas"\r\n        Canchas,\r\n        /** Superficie  terreno rectangular cruzada al medio por una red baja.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Canchas de Tenis"\r\n        Canchas_de_Tenis,\r\n        /** Es una vía de transporte de dominio y uso público, proyectada y construida fundamentalmente para la circulación de vehículos automóviles\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Carretera"\r\n        Carretera,\r\n        /** Cada una de las superficies de un edificio que disponen de una cara al interior y de otra al exterior.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Cerramiento"\r\n        Cerramiento,\r\n        /** Construcción anexa conformada por unos cimientos, muros y placa base\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Cimientos, Estructura, Muros y Placa Base"\r\n        Cimientos_Estructura_Muros_y_Placa_Base,\r\n        /** Construcciòn destinada a la cría y albergue de cerdos. Se utiliza cualesquiera de los tres nombres enunciados según la región donde se ubique; los elementos que la conforman son: estructura, muros y pisos.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Cocheras - Marraneras - Porquerizas"\r\n        Cocheras_Marraneras_Porquerizas,\r\n        /** Tenso estructuras, arquitectura textil, o membranas arquitectónicas, son los nombres con los que se le conoce a los tipos de estructura que emplean materiales que trabajan bajo tensión, sean membranas textiles, láminas, mallas de cables, etc.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Construccion en membrana arquitectónica"\r\n        Construccion_en_Membrana_Arquitectonica,\r\n        /** Un contenedor es un recipiente de carga para el transporte marítimo o fluvial, transporte terrestre y transporte multimodal adecuado para la vivienda o el comercio o servicios.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Contenedor"\r\n        Contenedor,\r\n        /** Sitio cerrado y descubierto que se utiliza par la cría y albergue de ganado generalmente vacuno. consta de los elementos estructura  y pisos.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Corrales"\r\n        Corrales,\r\n        /** Lugar cubierto donde se encierra ganado o caballos y/o se realizan actividades propias de su explotación, constituidos por estructura, cubierta, muros y pisos.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Establos - Pesebreras - Caballerizas"\r\n        Establos_Pesebreras_Caballerizas,\r\n        /** Son obras arquitectónicas  que se construyen con el objeto de elevar el nivel del agua de la fuente de riego a los sitios donde se desea utilizar.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Estacion de Bombeo"\r\n        Estacion_Bombeo,\r\n        /** Instalación que permite el tránsito de personas y la conexión con sistemas de transporte como buses, metro, tren, tranvía, terminales y estaciones, destinadas para la movilidad de las personas.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Estación de sistema de transporte"\r\n        Estacion_Sistema_Transporte,\r\n        /** Unidad construida con destino a la cría y/o protección de aves principalmente para explotación avícola.  Conformada por estructura cubierta pisos y muros que son parcialmente elaborados en ladrillo y el resto descubierto o con algún material provisional (plásticos, alambres, etc.).\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Galpones - Gallineros"\r\n        Galpones_Gallineros,\r\n        /** Espacio destinado para el almacenamiento y disposición de aeronaves.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Hangar"\r\n        Hangar,\r\n        /** Construcción consistente en una cubierta apoyada en columnas de materiales diferentes, elaborados con el fin de guarecer de la intemperie.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Kioscos"\r\n        Kioscos,\r\n        /** Son depósitos construidos mediante la excavación y compactación de la tierra que almacenan agua de cualquier calidad por un periodo determinado\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Lagunas de Oxidación"\r\n        Lagunas_de_Oxidacion,\r\n        /** Cobertizo dentro de una edificación de mayor extensión o patio cubierto, clasificados según su estructura, pisos y el material de la cubierta.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Marquesinas - Patios Cubiertos"\r\n        Marquesinas_Patios_Cubiertos,\r\n        /** Deberán diferenciarse de acuerdo a su estructura, longitud, capacidad, usos turísticos o de carga\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Muelles"\r\n        Muelles,\r\n        /** Se denomina muralla a un muro cerrado destinado a la protección y defensa de determinado sitio.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Murallas"\r\n        Murallas,\r\n        /** Las pérgolas son estructuras compuestas por columnas y una armazón superior, cubiertas con mucho follaje o toldo especial que protegen de la lluvia y el sol, también usadas como elemento decorativo en un espacio de las viviendas.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Pérgolas"\r\n        Pergolas,\r\n        /** Estanque artificial con destino al deporte o a la recreación.  Se diferencia por sus acabados y especificaciones técnicas para su mantenimiento y operación; sus dimensiones deben darse en unidades de área (m2).\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Piscinas"\r\n        Piscinas,\r\n        /** Edificación sin cubierta con que se identifican las pistas de los aeropuertos construidas en asfalto o concreto, incluye la zona o calle de redaje y calles de salida rápida.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Pista aeropuerto"\r\n        Pista_Aeropuerto,\r\n        /** Perforaciones profundas  manuales para extraer agua subterránea.  Medida en metros de profundidad.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Pozos"\r\n        Pozos,\r\n        /** Consiste en un sitio cubierto elaborado con el fin de resguardar de la intemperie; el nombre de enramadas, cobertizos o caney se utiliza según la forma de la cubierta y la región donde se ubique.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Ramadas - Cobertizos - Caneyes"\r\n        Ramadas_Cobertizos_Caneyes,\r\n        /** Construcciones elaboradas con el objeto de secar en condiciones naturales el café principalmente, aunque es común su uso en otros productos.  Consta de estructura y pisos para su calificación\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Secaderos"\r\n        Secaderos,\r\n        /** Construcción de grandes dimensiones que sirve para almacén o depósito, se exceptúan los silos cafeteros\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Silos"\r\n        Silos,\r\n        /** Depósitos subterráneos o de altura, construidos en zonas con deficiencias en abastecimiento para el consumo de los habitantes o para el uso agrícola.  El elemento a calificar es la estructura relacionada con la capacidad de almacenamiento medida en metros cúbicos.\r\n         *  \r\n         * Se excluyen de este tipo de construcción los tanques de almacenamiento domiciliario\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Tanques"\r\n        Tanques,\r\n        /** Deslizadores construidos alrededor de piscinas, medidos en metros lineales.  Se clasifican según su altura y materiales de construcción\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Toboganes"\r\n        Toboganes,\r\n        /** Edificio en forma de torre, en cuya cima se sitúa una sala de control, desde la que se dirige y controla el tráfico de un puerto, de un aeropuerto o de un circuito de carreras.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Torre de control"\r\n        Torre_de_Control,\r\n        /** Son estructuras diseñadas para disminuir la temperatura del agua y otros medios.\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Torres de Enfriamiento"\r\n        Torres_de_Enfriamiento,\r\n        /** Se le asigna a las unidades prediales no edificadas o por construir\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Unidad predial por construir"\r\n        Unidad_Predial_por_Construir,\r\n        /** Parte de la infraestructura ferroviaria que une dos puntos determinados del territorio\r\n         */\r\n        !!@ ili2db.dispName = "(Anexo) Vía Férrea"\r\n        Via_Ferrea\r\n      )\r\n    );\r\n\r\n    LC_ViaTipo = (\r\n      /** Vía de un sistema vial urbano con prelación de circulación de tránsito sobre las demás vías, con excepción de la vía férrea y la autopista\r\n       */\r\n      !!@ ili2db.dispName = "Arteria"\r\n      Arteria,\r\n      /** vía de calzadas separadas, cada una con dos (2) o más carriles, control total de acceso y salida, con intersecciones en desnivel o mediante entradas y salidas directas a otras carreteras y con control de velocidades mínimas y máximas por carril.\r\n       */\r\n      !!@ ili2db.dispName = "Autopista"\r\n      Autopista,\r\n      /** Vía cuya finalidad es permitir la circulación de vehículos, con niveles adecuados de seguridad y comodidad.\r\n       */\r\n      !!@ ili2db.dispName = "Carreteable"\r\n      Carreteable,\r\n      /** vía o sección de la calzada destinada al tránsito de bicicletas en forma exclusiva.\r\n       */\r\n      !!@ ili2db.dispName = "Ciclorruta"\r\n      Cicloruta,\r\n      /** Tramo de carretera que se introduce paralelamente a la carretera principal en la zona de un enlace o entre enlaces consecutivos.\r\n       */\r\n      !!@ ili2db.dispName = "Colectora"\r\n      Colectora,\r\n      /** Son aquellas a cargo de los departamentos\r\n       */\r\n      !!@ ili2db.dispName = "Departamental"\r\n      Departamental,\r\n      /** Diseñada para el transito de vehículos sobre rieles, con prelación sobre las demás vías, excepto para las ciudades donde existe metro, en cuyos casos será este el que tenga prelación.\r\n       */\r\n      !!@ ili2db.dispName = "Férrea"\r\n      Ferrea,\r\n      /** Conforman el sistema vial urbano menor y se conectan solamente con las vías colectoras\r\n       */\r\n      !!@ ili2db.dispName = "Local"\r\n      Local,\r\n      /** Es aquella de exclusiva destinación para las líneas de metro, independientemente de su configuración y que hacen parte integral de su infraestructura de operación.\r\n       */\r\n      !!@ ili2db.dispName = "Metro o metrovía"\r\n      Metro_o_Metrovia,\r\n      /** Aquellas vías cuyo mantenimiento corresponde al gobierno nacional.\r\n       */\r\n      !!@ ili2db.dispName = "Nacional"\r\n      Nacional,\r\n      /** La que tiene tránsito subordinado a las vías principales.\r\n       */\r\n      !!@ ili2db.dispName = "Ordinaria"\r\n      Ordinaria,\r\n      /** Zonas destinadas para el transito exclusivo de peatones.\r\n       */\r\n      !!@ ili2db.dispName = "Peatonal"\r\n      Peatonal,\r\n      /** Son aquellas troncales, transversales y accesos a capitales de Departamento que cumplen la función básica de integración de las principales zonas de producción y consumo del país y de éste con los demás países.\r\n       */\r\n      !!@ ili2db.dispName = "Principal"\r\n      Principal,\r\n      /** Via que está destinada al uso particular.\r\n       */\r\n      !!@ ili2db.dispName = "Privada"\r\n      Privada,\r\n      /** Son aquellas vías que unen las cabeceras municipales entre sí y/o que provienen de una cabecera municipal y conectan con una carretera Primaria.\r\n       */\r\n      !!@ ili2db.dispName = "Secundaria"\r\n      Secundaria,\r\n      /** Vía de dos (2) calzadas con ocho o más carriles y con destinación exclusiva de las calzadas interiores para el tránsito de servicio público masivo.\r\n       */\r\n      !!@ ili2db.dispName = "Troncal"\r\n      Troncal\r\n    );\r\n\r\n  TOPIC Levantamiento_Catastral\r\n  EXTENDS LADM_COL_V3_0.LADM_Nucleo =\r\n    OID AS INTERLIS.UUIDOID;\r\n    DEPENDS ON LADM_COL_V3_0.LADM_Nucleo,Submodelo_Integracion_Insumos_V1_0.Datos_Integracion_Insumos;\r\n\r\n    /** Clase que hereda los atributos de la  Clase COL_Agrupación_Interesados.\r\n     */\r\n    !!@ ili2db.dispName = "Agrupación de Interesados"\r\n    CLASS LC_AgrupacionInteresados\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_AgrupacionInteresados =\r\n    END LC_AgrupacionInteresados;\r\n\r\n    /** Clase para determinar el tipo de calificación para las unidades de construcción, permite 3 opciones: a) calificación por tipologias constructivas, b)calificación total de la ficha de calificación de construcción y c) calificación parcial de la ficha de calificación de construcción como lo puede ser fachada y estructura.\r\n     */\r\n    CLASS LC_CalificacionUnidadConstruccion (ABSTRACT) =\r\n    END LC_CalificacionUnidadConstruccion;\r\n\r\n    /** Es la unión de materiales adheridos al terreno, con carácter de permanente, cualesquiera sean los elementos que la constituyan.\r\n     */\r\n    !!@ ili2db.dispName = "Construcción"\r\n    CLASS LC_Construccion\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\r\n      /** Identificado de la unidad de construcción, su codificación puede ser por letras del abecedario.\r\n       */\r\n      !!@ ili2db.dispName = "Identificador"\r\n      Identificador : MANDATORY TEXT*2;\r\n      /** Indica si la construcción es de tipo convencional o no convencional.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de construcción"\r\n      Tipo_Construccion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ConstruccionTipo;\r\n      /** Indica el tipo de dominio de la unidad de construcción: común y privado.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de dominio"\r\n      Tipo_Dominio : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DominioConstruccionTipo;\r\n      /** Número total de pisos de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de pisos"\r\n      Numero_Pisos : MANDATORY 0 .. 300;\r\n      /** Número total de sótanos de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de sótanos"\r\n      Numero_Sotanos : 0 .. 99;\r\n      /** Número total de mezanines de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de mezanines"\r\n      Numero_Mezanines : 0 .. 99;\r\n      /** Número total de semisótanos de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Número de semisótanos"\r\n      Numero_Semisotanos : 0 .. 99;\r\n      /** Año de edificación de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Año de la construcción"\r\n      Anio_Construccion : 1550 .. 2500;\r\n      /** Avalúo total catastral de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Ávaluo de construcción"\r\n      Avaluo_Construccion : LADM_COL_V3_0.LADM_Nucleo.Peso;\r\n      /** Área total construida.\r\n       */\r\n      !!@ ili2db.dispName = "Área de construcción"\r\n      Area_Construccion : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\r\n      /** Altura total de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Altura"\r\n      Altura : 1 .. 1000 [INTERLIS.m];\r\n      /** Observaciones generales de la construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Observaciones"\r\n      Observaciones : TEXT;\r\n    END LC_Construccion;\r\n\r\n    !!@ ili2db.dispName = "Contacto Visita"\r\n    CLASS LC_ContactoVisita =\r\n      /** Indica el tipo de documento de la persona que atendió la visita predial.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de documento de quien atendió la visita predial"\r\n      Tipo_Documento_Quien_Atendio : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoDocumentoTipo;\r\n      /** Indica el número de documento de la persona que atendió la visita predial.\r\n       */\r\n      !!@ ili2db.dispName = "Numero de documento de quien atendió la visita predial"\r\n      Numero_Documento_Quien_Atendio : MANDATORY TEXT*50;\r\n      /** Primer nombre de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Primer nombre de quien atendió"\r\n      Primer_Nombre_Quien_Atendio : MANDATORY TEXT*100;\r\n      /** Segundo nombre de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo nombre de quien atendió"\r\n      Segundo_Nombre_Quien_Atendio : TEXT*100;\r\n      /** Primer apellido de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Primer apellido de quien atendió"\r\n      Primer_Apellido_Quien_Atendio : MANDATORY TEXT*100;\r\n      /** Segundo apellido de la persona encargada de atender la visita de ejecución de actividades catastrales sobre el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo apellido de quien atendió"\r\n      Segundo_Apellido_Quien_Atendio : TEXT*100;\r\n      /** Relación con el predio de la persona encargada de atender la visita, por ejemplo propietario, encargado, administrador, poseedor, etc.\r\n       */\r\n      !!@ ili2db.dispName = "Relación con el predio"\r\n      Relacion_Con_Predio : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RelacionPredioTipo;\r\n      /** Dirección de domicilio para notificaciones.\r\n       */\r\n      !!@ ili2db.dispName = "Domicilio notificaciones"\r\n      Domicilio_Notificaciones : TEXT*255;\r\n      /** Número de celular de la persona que atendió la visita de actividades catastrales.\r\n       */\r\n      !!@ ili2db.dispName = "Celular"\r\n      Celular : TEXT*20;\r\n      /** Correo electrónico de la persona que atendió la visita de actividades catastrales.\r\n       */\r\n      !!@ ili2db.dispName = "Correo electrónico"\r\n      Correo_Electronico : TEXT*100;\r\n      /** Indica si autoriza las notificaciones administrativas por medio de vía electrónica.\r\n       */\r\n      !!@ ili2db.dispName = "Autoriza notificaciones"\r\n      Autoriza_Notificaciones : BOOLEAN;\r\n    END LC_ContactoVisita;\r\n\r\n    /** Clase que contiene los datos principales del predio matriz sometido al regimen de propiedad horizontal.\r\n     */\r\n    !!@ ili2db.dispName = "Datos PH Condominio"\r\n    CLASS LC_DatosPHCondominio =\r\n      /** Área total del terreno del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total de terreno"\r\n      Area_Total_Terreno : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total privada del terreno del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total de terreno privada"\r\n      Area_Total_Terreno_Privada : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total de terreno común del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total de terreno común"\r\n      Area_Total_Terreno_Comun : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total de construida del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total construida"\r\n      Area_Total_Construida : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total construida privada del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total construida privada"\r\n      Area_Total_Construida_Privada : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Área total construida común del PH o Condominio Matriz.\r\n       */\r\n      !!@ ili2db.dispName = "Área total construida común"\r\n      Area_Total_Construida_Comun : 0.00 .. 99999999999999.98 [LADM_COL_V3_0.m2];\r\n      /** Número de torres en el PH o Condominio.\r\n       */\r\n      !!@ ili2db.dispName = "Número de torres"\r\n      Numero_Torres : 0 .. 1000;\r\n      /** Total de unidades privadas en el PH o Condominio.\r\n       */\r\n      !!@ ili2db.dispName = "Total de unidades privadas"\r\n      Total_Unidades_Privadas : 0 .. 99999999;\r\n    END LC_DatosPHCondominio;\r\n\r\n    /** Clase que registra las instancias de los derechos que un interesado ejerce sobre un predio. Es una especialización de la clase COL_DRR del propio modelo.\r\n     */\r\n    !!@ ili2db.dispName = "Derecho"\r\n    CLASS LC_Derecho\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_DRR =\r\n      /** Derecho que se ejerce.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo"\r\n      Tipo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DerechoTipo;\r\n      /** Indica la fracción del derecho en relación a la forma de tenencia y el área que esta ocupa dentro de la extensión del predio. Ejemplo: un predio informal que se encuentra sobre un predio baldío y un predio privado tendrá un porcentaje de derecho de ocupación y posesión expresado en tanto por uno (0.0000000000 a 1.0000000000).\r\n       */\r\n      !!@ ili2db.dispName = "Fracción de derecho"\r\n      Fraccion_Derecho : MANDATORY 0.0000000000 .. 1.0000000000;\r\n      /** Fecha de inicio de tenencia del interesado con respecto al predio.\r\n       */\r\n      !!@ ili2db.dispName = "Fecha de inicio de tenencia"\r\n      Fecha_Inicio_Tenencia : INTERLIS.XMLDate;\r\n    END LC_Derecho;\r\n\r\n    !!@ ili2db.dispName = "(LC) Estructura Novedad FMI"\r\n    STRUCTURE LC_EstructuraNovedadFMI =\r\n      !!@ ili2db.dispName = "Código ORIP"\r\n      Codigo_ORIP : TEXT*3;\r\n      !!@ ili2db.dispName = "Número FMI"\r\n      Numero_FMI : TEXT*80;\r\n    END LC_EstructuraNovedadFMI;\r\n\r\n    !!@ ili2db.dispName = "(LC) Estructura Novedad Número Predial"\r\n    STRUCTURE LC_EstructuraNovedadNumeroPredial =\r\n      !!@ ili2db.dispName = "Número predial"\r\n      Numero_Predial : MANDATORY TEXT*30;\r\n      !!@ ili2db.dispName = "Tipo de novedad"\r\n      Tipo_Novedad : (\r\n        !!@ ili2db.dispName = "Predio nuevo"\r\n        Predio_Nuevo,\r\n        !!@ ili2db.dispName = "Desenglobe"\r\n        Desenglobe,\r\n        !!@ ili2db.dispName = "Englobe"\r\n        Englobe,\r\n        !!@ ili2db.dispName = "Cancelación"\r\n        Cancelacion,\r\n        !!@ ili2db.dispName = "Cambio de número predial"\r\n        Cambio_Numero_Predial,\r\n        !!@ ili2db.dispName = "Ninguna"\r\n        Ninguna\r\n      );\r\n    END LC_EstructuraNovedadNumeroPredial;\r\n\r\n    /** Clase que almacena las fuentes administrativas (escrituras, sentencias, actos administrativos, etc) que sustentan el Derecho respecto de la relación de tenencia entre el Interesado y el predio.\r\n     */\r\n    !!@ ili2db.dispName = "Fuente Administrativa"\r\n    CLASS LC_FuenteAdministrativa\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_FuenteAdministrativa =\r\n      /** Tipo de documento que soporta la relación de tenencia entre el interesado con el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo"\r\n      Tipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_FuenteAdministrativaTipo;\r\n      /** Es tipo de oficina que emite el documento (notaria, juzgado)\r\n       */\r\n      !!@ ili2db.dispName = "Ente emisor"\r\n      Ente_Emisor : TEXT*255;\r\n    END LC_FuenteAdministrativa;\r\n\r\n    /** Clase que hereda los atributos de la  Clase COL_FuenteEspacial.\r\n     */\r\n    !!@ ili2db.dispName = "Fuente Espacial"\r\n    CLASS LC_FuenteEspacial\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_FuenteEspacial =\r\n    END LC_FuenteEspacial;\r\n\r\n    /** Calificación de la construccion según los item determinados para calificar.\r\n     */\r\n    !!@ ili2db.dispName = "Grupo Calificación"\r\n    CLASS LC_GrupoCalificacion =\r\n      /** Indica los elementos generales de la calificación de la construcción de acuerdo al método vigente.\r\n       */\r\n      !!@ ili2db.dispName = "Clase de calificación"\r\n      Clase_Calificacion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ClaseCalificacionTipo;\r\n      /** Estado de conservación del grupo calificado.\r\n       */\r\n      !!@ ili2db.dispName = "Conservación"\r\n      Conservacion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_EstadoConservacionTipo;\r\n      /** Subtotal del grupo calificado.\r\n       */\r\n      !!@ ili2db.dispName = "Subtotal"\r\n      Subtotal : MANDATORY 0 .. 9999999;\r\n    END LC_GrupoCalificacion;\r\n\r\n    /** Es la parte que tiene una relación con el predio por algún tipo de derecho, restricción, publicidad o responsabilidad\r\n     */\r\n    !!@ ili2db.dispName = "Interesado"\r\n    CLASS LC_Interesado\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Interesado =\r\n      /** Tipo de persona del que se trata\r\n       */\r\n      !!@ ili2db.dispName = "Tipo"\r\n      Tipo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoTipo;\r\n      /** Tipo de documento del que se trata.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de documento"\r\n      Tipo_Documento : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoDocumentoTipo;\r\n      /** Documento de identidad del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Documento de identidad"\r\n      Documento_Identidad : MANDATORY TEXT*50;\r\n      /** Primer nombre de la persona física.\r\n       */\r\n      !!@ ili2db.dispName = "Primer nombre"\r\n      Primer_Nombre : TEXT*100;\r\n      /** Segundo nombre de la persona física.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo nombre"\r\n      Segundo_Nombre : TEXT*100;\r\n      /** Primer apellido de la persona física.\r\n       */\r\n      !!@ ili2db.dispName = "Primer apellido"\r\n      Primer_Apellido : TEXT*100;\r\n      /** Segundo apellido de la persona física.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo apellido"\r\n      Segundo_Apellido : TEXT*100;\r\n      /** Condición orgánica que distingue a los machos de las hembras.\r\n       */\r\n      !!@ ili2db.dispName = "Sexo"\r\n      Sexo : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_SexoTipo;\r\n      !!@ ili2db.dispName = "Grupo étnico"\r\n      Grupo_Etnico : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_GrupoEtnicoTipo;\r\n      /** Nombre con el que está inscrito.\r\n       */\r\n      !!@ ili2db.dispName = "Razón social"\r\n      Razon_Social : TEXT*255;\r\n    END LC_Interesado;\r\n\r\n    /** Datos de contacto de la parte interesada.\r\n     */\r\n    !!@ ili2db.dispName = "Interesado Contacto"\r\n    CLASS LC_InteresadoContacto =\r\n      /** Numero de telefono de contacto del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Teléfono 1"\r\n      Telefono1 : TEXT*20;\r\n      /** Numero de telefono de contacto del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Teléfono 2"\r\n      Telefono2 : TEXT*20;\r\n      /** Domicilio para notificaciones del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Domicilio notificación"\r\n      Domicilio_Notificacion : TEXT*500;\r\n      /** Dirección de residencia del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Dirección de residencia"\r\n      Direccion_Residencia : TEXT*500;\r\n      /** Correo electrónico del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Correo electrónico"\r\n      Correo_Electronico : TEXT*100;\r\n      /** Indica si el interesado autoriza notificación vía correo electrónico\r\n       */\r\n      !!@ ili2db.dispName = "Autoriza notificación correo"\r\n      Autoriza_Notificacion_Correo : BOOLEAN;\r\n      /** Departamento de residencia del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Departamento"\r\n      Departamento : MANDATORY TEXT*100;\r\n      /** Municipio de residencia del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Municipio"\r\n      Municipio : MANDATORY TEXT*100;\r\n      /** Vereda de residencia del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Vereda"\r\n      Vereda : TEXT*100;\r\n      /** Corregimiento de residencia del interesado.\r\n       */\r\n      !!@ ili2db.dispName = "Corregimiento"\r\n      Corregimiento : TEXT*100;\r\n    END LC_InteresadoContacto;\r\n\r\n    /** Linea de división que separa un bien inmueble de otro, que puede o no estar materializada físicamente.\r\n     */\r\n    !!@ ili2db.dispName = "Lindero"\r\n    CLASS LC_Lindero\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_CadenaCarasLimite =\r\n      /** Longitud en metros del lindero.\r\n       */\r\n      !!@ ili2db.dispName = "Longitud"\r\n      Longitud : MANDATORY 0.0 .. 10000.0 [INTERLIS.m];\r\n    END LC_Lindero;\r\n\r\n    /** Puntaje de cada item de la calificación de construcción.\r\n     */\r\n    !!@ ili2db.dispName = "Objeto Construcción"\r\n    CLASS LC_ObjetoConstruccion =\r\n      /** Item de la calificación de construcción según la método de calificación vigente.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de objeto de construcción"\r\n      Tipo_Objeto_Construccion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ObjetoConstruccionTipo;\r\n      /** Puntaje del ítem calificado.\r\n       */\r\n      !!@ ili2db.dispName = "Puntos"\r\n      Puntos : MANDATORY 0 .. 16;\r\n    END LC_ObjetoConstruccion;\r\n\r\n    !!@ ili2db.dispName = "Ofertas mercado inmobiliario"\r\n    CLASS LC_OfertasMercadoInmobiliario =\r\n      /** La clase de oferta corresponde a una oferta de venta o a una oferta de arriendo del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de oferta"\r\n      Tipo_Oferta : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_OfertaTipo;\r\n      /** Dato del valor en pesos de la oferta\r\n       */\r\n      !!@ ili2db.dispName = "Valor pedido"\r\n      Valor_Pedido : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Peso;\r\n      /** Dato del valor en pesos negociado entre el vendedor y el posible comprador\r\n       */\r\n      !!@ ili2db.dispName = "Valor negociado"\r\n      Valor_Negociado : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Peso;\r\n      /** Año, mes y día de captura de la oferta en campo.\r\n       */\r\n      !!@ ili2db.dispName = "Fecha de captura de la oferta"\r\n      Fecha_Captura_Oferta : MANDATORY INTERLIS.XMLDate;\r\n      /** Número de meses de la publicitación de la oferta en el mercado inmobiliario.\r\n       */\r\n      !!@ ili2db.dispName = "Tiempo de la oferta en el mercado inmobiliario en meses"\r\n      Tiempo_Oferta_Mercado : 0 .. 1000;\r\n      /** Número de teléfono fijo o número celular de la persona que está publicitando el bien inmueble.\r\n       */\r\n      !!@ ili2db.dispName = "Número de contacto del oferente"\r\n      Numero_Contacto_Oferente : MANDATORY TEXT*20;\r\n      !!@ ili2db.dispName = "Nombre del oferente"\r\n      Nombre_Oferente : MANDATORY TEXT*255;\r\n    END LC_OfertasMercadoInmobiliario;\r\n\r\n    /** Clase especializada de BaUnit, que describe la unidad administrativa básica para el caso de Colombia.\r\n     * El predio es la unidad territorial legal propia de Catastro. Está formada por el terreno y puede o no tener construcciones asociadas.\r\n     */\r\n    !!@ ili2db.dispName = "Predio"\r\n    CLASS LC_Predio\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadAdministrativaBasica =\r\n      /** Corresponde al código del departamento al cual pertenece el predio. Es asignado por DIVIPOLA y tiene 2 dígitos.\r\n       */\r\n      !!@ ili2db.dispName = "Departamento"\r\n      Departamento : MANDATORY TEXT*2;\r\n      /** Corresponde al código del municipio al cual pertenece el predio. Es asignado por DIVIPOLA y tiene 3 dígitos.\r\n       */\r\n      !!@ ili2db.dispName = "Municipio"\r\n      Municipio : MANDATORY TEXT*3;\r\n      /** Identificador único temporal de cada predio que se asigna en el desarrollo del levantamiento catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Identificador único de operación"\r\n      Id_Operacion : MANDATORY TEXT*30;\r\n      /** Indica si el predio tiene matricula inmobiliaria.\r\n       */\r\n      !!@ ili2db.dispName = "Tiene FMI"\r\n      Tiene_FMI : MANDATORY BOOLEAN;\r\n      /** Circulo registral\r\n       */\r\n      !!@ ili2db.dispName = "Código ORIP"\r\n      Codigo_ORIP : TEXT*3;\r\n      /** Matricula inmobiliaria\r\n       */\r\n      !!@ ili2db.dispName = "Matrícula inmobiliaria"\r\n      Matricula_Inmobiliaria : TEXT*80;\r\n      /** Nuevo Código numérico de treinta (30) dígitos, que se le asigna a cada predio y busca localizarlo inequívocamente en los documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustín Codazzi.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial"\r\n      Numero_Predial : TEXT*30;\r\n      /** Anterior código númerico de veinte (20) digitos, que se le asigna a cada predio y busca localizarlo inequívocamente en los documentos catastrales, según el modelo determinado por el Instituto Geográfico Agustin Codazzi.\r\n       */\r\n      !!@ ili2db.dispName = "Número predial anterior"\r\n      Numero_Predial_Anterior : TEXT*20;\r\n      /** Es un código único para identificar los inmuebles tanto en los sistemas de información catastral como registral. El NUPRE no implicará supresión de la numeración catastral ni registral asociada a la cédula catastral ni a la matrícula inmobiliaria actual.\r\n       */\r\n      !!@ ili2db.dispName = "Número único predial"\r\n      NUPRE : TEXT*11;\r\n      /** Valor catastral del predio, obtenido mediante investigación y análisis estadístico del mercado inmobiliario y la metodología de aplicación correspondiente.\r\n       */\r\n      !!@ ili2db.dispName = "Avalúo catastral"\r\n      Avaluo_Catastral : LADM_COL_V3_0.LADM_Nucleo.Peso;\r\n      !!@ ili2db.dispName = "Tipo de predio"\r\n      Tipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PredioTipo;\r\n      /** Caracterización temática del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Condición del predio"\r\n      Condicion_Predio : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_CondicionPredioTipo;\r\n      /** Dirección del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Dirección"\r\n      Direccion : BAG {1..*} OF LADM_COL_V3_0.LADM_Nucleo.ExtDireccion;\r\n      UNIQUE Id_Operacion; \r\n    END LC_Predio;\r\n\r\n    /** Puntos topograficos o geodesicos utilizados como amarre para la ejecución del levantamiento catastral.\r\n     */\r\n    !!@ ili2db.dispName = "Punto Control"\r\n    CLASS LC_PuntoControl\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Punto =\r\n      /** Nombre o código del punto de control.\r\n       */\r\n      !!@ ili2db.dispName = "ID del punto de control"\r\n      ID_Punto_Control : MANDATORY TEXT*255;\r\n      /** Indica la clasificación del tipo de punto de acuerdo a sus características.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de punto"\r\n      PuntoTipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoTipo;\r\n      /** Si se trata de un punto de control o de apoyo.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de punto de control"\r\n      Tipo_Punto_Control : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoControlTipo;\r\n      /** Exactitud horizontal de la medición del punto.\r\n       */\r\n      !!@ ili2db.dispName = "Exactitud horizontal"\r\n      Exactitud_Horizontal : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\r\n      /** Exactitud vertical de la medición del punto.\r\n       */\r\n      !!@ ili2db.dispName = "Exactitud vertical"\r\n      Exactitud_Vertical : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\r\n    END LC_PuntoControl;\r\n\r\n    /** Puntos que definen los lindero de un terreno. La sucesión de estos puntos forman una línea que representa el límite entre dos terrenos.\r\n     */\r\n    !!@ ili2db.dispName = "Punto Lindero"\r\n    CLASS LC_PuntoLindero\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Punto =\r\n      /** Nombre o código del punto lindero\r\n       */\r\n      !!@ ili2db.dispName = "ID del punto de lindero"\r\n      ID_Punto_Lindero : MANDATORY TEXT*255;\r\n      /** Indica la clasificación del tipo de punto de acuerdo a sus características.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de punto"\r\n      PuntoTipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoTipo;\r\n      /** Indica si existe acuerdo o no entre los colindantes en relación al punto lindero que se está midiendo.\r\n       */\r\n      !!@ ili2db.dispName = "Acuerdo"\r\n      Acuerdo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_AcuerdoTipo;\r\n      /** Indica si el punto es fotoidentificable.\r\n       */\r\n      !!@ ili2db.dispName = "Fotoidentificación"\r\n      Fotoidentificacion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_FotoidentificacionTipo;\r\n      /** Corresponde a la exactitud horizontal del punto lindero\r\n       */\r\n      !!@ ili2db.dispName = "Exactitud horizontal"\r\n      Exactitud_Horizontal : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\r\n      /** Corresponde a la exactitud vertical del punto lindero\r\n       */\r\n      !!@ ili2db.dispName = "Exactitud vertical"\r\n      Exactitud_Vertical : 0.000 .. 10.000 [INTERLIS.m];\r\n    END LC_PuntoLindero;\r\n\r\n    /** Restricción legalmente constituida y registrada que afecta el derecho de un persona en relación con el predio.\r\n     */\r\n    !!@ ili2db.dispName = "Restricción"\r\n    CLASS LC_Restriccion\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_DRR =\r\n      /** Tipo de Restricción que afecta el derecho.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo"\r\n      Tipo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_RestriccionTipo;\r\n    END LC_Restriccion;\r\n\r\n    /** Porción de tierra con una extensión geográfica definida.\r\n     */\r\n    !!@ ili2db.dispName = "Terreno"\r\n    CLASS LC_Terreno\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\r\n      /** Área total del terreno  resultante del levantamiento catastral..\r\n       */\r\n      !!@ ili2db.dispName = "Área de terreno"\r\n      Area_Terreno : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\r\n      /** Valor catastral asignado en el proceso de valoración económica masiva al terreno del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Avalúo de terreno"\r\n      Avaluo_Terreno : LADM_COL_V3_0.LADM_Nucleo.Peso;\r\n      /** Corresponde la identificación del número predial hasta la posición 21, permite identificar la relación espacial en sus componentes: departamento, municipio, zona, sector, comuna, barrio, manzana o vereda y terreno de acuerdo a su codificación en el número predial.\r\n       */\r\n      !!@ ili2db.dispName = "Numero predial hasta la posición 21"\r\n      Manzana_Vereda_Codigo : TEXT*21;\r\n      /** Corresponde a la figura geométrica vectorial poligonal, generada a partir de los linderos del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Geometría"\r\n      Geometria (EXTENDED) : MANDATORY ISO19107_PLANAS_V3_0.GM_MultiSurface3D;\r\n    END LC_Terreno;\r\n\r\n    /** Proceso mediante el cual se le asigna un puntaje a las edificaciones de acuerdo a sus características constructivas\r\n     */\r\n    !!@ ili2db.dispName = "Calificación Convencional"\r\n    CLASS LC_CalificacionConvencional\r\n    EXTENDS LC_CalificacionUnidadConstruccion =\r\n      /** Indica si la calificación de construcción corresponde a residencial, comercial o industrial.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo a calificar"\r\n      Tipo_Calificar : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_CalificarTipo;\r\n      /** Puntaje total de la calificación de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total calificación"\r\n      Total_Calificacion : MANDATORY LADM_COL_V3_0.LADM_Nucleo.Integer;\r\n    END LC_CalificacionConvencional;\r\n\r\n    /** Relaciona el tipo de construcción consideradas como anexo para el catastro.\r\n     */\r\n    !!@ ili2db.dispName = "Calificación No Convencional"\r\n    CLASS LC_CalificacionNoConvencional\r\n    EXTENDS LC_CalificacionUnidadConstruccion =\r\n      /** Relaciona el tipo de construcción consideradas como anexo para el catastro.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de anexo"\r\n      Tipo_Anexo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_AnexoTipo;\r\n    END LC_CalificacionNoConvencional;\r\n\r\n    /** Datos de adicionales del predio para catastro multipropósito\r\n     */\r\n    !!@ ili2db.dispName = "Datos adicionales levantamiento catastral"\r\n    CLASS LC_DatosAdicionalesLevantamientoCatastral =\r\n      /** Indica si el predio según la información registral cuenta con el valor de área en la cabida y linderos.\r\n       */\r\n      !!@ ili2db.dispName = "¿El predio tiene área registral?"\r\n      Tiene_Area_Registral : MANDATORY BOOLEAN;\r\n      /** Indica el valor del área registral del predio en metros cuadrados.\r\n       */\r\n      !!@ ili2db.dispName = "Área registral en metros cuadrados"\r\n      Area_Registral_M2 : 0.00 .. 10000000000000000000000.00 [LADM_COL_V3_0.m2];\r\n      /** Se considerará como procedimientos catastrales con efectos registrales los siguientes: actualización de linderos, rectificación de área por imprecisa determinación, actualización masiva y puntual de linderos y áreas, rectificación de linderos por acuerdo entre las partes, e inclusión de área y/o linderos.\r\n       */\r\n      !!@ ili2db.dispName = "Procedimientos catastrales con efectos registrales"\r\n      Procedimiento_Catastral_Registral : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ProcedimientoCatastralRegistralTipo;\r\n      /** Es la clasificación para fines estadísticos que se da a cada inmueble en su conjunto–terreno, construcciones o edificaciones-, en el momento de la identificación predial de conformidad con la actividad predominante que en él se desarrolle.\r\n       */\r\n      !!@ ili2db.dispName = "Destinación económica"\r\n      Destinacion_Economica : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DestinacionEconomicaTipo;\r\n      /** Clasificación del suelo según el instrumento de planeación vigente.\r\n       */\r\n      !!@ ili2db.dispName = "Clase de suelo"\r\n      Clase_Suelo : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ClaseSueloTipo;\r\n      /** Categoría del suelo según el instrumento de planeación vigente.\r\n       */\r\n      !!@ ili2db.dispName = "Categoría de suelo"\r\n      Categoria_Suelo : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_CategoriaSueloTipo;\r\n      /** Relaciona los cambios del predio respecto de la información catastral vigente.\r\n       */\r\n      !!@ ili2db.dispName = "Novedad números prediales"\r\n      Novedad_Numeros_Prediales : BAG {0..*} OF Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.Levantamiento_Catastral.LC_EstructuraNovedadNumeroPredial;\r\n      /** Relaciona los cambios del predio respecto de la información registral vigente.\r\n       */\r\n      !!@ ili2db.dispName = "Novedad folio de matrícula de inmobiliaria"\r\n      Novedad_FMI : BAG {0..*} OF Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.Levantamiento_Catastral.LC_EstructuraNovedadFMI;\r\n      /** Observaciones generales respecto del predio.\r\n       */\r\n      !!@ ili2db.dispName = "Observaciones"\r\n      Observaciones : MTEXT*500;\r\n      /** Fecha de la visita en campo al predio.\r\n       */\r\n      !!@ ili2db.dispName = "Fecha de visita predial"\r\n      Fecha_Visita_predial : MANDATORY INTERLIS.XMLDate;\r\n      /** Indica el tipo de documento del reconocedor predial encargado de efectuar el levantamiento catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de documento del reconocedor predial"\r\n      Tipo_Documento_Reconocedor : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_InteresadoDocumentoTipo;\r\n      /** Indica el número de documento del reconocedor predial encargado de efectuar el levantamiento catastral.\r\n       */\r\n      !!@ ili2db.dispName = "Numero de documento del reconocedor predial"\r\n      Numero_Documento_Reconocedor : MANDATORY TEXT*50;\r\n      /** Primer nombre del delegado de ejecutar las actividades catastrales en campo en el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Primer nombre del reconocedor"\r\n      Primer_Nombre_Reconocedor : MANDATORY TEXT*100;\r\n      /** Segundo nombre del delegado de ejecutar las actividades catastrales en campo en el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo nombre del reconocedor"\r\n      Segundo_Nombre_Reconocedor : TEXT*100;\r\n      /** Primer apellido del delegado de ejecutar las actividades catastrales en campo en el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Primer apellido del reconocedor"\r\n      Primer_Apellido_Reconocedor : MANDATORY TEXT*100;\r\n      /** Segundo apellido del delegado de ejecutar las actividades catastrales en campo en el predio.\r\n       */\r\n      !!@ ili2db.dispName = "Segundo apellido del reconocedor"\r\n      Segundo_Apellido_Reconocedor : TEXT*100;\r\n      /** Posibles situaciones que se presentan y afectan el resultado del levantamiento de la información en campo.\r\n       */\r\n      !!@ ili2db.dispName = "Resultado de la visita predial"\r\n      Resultado_Visita : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ResultadoVisitaTipo;\r\n      /** Indica si dentro del proceso de formación o actualización catastral se suscribe acta de colindancia para el predio objeto de levantamiento catastral.\r\n       */\r\n      !!@ ili2db.dispName = "¿Se suscribe acta de colindancia?"\r\n      Suscribe_Acta_Colindancia : BOOLEAN;\r\n    END LC_DatosAdicionalesLevantamientoCatastral;\r\n\r\n    /** Puntos que definen los limites de las construcciones, unidad de construcción y servidumbres de transito.\r\n     */\r\n    !!@ ili2db.dispName = "Punto Levantamiento"\r\n    CLASS LC_PuntoLevantamiento\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_Punto =\r\n      /** Nombre o código del punto levantamiento.\r\n       */\r\n      !!@ ili2db.dispName = "ID del punto de levantamiento"\r\n      ID_Punto_Levantamiento : MANDATORY TEXT*255;\r\n      /** Indica la clasificación del tipo de punto de acuerdo a sus características.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de punto"\r\n      PuntoTipo (EXTENDED) : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoTipo;\r\n      /** Indica si el tipo de punto corresponde a una construcción o servidumbre de tránsito.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de punto de levantamiento"\r\n      Tipo_Punto_Levantamiento : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_PuntoLevTipo;\r\n      /** Indica si el punto es fotoidentificable.\r\n       */\r\n      !!@ ili2db.dispName = "Fotoidentificación"\r\n      Fotoidentificacion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_FotoidentificacionTipo;\r\n      /** Corresponde a la exactitud horizontal del punto levantamiento.\r\n       */\r\n      !!@ ili2db.dispName = "Exactitud horizontal"\r\n      Exactitud_Horizontal : MANDATORY 0.000 .. 10.000 [INTERLIS.m];\r\n      /** Corresponde a la exactitud vertical del punto levantamiento\r\n       */\r\n      !!@ ili2db.dispName = "Exactitud vertical"\r\n      Exactitud_Vertical : 0.000 .. 10.000 [INTERLIS.m];\r\n    END LC_PuntoLevantamiento;\r\n\r\n    /** Son las características de diseño y constructivas especiales de las construcciones y/o edificaciones.\r\n     */\r\n    !!@ ili2db.dispName = "Tipología de la construcción"\r\n    CLASS LC_TipologiaConstruccion\r\n    EXTENDS LC_CalificacionUnidadConstruccion =\r\n      /** Son las características de diseño y constructivas especiales de las construcciones y/o edificaciones.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de tipología"\r\n      Tipo_Tipologia : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_TipologiaTipo;\r\n    END LC_TipologiaConstruccion;\r\n\r\n    ASSOCIATION lc_interesado_interesadocontacto =\r\n      lc_contacto -- {0..*} LC_InteresadoContacto;\r\n      lc_interesado -- {1} LC_Interesado;\r\n    END lc_interesado_interesadocontacto;\r\n\r\n    ASSOCIATION lc_objetoconstruccion_grupocalificacion =\r\n      lc_grupo_calificacion -- {1} LC_GrupoCalificacion;\r\n      lc_objeto_construccion -- {0..*} LC_ObjetoConstruccion;\r\n    END lc_objetoconstruccion_grupocalificacion;\r\n\r\n    ASSOCIATION lc_ph_predio =\r\n      lc_predio -- {1} LC_Predio;\r\n      lc_datos_ph -- {0..1} LC_DatosPHCondominio;\r\n    END lc_ph_predio;\r\n\r\n    ASSOCIATION lc_predio_copropiedad =\r\n      predio -- {0..*} LC_Predio;\r\n      copropiedad -<> {0..1} LC_Predio;\r\n      coeficiente : LADM_COL_V3_0.LADM_Nucleo.Fraccion;\r\n    END lc_predio_copropiedad;\r\n\r\n    ASSOCIATION lc_predio_ini_predioinsumos =\r\n      ini_predio_insumos (EXTERNAL) -- {0..*} Submodelo_Integracion_Insumos_V1_0.Datos_Integracion_Insumos.INI_PredioInsumos;\r\n      lc_predio -- {0..*} LC_Predio;\r\n    END lc_predio_ini_predioinsumos;\r\n\r\n    ASSOCIATION lc_predio_ofertas_mercado_inmobiliario =\r\n      lc_predio -- {0..1} LC_Predio;\r\n      lc_ofertas_mercado_inmobiliario -- {0..*} LC_OfertasMercadoInmobiliario;\r\n    END lc_predio_ofertas_mercado_inmobiliario;\r\n\r\n    /** Tipo de unidad espacial que permite la representación de una servidumbre de paso asociada a una COL_BAUnit.\r\n     */\r\n    !!@ ili2db.dispName = "Servidumbre de Tránsito"\r\n    CLASS LC_ServidumbreTransito\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\r\n      /** Área total de la servidumbre.\r\n       */\r\n      !!@ ili2db.dispName = "Área de la servidumbre"\r\n      Area_Servidumbre : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\r\n    END LC_ServidumbreTransito;\r\n\r\n    ASSOCIATION lc_grupo_calificacionconvencional =\r\n      lc_calificacion_convencional -- {1} LC_CalificacionConvencional;\r\n      lc_grupo_calificacion -- {1..*} LC_GrupoCalificacion;\r\n    END lc_grupo_calificacionconvencional;\r\n\r\n    ASSOCIATION lc_informacion_adicional_contacto =\r\n      lc_contacto_visita -- {0..*} LC_ContactoVisita;\r\n      lc_datos_adicionales -- {1} LC_DatosAdicionalesLevantamientoCatastral;\r\n    END lc_informacion_adicional_contacto;\r\n\r\n    /** Relación entre el Predio catastral y la clase información adicional, que permite determinar sobre qué predio se toman los datos específicos del predio para catastro multipropósito\r\n     */\r\n    ASSOCIATION lc_informacion_adicional_predio =\r\n      lc_predio (EXTERNAL) -- {1} LC_Predio;\r\n      lc_datos_adicionales -- {0..1} LC_DatosAdicionalesLevantamientoCatastral;\r\n    END lc_informacion_adicional_predio;\r\n\r\n    /** Es cada conjunto de materiales consolidados dentro de un predio que tiene unas características específicas en cuanto a elementos constitutivos físicos y usos de la misma.\r\n     */\r\n    !!@ ili2db.dispName = "Unidad de Construcción"\r\n    CLASS LC_UnidadConstruccion\r\n    EXTENDS LADM_COL_V3_0.LADM_Nucleo.COL_UnidadEspacial =\r\n      /** Identificado de la unidad de construcción, su codificación puede ser por letras del abecedario.\r\n       */\r\n      !!@ ili2db.dispName = "Identificador"\r\n      Identificador : MANDATORY TEXT*3;\r\n      /** Indica el tipo de dominio de la unidad de construcción: común y privado.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de dominio"\r\n      Tipo_Dominio : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_DominioConstruccionTipo;\r\n      /** Indica si la construcción es de tipo convencional o no convencional.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de construcción"\r\n      Tipo_Construccion : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ConstruccionTipo;\r\n      /** Indica si la unidad de construcción es residencial, comercial, industrial o anexo.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de unidad de construcción"\r\n      Tipo_Unidad_Construccion : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_UnidadConstruccionTipo;\r\n      /** Indica el tipo de planta donde se ubica la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Tipo de planta"\r\n      Tipo_Planta : MANDATORY Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_ConstruccionPlantaTipo;\r\n      /** Indica numéricamente la ubicación del predio de acuerdo al tipo de planta.\r\n       */\r\n      !!@ ili2db.dispName = "Planta ubicación"\r\n      Planta_Ubicacion : MANDATORY 0 .. 500;\r\n      /** Número total de  habitaciones en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de habitaciones"\r\n      Total_Habitaciones : 0 .. 999999;\r\n      /** Número total de baños en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de baños"\r\n      Total_Banios : 0 .. 999999;\r\n      /** Número total de locales en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de locales"\r\n      Total_Locales : 0 .. 999999;\r\n      /** Número total de pisos en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Total de pisos"\r\n      Total_Pisos : 0 .. 150;\r\n      /** Actividad que se desarrolla en una unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Uso"\r\n      Uso : Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.LC_UsoUConsTipo;\r\n      /** Año de construcción de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Año de construcción"\r\n      Anio_Construccion : 1512 .. 2500;\r\n      /** Avalúo catastral de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Avalúo de la unidad de construcción"\r\n      Avaluo_Unidad_Construccion : LADM_COL_V3_0.LADM_Nucleo.Peso;\r\n      /** Área total construida en la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Área construida"\r\n      Area_Construida : MANDATORY 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\r\n      /** Área total privada de la unidad de construcción para los predios en régimen de propiedad horizontal.\r\n       */\r\n      !!@ ili2db.dispName = "Área privada construida"\r\n      Area_Privada_Construida : 0.0 .. 99999999999999.9 [LADM_COL_V3_0.m2];\r\n      /** Altura total de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Altura"\r\n      Altura : 1 .. 1000 [INTERLIS.m];\r\n      /** Observaciones generales respecto de la unidad de construcción.\r\n       */\r\n      !!@ ili2db.dispName = "Observaciones"\r\n      Observaciones : TEXT;\r\n    END LC_UnidadConstruccion;\r\n\r\n    /** Relación entre la clase Unidad_Construccion del modelo de Avalúos y Calificacion_Unidad_Construccion de modelo de Avalúos\r\n     */\r\n    ASSOCIATION lc_calificacion_unidadconstruccion =\r\n      lc_unidad_construccion (EXTERNAL) -- {1} LC_UnidadConstruccion;\r\n      lc_calificacion_unidad_construccion -- {0..1} LC_CalificacionUnidadConstruccion;\r\n    END lc_calificacion_unidadconstruccion;\r\n\r\n    ASSOCIATION lc_construccion_unidadconstruccion =\r\n      lc_unidadconstruccion -- {0..*} LC_UnidadConstruccion;\r\n      lc_construccion -<> {1} LC_Construccion;\r\n    END lc_construccion_unidadconstruccion;\r\n\r\n  END Levantamiento_Catastral;\r\n\r\nEND Modelo_Aplicacion_LADMCOL_Lev_Cat_V1_0.\r\n	2020-06-24 11:50:42.406
